(1, 4254, '2019-04-03T12:38:48', 8, '2019-04-08T16:59:37', 'a-little-update-from-the-leverage-team', 'publish', 'https://leverage.it/a-little-update-from-the-leverage-team/', 'A little update from the Leverage team', '<p>[vc_row][vc_column][vc_column_text]This content is plagiarized <a href=\"https://us1.campaign-archive.com/?u=5bdb96e70a9fa5632be825a18&amp;id=5eeaeac82e\">from our first email</a>, which went out earlier this week. Feel free to subscribe here, if you&#8217;d like to receive them.</p>\n<p>We&#8217;ve been powering start-ups for over 5 years, helping teams actualize their visions and ideas into real products used by both large enterprise and everyday consumers. In that time, our team has grown to over 20 and one of our first partners went public <a href=\"https://www.enthusiastgaming.com/\" target=\"_blank\" rel=\"noopener\">(Enthusiast Gaming)</a>. This year one of our clients processed over $100M using technology we power. Last but not least, we&#8217;ve expanded to the US and Israel &#8211; <a href=\"https://leverage.it/leverageit-acquires-illuminea-a-leading-wordpress-development-agency-in-israel/\" target=\"_blank\" rel=\"noopener\">even buying an Israeli digital agency.</a></p>\n<div><a href=\"https://i1.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-team.jpg?ssl=1\"><img class=\"alignnone wp-image-4262 size-full\" src=\"https://i1.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-team.jpg?resize=1080%2C576&#038;ssl=1\" alt=\"\" width=\"1080\" height=\"576\" srcset=\"https://i1.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-team.jpg?w=1920&amp;ssl=1 1920w, https://i1.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-team.jpg?resize=300%2C160&amp;ssl=1 300w, https://i1.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-team.jpg?resize=768%2C410&amp;ssl=1 768w, https://i1.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-team.jpg?resize=1024%2C546&amp;ssl=1 1024w\" sizes=\"(max-width: 1080px) 100vw, 1080px\" data-recalc-dims=\"1\" /></a></div>\n<div>\n<p>Community is at the heart of what we do. Through introductions our agency helped our partners forge many incredible relationships over the years, creating both successful companies and lasting friendships. We’d like to continue bringing founders, talented individuals, and investors together to create some of the most exciting tech coming out of Toronto and Canada today! However, we have not done a good enough job of communicating this success with you all. The success of others can inspire your team and product, helping you find solutions to all sorts of pain points and challenges. This <del>email</del> blog post is the start of that. So without further ado, it’s time to leverage (pun intended) the amazing ecosystem and community and bring you highlights of our projects, clients, and partners.</p>\n</div>\n<p><!--End mc_embed_signup-->[/vc_column_text][vc_column_text css=&#8221;.vc_custom_1554742406348{padding-top: 75px !important;padding-bottom: 75px !important;}&#8221;]</p>\n<div>\n<p dir=\"ltr\"><a href=\"https://i0.wp.com/leverage.it/wp-content/uploads/2019/04/illuminea-logo.png?ssl=1\"><img class=\"alignnone size-full wp-image-4263\" src=\"https://i0.wp.com/leverage.it/wp-content/uploads/2019/04/illuminea-logo.png?resize=186%2C39&#038;ssl=1\" alt=\"\" width=\"186\" height=\"39\" data-recalc-dims=\"1\" /></a></p>\n</div>\n<h3 class=\"null\">Leverage is now in Israel.</h3>\n<div><a href=\"https://leverage.it/leverageit-acquires-illuminea-a-leading-wordpress-development-agency-in-israel/\" target=\"_blank\" rel=\"noopener\"><strong>Learn More.</strong></a><br />\n<a href=\"https://betakit.com/leverageit-acquires-wordpress-development-agency-illuminea-to-tap-israeli-market/\" target=\"_blank\" rel=\"noopener\"><strong>BetaKit article.</strong></a></div>\n<p><!--End mc_embed_signup-->[/vc_column_text][vc_column_text]</p>\n<div></div>\n<h2>The latest from our team</h2>\n<h3>Development</h3>\n<div>\n<p><a href=\"https://i0.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-development.jpg?ssl=1\"><img class=\"alignnone size-full wp-image-4260\" src=\"https://i0.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-development.jpg?resize=1053%2C566&#038;ssl=1\" alt=\"\" width=\"1053\" height=\"566\" srcset=\"https://i0.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-development.jpg?w=1053&amp;ssl=1 1053w, https://i0.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-development.jpg?resize=300%2C161&amp;ssl=1 300w, https://i0.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-development.jpg?resize=768%2C413&amp;ssl=1 768w, https://i0.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-development.jpg?resize=1024%2C550&amp;ssl=1 1024w\" sizes=\"(max-width: 1053px) 100vw, 1053px\" data-recalc-dims=\"1\" /></a>These past few months have been very exciting for the website development team. We have had the opportunity to work on projects spanning a wide variety of industries with varying degrees of complexities. We have honed our skills to become masters of custom WordPress solutions including theme and plugin development. We love the challenge and satisfaction that comes with seeing our work broadcast to the world (well, the web world!) and the smiles on our client’s faces!</p>\n<p>&#8211; Aviva, Managing Director,illuminea: a LeverageIT company.</p>\n<p>&nbsp;</p>\n</div>\n<h3>Marketing</h3>\n<p><a href=\"https://i1.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-marketing.jpg?ssl=1\"><img class=\"alignnone size-full wp-image-4261\" src=\"https://i1.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-marketing.jpg?resize=1053%2C566&#038;ssl=1\" alt=\"\" width=\"1053\" height=\"566\" srcset=\"https://i1.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-marketing.jpg?w=1053&amp;ssl=1 1053w, https://i1.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-marketing.jpg?resize=300%2C161&amp;ssl=1 300w, https://i1.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-marketing.jpg?resize=768%2C413&amp;ssl=1 768w, https://i1.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-marketing.jpg?resize=1024%2C550&amp;ssl=1 1024w\" sizes=\"(max-width: 1053px) 100vw, 1053px\" data-recalc-dims=\"1\" /></a></p>\n<div>\n<p>Like a shoemaker without shoes, we’ve been a bit lackluster with our own marketing efforts over the years. Though, to be fair, we have a good excuse: prioritizing our client projects. We’re hoping to change that this year with more content from our team in your inbox and on your social channels. We’re looking to providing you with valuable information around news, trends, and best practices in digital, so if you have any questions you’d like us to answer with regards to design, dev, or marketing, don’t hesitate to ask.</p>\n<p>&#8211; Katy, Marketing &amp; Project Management</p>\n<p>&nbsp;</p>\n</div>\n<h3>Design</h3>\n<p><a href=\"https://i0.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-design.jpg?ssl=1\"><img class=\"alignnone size-full wp-image-4259\" src=\"https://i0.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-design.jpg?resize=1053%2C566&#038;ssl=1\" alt=\"\" width=\"1053\" height=\"566\" srcset=\"https://i0.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-design.jpg?w=1053&amp;ssl=1 1053w, https://i0.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-design.jpg?resize=300%2C161&amp;ssl=1 300w, https://i0.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-design.jpg?resize=768%2C413&amp;ssl=1 768w, https://i0.wp.com/leverage.it/wp-content/uploads/2019/04/leverageit-design.jpg?resize=1024%2C550&amp;ssl=1 1024w\" sizes=\"(max-width: 1053px) 100vw, 1053px\" data-recalc-dims=\"1\" /></a></p>\n<div>\n<p>What an incredible year. Over 2018 our design team took on dozens of some of the biggest and most exciting projects we’ve done yet. Each new task brought with it a lesson, and each lesson allowed us to take the next big thing even further. We raised the bar on quality and we can’t wait to do it again! This year we look forward to expanding our design team and growing side by side with our development team to take on even bigger and better projects.</p>\n<p>&#8211; Emily, Creative Director</p>\n<p>&nbsp;</p>\n</div>\n<h2>In the news</h2>\n<p>Media coverage of our clients work.</p>\n<h5><strong>Toronto.com &#8211; Mediseen</strong></h5>\n<p><a href=\"https://www.toronto.com/news-story/9087029-toronto-based-digital-health-platform-aims-to-revive-the-house-call/\" target=\"_blank\" rel=\"noopener\">Toronto-based digital health platform aims to revive the house call.</a></p>\n<h5 class=\"null\"><strong>VentureBeat &#8211; Enthusiast Gaming</strong></h5>\n<p><a href=\"https://www.toronto.com/news-story/9087029-toronto-based-digital-health-platform-aims-to-revive-the-house-call/\" target=\"_blank\" rel=\"noopener\">E</a><a href=\"https://venturebeat.com/2018/10/04/enthusiast-gaming-goes-public-in-canada-to-build-game-fan-network/\" target=\"_blank\" rel=\"noopener\">nthusiast Gaming goes public in Canada to build game fan network.</a></p>\n<h5 class=\"null\"><strong>PR Newswire &#8211; Engie Resources</strong></h5>\n<p><a href=\"https://www.prnewswire.com/news-releases/engie-resources-acquires-plymouth-rock-energy-300768978.html\" target=\"_blank\" rel=\"noopener\">E</a><a href=\"https://www.prnewswire.com/news-releases/engie-resources-acquires-plymouth-rock-energy-300768978.html\">ngie</a><a href=\"https://www.prnewswire.com/news-releases/engie-resources-acquires-plymouth-rock-energy-300768978.html\"> Resources acquires </a><a href=\"https://www.prnewswire.com/news-releases/engie-resources-acquires-plymouth-rock-energy-300768978.html\">plymouth</a><a href=\"https://www.prnewswire.com/news-releases/engie-resources-acquires-plymouth-rock-energy-300768978.html\"> rock energy.</a></p>\n<h5 class=\"null\"><strong>Finsmes &#8211; SafeToNet</strong></h5>\n<p><a href=\"http://www.finsmes.com/2018/06/safetonet-raises-13m-series-a-funding-acquires-visr.html\" target=\"_blank\" rel=\"noopener\">SafeToNet raises $13 million in series A funding; Acquires Visr.</a></p>\n<h5 class=\"null\"><strong>BetaKit &#8211; LeverageIT</strong></h5>\n<p><a href=\"https://betakit.com/leverageit-acquires-wordpress-development-agency-illuminea-to-tap-israeli-market/\" target=\"_blank\" rel=\"noopener\">LeverageIT acquires WordPress development agency Illuminea to tap Israeli market.</a></p>\n<p>&nbsp;</p>\n<h2>Job board</h2>\n<p>We can vouch for our clients, you&#8217;ll be glad to work with their talented teams.</p>\n<h5 class=\"null\"><strong>Content Manager &#8211; Enthusiast Gaming</strong></h5>\n<p><a href=\"https://secure.collage.co/jobs/enthusiastgaming/9520\" target=\"_blank\" rel=\"noopener\">https://secure.collage.co/jobs/enthusiastgaming/9520</a></p>\n<h5 class=\"null\"><strong>Backend Engineer &#8211; Browze</strong></h5>\n<p><a href=\"https://angel.co/browze/jobs\" target=\"_blank\" rel=\"noopener\">https://angel.co/browze/jobs</a></p>\n<h5 class=\"null\"><strong>Mobile App User Acquisition &#8211; Browze</strong></h5>\n<p><a href=\"https://angel.co/browze/jobs\" target=\"_blank\" rel=\"noopener\">https://angel.co/browze/jobs</a></p>\n<p><!-- Begin Mailchimp Signup Form --></p>\n<style type=\"text/css\">\n	#mc_embed_signup{background:#fff; clear:left; font:14px Helvetica,Arial,sans-serif; width:100%;}<br />	/* Add your own Mailchimp form style overrides in your site stylesheet or in this style block.<br />	   We recommend moving this block and the preceding CSS link to the HEAD of your HTML file. */<br /></style>\n<div id=\"mc_embed_signup\">\n<form id=\"mc-embedded-subscribe-form\" class=\"validate\" action=\"https://leverage.us1.list-manage.com/subscribe/post?u=5bdb96e70a9fa5632be825a18&amp;id=6415049b36\" method=\"post\" name=\"mc-embedded-subscribe-form\" novalidate=\"\" target=\"_blank\">\n<div id=\"mc_embed_signup_scroll\">\n<p><label for=\"mce-EMAIL\">Subscribe to stay updated on the latest news from our team.</label><br />\n<input id=\"mce-EMAIL\" class=\"email\" name=\"EMAIL\" required=\"\" type=\"email\" value=\"\" placeholder=\"email address\" /><br />\n<!-- real people should not fill this in and expect good things - do not remove this or risk form bot signups--></p>\n<div style=\"position: absolute; left: -5000px;\" aria-hidden=\"true\"><input tabindex=\"-1\" name=\"b_5bdb96e70a9fa5632be825a18_6415049b36\" type=\"text\" value=\"\" /></div>\n<div class=\"clear\"><input id=\"mc-embedded-subscribe\" class=\"button\" name=\"subscribe\" type=\"submit\" value=\"Subscribe\" /></div>\n</div>\n</form>\n</div>\n<p><!--End mc_embed_signup-->[/vc_column_text][/vc_column][/vc_row]</p>\n', '<p>[vc_row][vc_column][vc_column_text]This content is plagiarized from our first email, which went out earlier this week. Feel free to subscribe here, if you&#8217;d like to receive them. We&#8217;ve been powering start-ups for over 5 years, helping teams actualize their visions and ideas into real products used by both large enterprise and everyday consumers. In that time, our [&hellip;]</p>\n', 4281, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(2, 4240, '2019-01-14T12:38:46', 9, '2019-01-14T13:38:58', 'leverageit-acquires-illuminea-a-leading-wordpress-development-agency-in-israel', 'publish', 'https://leverage.it/leverageit-acquires-illuminea-a-leading-wordpress-development-agency-in-israel/', 'LeverageIT acquires illuminea, a leading WordPress development agency in Israel', '<p>It&#8217;s a new year and we&#8217;d like to kick it off in a big way with our first acquisition! We are thrilled to announce our recent acquisition of <a href=\"https://illuminea.com/\">illuminea</a>, one of the top WordPress agencies in Israel.</p>\n<p>Founded by Miriam Schwab in 2005, illuminea has grown to become one of the leading WordPress agencies in Israel, working with top Israeli companies, startups, and academic institutions. illuminea clients include startups like MyHeritage, Freightos, and Fundbox, and academic institutions like <span class=\"xn-org\">Bar Ilan University</span> and <span class=\"xn-org\">Tel Aviv University</span>.</p>\n<p>Twelve years after starting the company, Miriam is happy and excited about the acquisition, and is confident illuminea is in good hands with LeverageIT. Miriam Schwab will continue to play a role at illuminea in order to maintain the high quality of projects that illuminea has come to be known for in their 12 years of business. This purchase allows the current clientele of illuminea to benefit from the increased services now available to them. The new office in Jerusalem adds to LeverageIT’s current offices in Detroit and the head office in Toronto.</p>\n<p>Our team on the ground in Israel is headed up by Aviva Krygier, a WordPress lover herself, who brings 10 years of experience and a deep commitment to providing the same level of service that illuminea&#8217;s clientele have come to expect. You can reach Aviva at aviva@illuminea.com.</p>\n<p>Meir Bulua, founder of LeverageIT, said, &#8220;We are very excited to engage with the Israeli market and gain a foothold in a landscape known for its startup and tech-first approach. Miriam and illuminea&#8217;s reputation in both the startup and WordPress communities made it the perfect partner to launch our Israeli venture. I am confident <span class=\"xn-person\">Aviva Krygier</span>, the new Managing Director of Illuminea, will bring the same dedication and expertise to the Israeli Market as she has to LeverageIT.&#8221;</p>\n<p>We can&#8217;t wait to help more Israeli companies with their tech projects. If you&#8217;re in the market for help with development, marketing, and/or design, then don&#8217;t hesitate to reach out!</p>\n<p>&nbsp;</p>\n', '<p>It&#8217;s a new year and we&#8217;d like to kick it off in a big way with our first acquisition! We are thrilled to announce our recent acquisition of illuminea, one of the top WordPress agencies in Israel. Founded by Miriam Schwab in 2005, illuminea has grown to become one of the leading WordPress agencies in [&hellip;]</p>\n', 4247, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(3, 4230, '2018-12-06T11:48:08', 2, '2018-12-06T11:50:45', 'whats-all-this-talk-about-gutenberg', 'publish', 'https://leverage.it/whats-all-this-talk-about-gutenberg/', 'What&#8217;s all this talk about Gutenberg?', '<p>The latest WordPress release is set to hit the shelves this week and there&#8217;s been a lot of buzz in the community surrounding it. WordPress 5.0, codenamed Gutenberg, is one of the largest changes we&#8217;ve seen to the actual dashboard interface in a while. Following in the footsteps of Elementor, Visual Composer, Divi and other popular page builders, Gutenberg introduces blocks as the main method for adding content to posts and pages. The idea is to bring content creation to the masses, allowing those without coding know-how to publish beautiful websites.</p>\n<p>While in theory, this is an exciting update to WordPress, a CMS that populates more than 30% of the entire web, there are some considerations that need to be made before jumping to hit that &#8216;upgrade&#8217; button on your site. Because Gutenberg is such a drastic departure from the TinyMCE editor we&#8217;ve grown to know and love, the latest forum activity has shown it to be significantly more &#8216;buggy&#8217; than previous versions. There are also numerous articles outlining how much more cumbersome certain actions are now &#8211; what used to be a simple line of code now requires numerous clicks to achieve.</p>\n<p>The biggest issue arising is not with new sites, rather with older sites that are attempting to upgrade to Gutenberg. The WordPress plugin community is vast, and attempting to reduce plugin conflict has been a rocky road. Many users are finding their sites &#8216;broken&#8217; after the update because the plugins that they are using are not compatible with Gutenberg.</p>\n<p>Johannes Gensfleisch zur Laden zum Gutenberg may have been the original content publisher, but I&#8217;d guess even he would hold off on updating his site. I&#8217;m not questioning that the future could be grand for Gutenberg, I&#8217;m just cautioning that we may not be quite there yet.</p>\n', '<p>The latest WordPress release is set to hit the shelves this week and there&#8217;s been a lot of buzz in the community surrounding it. WordPress 5.0, codenamed Gutenberg, is one of the largest changes we&#8217;ve seen to the actual dashboard interface in a while. Following in the footsteps of Elementor, Visual Composer, Divi and other [&hellip;]</p>\n', 4234, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(4, 4191, '2018-10-04T17:05:02', 8, '2018-10-14T12:05:08', 'enthusiast-gaming-going-public-with-a-brand-new-website', 'publish', 'https://leverage.it/enthusiast-gaming-going-public-with-a-brand-new-website/', 'Enthusiast Gaming: Going public with a brand new website', '<p><span style=\"font-weight: 400;\">Enthusiast gaming, one of Canada’s largest gaming companies, and our long-time client is going public, and we couldn’t be more excited. We’ve partnered with them on several projects including support with </span><a href=\"https://eglx.ca/\"><span style=\"font-weight: 400;\">EGLX</span></a><span style=\"font-weight: 400;\">, Canada’s largest gaming expo, their </span><a href=\"http://enthusiast.gg/\"><span style=\"font-weight: 400;\">social network, Enthusiast.gg</span></a><span style=\"font-weight: 400;\">, and&#8211;most recently&#8211;</span><a href=\"http://enthusiastgaming.com/\"><span style=\"font-weight: 400;\"> the rebrand and launch of their new website</span></a><span style=\"font-weight: 400;\">. </span></p>\n<p><span style=\"font-weight: 400;\">It’s this recent project that we’d like to focus on: the new and improved Enthusiast Gaming website. </span></p>\n<h3><b><a href=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/10/MobileNotebook-1.png?ssl=1\"><img class=\"alignnone size-full wp-image-4204\" src=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/10/MobileNotebook-1.png?resize=1000%2C750&#038;ssl=1\" alt=\"\" width=\"1000\" height=\"750\" srcset=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/10/MobileNotebook-1.png?w=1000&amp;ssl=1 1000w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/10/MobileNotebook-1.png?resize=300%2C225&amp;ssl=1 300w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/10/MobileNotebook-1.png?resize=768%2C576&amp;ssl=1 768w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/10/MobileNotebook-1.png?resize=560%2C420&amp;ssl=1 560w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/10/MobileNotebook-1.png?resize=900%2C675&amp;ssl=1 900w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/10/MobileNotebook-1.png?resize=120%2C90&amp;ssl=1 120w\" sizes=\"(max-width: 1000px) 100vw, 1000px\" data-recalc-dims=\"1\" /></a>The challenge</b></h3>\n<ul>\n<li><span style=\"font-weight: 400;\">Timing &#8211; Our team knew Enthusiast Gaming  would be going public in the near future, but didn’t have a specific launch date to work towards. We had to work quickly and efficiently, knowing that the site may need to launch at a moment’s notice.</span></li>\n<li><span style=\"font-weight: 400;\">Optimizing for various business offerings &#8211; Enthusiast Gaming has grown into a true gaming conglomerate over the last few years. The company has 3 main components, which our team had to present in a coherent and effective way:</span></li>\n</ul>\n<table>\n<tbody>\n<tr>\n<td>\n<p style=\"text-align: center;\"><b>Content</b></p>\n</td>\n<td style=\"text-align: center;\"><b>Advertising</b></td>\n<td style=\"text-align: center;\"><b>Events</b></td>\n</tr>\n<tr>\n<td style=\"text-align: center;\"><span style=\"font-weight: 400;\">Growing network of owned websites and affiliated partners</span></td>\n<td style=\"text-align: center;\"><span style=\"font-weight: 400;\">Our advertising network generates over 1 billion ad requests per week</span></td>\n<td>\n<p style=\"text-align: center;\"><span style=\"font-weight: 400;\">Creators and organizers of the largest video game expo in Canada</span></p>\n</td>\n</tr>\n</tbody>\n</table>\n<ul>\n<li><span style=\"font-weight: 400;\">Expanding audience &#8211; Going public means a new audience coming to your website: investors. New content needed to be developed that appealed not only to existing partners, but also to potential investors who may not know much about the gaming industry.</span><b></b></li>\n</ul>\n<h4><b><a href=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/10/MobileDesktopiPad.png?ssl=1\"><img class=\"size-full wp-image-4198 aligncenter\" src=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/10/MobileDesktopiPad.png?resize=1000%2C668&#038;ssl=1\" alt=\"\" width=\"1000\" height=\"668\" srcset=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/10/MobileDesktopiPad.png?w=1000&amp;ssl=1 1000w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/10/MobileDesktopiPad.png?resize=300%2C200&amp;ssl=1 300w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/10/MobileDesktopiPad.png?resize=768%2C513&amp;ssl=1 768w\" sizes=\"(max-width: 1000px) 100vw, 1000px\" data-recalc-dims=\"1\" /></a>The solution</b></h4>\n<p><span style=\"font-weight: 400;\">We wanted to capture the excitement and growth happening at Enthusiast Gaming, so we took the lead in working closely with several departments within the company to create content that best represented them. </span></p>\n<p><span style=\"font-weight: 400;\">After ideating content, our design team was </span><b>on it</b><span style=\"font-weight: 400;\">. We conceptualized a creative direction that would be slick, intriguing and simple, appealing to the contrasting demographics that would soon be visiting Enthusiastgaming.com.</span></p>\n<h4><b>Tools used:</b></h4>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Photoshop</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Invision</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Slack</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Google docs</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">WordPress</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Mailchimp </span></li>\n</ul>\n<h4><b>Experience the new EnthusiastGaming.com</b></h4>\n<p><span style=\"font-weight: 400;\">Visit our work at </span><a href=\"http://www.enthusiastgaming.com\"><span style=\"font-weight: 400;\">enthusiastgaming.com</span></a><span style=\"font-weight: 400;\">. We are proud supporters of Enthusiast Gaming in their commitment to growing authentic gaming communities, passionately and disruptively. We look forward to seeing where they go next, and support them every step of the way.</span></p>\n', '<p>Enthusiast gaming, one of Canada’s largest gaming companies, and our long-time client is going public, and we couldn’t be more excited. We’ve partnered with them on several projects including support with EGLX, Canada’s largest gaming expo, their social network, Enthusiast.gg, and&#8211;most recently&#8211; the rebrand and launch of their new website. It’s this recent project that [&hellip;]</p>\n', 4202, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(5, 4167, '2018-09-07T14:35:31', 12, '2018-09-07T14:38:08', 'logo-design-using-fiverr-3-reasons-why-you-should-never-do-it', 'publish', 'https://leverage.it/logo-design-using-fiverr-3-reasons-why-you-should-never-do-it/', 'Logo design using Fiverr? 3 reasons why you should NEVER do it', '<p>&nbsp;</p>\n<p><span style=\"font-weight: 400;\"><a href=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/09/jason-leung-583454-unsplash.jpg?ssl=1\"><img class=\"alignnone wp-image-4168 size-full\" src=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/09/jason-leung-583454-unsplash.jpg?resize=1080%2C720&#038;ssl=1\" alt=\"image of logo on window\" width=\"1080\" height=\"720\" srcset=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/09/jason-leung-583454-unsplash.jpg?w=5760&amp;ssl=1 5760w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/09/jason-leung-583454-unsplash.jpg?resize=300%2C200&amp;ssl=1 300w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/09/jason-leung-583454-unsplash.jpg?resize=768%2C512&amp;ssl=1 768w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/09/jason-leung-583454-unsplash.jpg?resize=1024%2C683&amp;ssl=1 1024w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/09/jason-leung-583454-unsplash.jpg?resize=1920%2C1280&amp;ssl=1 1920w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/09/jason-leung-583454-unsplash.jpg?w=2160&amp;ssl=1 2160w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/09/jason-leung-583454-unsplash.jpg?w=3240&amp;ssl=1 3240w\" sizes=\"(max-width: 1080px) 100vw, 1080px\" data-recalc-dims=\"1\" /></a></span></p>\n<h6><span style=\"font-weight: 400;\">First of all, full disclosure: </span></h6>\n<p><span style=\"font-weight: 400;\">as a branding agency we’re going to be biased as to why using online marketplaces like Fiverr is a no-go for logo design. With that said, there is a time and place for using a free or cheap online logo generator, and we’ll explain when it’s a good idea and when it’s not.</span></p>\n<p><span style=\"font-weight: 400;\">Here’s the part where we tell you when it’s not.</span></p>\n<p>&nbsp;</p>\n<h4><strong>1. The will logo design suck</strong><span style=\"font-weight: 400;\"><br />\n</span></h4>\n<p><span style=\"font-weight: 400;\">You get what you pay for. Free logo design or even cheap logo design always equals bad logo design. What do we mean by bad?</span></p>\n<ul>\n<li>Unoriginal work. You run the risk of seeing your precious logo slapped on someone else&#8217;s website.</li>\n<li>Did we say unoriginal work? Lot&#8217;s of designers will take existing designs from stock websites, tweak a few things and call it a day.</li>\n<li>Overall poor quality. It&#8217;s commonplace for designers to hand off files that are grainy or maybe the linework sucks, or perhaps the typography looks like it came from the 90s.</li>\n</ul>\n<p>&nbsp;</p>\n<h4><strong>2. You’ll waste your time</strong></h4>\n<p>This by far is the most important takeaway. By the time you&#8217;ve pitched your design, interviewed candidates, corresponded with the designer (they oftentimes aren&#8217;t even in the same timezone as you), and go back and forth with edits, you’ll wish you hadn’t. If time is money, you’ll be spending more in the project management  than you would have if you just went with an agency.</p>\n<p>&nbsp;</p>\n<h4><strong>3. You&#8217;ll waste your money</strong></h4>\n<p>There has been countless stories about people spending $100 and ending up with nothing. Zero. Just google, &#8220;Fiverr Logo here&#8217;s what happened&#8221;. You&#8217;ll see results like &#8220;$5 logo? Is this a joke?&#8221; What tends to happen is clients will be unsatisfied with the work provided and request more iterations which means forking up more money. By the time most people reach the $100 mark, they just abandon ship.</p>\n<p>Here&#8217;s when it&#8217;s okay to use Fiverr or an online logo maker.</p>\n<p>You must be all of these things in order to get a good experience when using Fiverr:</p>\n<ul>\n<li>Uninvested in the project (maybe the logo is for a &#8216;just for fun event&#8217; DO NOT use this for a business you want to invest time into).</li>\n<li>Unbothered by a drawn out timeline (you can spare a few weeks to get the final artwork).</li>\n<li>Unpicky (Not a word, but we had a theme going).</li>\n</ul>\n<p>So let&#8217;s say you&#8217;re the opposite. You want a great logo and you want it quickly.</p>\n<p><em>*Cue shameless plug*</em></p>\n<p>No, you don&#8217;t have to run to a top marketing agency that will charge you 20k. There&#8217;s a happy medium.</p>\n<p>Working with a boutique full-service agency is a good call for many reasons. Firstly, you&#8217;ll get focused attention to reach your business objectives instead of cookie cutter solutions. Secondly, we say &#8216;full service&#8217; because chances are if you&#8217;re needing a logo design, you&#8217;re needing more services as well. Leverage.it offers app development, web development and full branding. Centralizing the work and bundling it will make things easier time-wise and less expensive than contracting that work out separately.</p>\n<p><a href=\"https://leverage.it/what-we-do/\">Take a peek at some of our past work. </a></p>\n', '<p>&nbsp; First of all, full disclosure: as a branding agency we’re going to be biased as to why using online marketplaces like Fiverr is a no-go for logo design. With that said, there is a time and place for using a free or cheap online logo generator, and we’ll explain when it’s a good idea [&hellip;]</p>\n', 4168, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(6, 4153, '2018-08-26T16:25:59', 12, '2018-08-26T16:27:11', 'what-makes-good-office-culture', 'publish', 'https://leverage.it/what-makes-good-office-culture/', 'The Rise and Fall of the &#8220;Beanbag Chair Office Culture&#8221;', '<p><a href=\"https://i1.wp.com/leverage.it/wp-content/uploads/2018/08/DEATH-TO-BEANBAG-CHAIR-OFFICE-CULTURE.jpeg?ssl=1\"><img class=\"alignnone wp-image-4154 size-full\" src=\"https://i1.wp.com/leverage.it/wp-content/uploads/2018/08/DEATH-TO-BEANBAG-CHAIR-OFFICE-CULTURE.jpeg?resize=1080%2C640&#038;ssl=1\" alt=\"Woman sitting on beanbag chair and working\" width=\"1080\" height=\"640\" srcset=\"https://i1.wp.com/leverage.it/wp-content/uploads/2018/08/DEATH-TO-BEANBAG-CHAIR-OFFICE-CULTURE.jpeg?w=1200&amp;ssl=1 1200w, https://i1.wp.com/leverage.it/wp-content/uploads/2018/08/DEATH-TO-BEANBAG-CHAIR-OFFICE-CULTURE.jpeg?resize=300%2C178&amp;ssl=1 300w, https://i1.wp.com/leverage.it/wp-content/uploads/2018/08/DEATH-TO-BEANBAG-CHAIR-OFFICE-CULTURE.jpeg?resize=768%2C455&amp;ssl=1 768w, https://i1.wp.com/leverage.it/wp-content/uploads/2018/08/DEATH-TO-BEANBAG-CHAIR-OFFICE-CULTURE.jpeg?resize=1024%2C607&amp;ssl=1 1024w\" sizes=\"(max-width: 1080px) 100vw, 1080px\" data-recalc-dims=\"1\" /></a></p>\n<p><span style=\"font-weight: 400;\">More and more companies are adopting office culture that values work-life balance and more flexible environments. By the same token, more and more companies are missing the mark by thinking healthy3 office culture means plopping a beanbag chair in the middle of the room and having beer on tap.</span></p>\n<p>&nbsp;</p>\n<h2><b>What makes good organizational culture? </b></h2>\n<p><span style=\"font-weight: 400;\">So if it’s not about interior design and pool tables, what defines good office culture? In the end, the company’s personality is what makes the work experience either barely bearable or exciting and stimulating. Here are 6 important values that top-tier companies possess.</span></p>\n<p>&nbsp;</p>\n<h2><a href=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/dylan-gillis-533818-unsplash.jpg?ssl=1\"><img class=\"alignnone wp-image-4157 size-full\" src=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/dylan-gillis-533818-unsplash.jpg?resize=1080%2C720&#038;ssl=1\" alt=\"Meeting at a table\" width=\"1080\" height=\"720\" srcset=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/dylan-gillis-533818-unsplash.jpg?w=5472&amp;ssl=1 5472w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/dylan-gillis-533818-unsplash.jpg?resize=300%2C200&amp;ssl=1 300w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/dylan-gillis-533818-unsplash.jpg?resize=768%2C512&amp;ssl=1 768w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/dylan-gillis-533818-unsplash.jpg?resize=1024%2C683&amp;ssl=1 1024w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/dylan-gillis-533818-unsplash.jpg?resize=1920%2C1280&amp;ssl=1 1920w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/dylan-gillis-533818-unsplash.jpg?w=2160&amp;ssl=1 2160w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/dylan-gillis-533818-unsplash.jpg?w=3240&amp;ssl=1 3240w\" sizes=\"(max-width: 1080px) 100vw, 1080px\" data-recalc-dims=\"1\" /></a></h2>\n<h2><b>1. Trust</b></h2>\n<p><span style=\"font-weight: 400;\">When trust is shared amongst a team, that’s where the magic happens. It’s so refreshing for both team leads and employees to trust that the team is working hard to get the job done. At Leverage.it we all share the same end goal of creating a positive experience for our clients. Which leads us to the next point.</span></p>\n<p>&nbsp;</p>\n<h2><b><a href=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/DSC_6893.jpg?ssl=1\"><img class=\"alignnone wp-image-4156 size-full\" src=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/DSC_6893.jpg?resize=1080%2C715&#038;ssl=1\" alt=\"two laptops on desk with plant and coffee\" width=\"1080\" height=\"715\" srcset=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/DSC_6893.jpg?w=4928&amp;ssl=1 4928w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/DSC_6893.jpg?resize=300%2C199&amp;ssl=1 300w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/DSC_6893.jpg?resize=768%2C509&amp;ssl=1 768w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/DSC_6893.jpg?resize=1024%2C678&amp;ssl=1 1024w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/DSC_6893.jpg?resize=1920%2C1272&amp;ssl=1 1920w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/DSC_6893.jpg?w=2160&amp;ssl=1 2160w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/DSC_6893.jpg?w=3240&amp;ssl=1 3240w\" sizes=\"(max-width: 1080px) 100vw, 1080px\" data-recalc-dims=\"1\" /></a></b></h2>\n<h2><b>2. A like-minded team</b></h2>\n<p><span style=\"font-weight: 400;\">Soundboarding, brainstorming, leadership, innovating. There’s nothing that feels more fulfilling than working alongside coworkers that share the same vision as you. Sharing the same values and interests facilitates growth within the team; and that will always be evident to clients, consumers and other businesses. Leverage.it is proud to have a tight-knit team that also accepts and learns from one another in our differences. It is one of our main guiding principles to be open and non-judgemental of all viewpoints, beliefs and lifestyles. We stand behind our team.</span></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><a href=\"https://i1.wp.com/leverage.it/wp-content/uploads/2018/08/IMG_7241.jpg?ssl=1\"><img class=\"alignnone wp-image-4158 size-full\" src=\"https://i1.wp.com/leverage.it/wp-content/uploads/2018/08/IMG_7241.jpg?resize=1080%2C810&#038;ssl=1\" alt=\"Man crossing his legs on top of desk\" width=\"1080\" height=\"810\" srcset=\"https://i1.wp.com/leverage.it/wp-content/uploads/2018/08/IMG_7241.jpg?w=3264&amp;ssl=1 3264w, https://i1.wp.com/leverage.it/wp-content/uploads/2018/08/IMG_7241.jpg?resize=300%2C225&amp;ssl=1 300w, https://i1.wp.com/leverage.it/wp-content/uploads/2018/08/IMG_7241.jpg?resize=768%2C576&amp;ssl=1 768w, https://i1.wp.com/leverage.it/wp-content/uploads/2018/08/IMG_7241.jpg?resize=1024%2C768&amp;ssl=1 1024w, https://i1.wp.com/leverage.it/wp-content/uploads/2018/08/IMG_7241.jpg?resize=560%2C420&amp;ssl=1 560w, https://i1.wp.com/leverage.it/wp-content/uploads/2018/08/IMG_7241.jpg?resize=900%2C675&amp;ssl=1 900w, https://i1.wp.com/leverage.it/wp-content/uploads/2018/08/IMG_7241.jpg?resize=1920%2C1440&amp;ssl=1 1920w, https://i1.wp.com/leverage.it/wp-content/uploads/2018/08/IMG_7241.jpg?resize=120%2C90&amp;ssl=1 120w, https://i1.wp.com/leverage.it/wp-content/uploads/2018/08/IMG_7241.jpg?w=2160&amp;ssl=1 2160w\" sizes=\"(max-width: 1080px) 100vw, 1080px\" data-recalc-dims=\"1\" /></a></p>\n<h2><b>3. Flexibility</b></h2>\n<p><span style=\"font-weight: 400;\">Flexibility is important in allowing the team to grow personally. This will mean different things for different companies. For us it means supporting our employees in all parts of the world, and promoting work-life balance. It has already been proven that happier employees make for better employees. As of recent, companies have been adopting initiatives such as healthy living challenges for incentives, but we like to shamelessly brag about having held this value from the inception of our company.</span></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><a href=\"https://i2.wp.com/leverage.it/wp-content/uploads/2018/08/joanna.jpg?ssl=1\"><img class=\"alignnone wp-image-4159 size-full\" src=\"https://i2.wp.com/leverage.it/wp-content/uploads/2018/08/joanna.jpg?resize=1080%2C701&#038;ssl=1\" alt=\"girl working at desk\" width=\"1080\" height=\"701\" srcset=\"https://i2.wp.com/leverage.it/wp-content/uploads/2018/08/joanna.jpg?w=1500&amp;ssl=1 1500w, https://i2.wp.com/leverage.it/wp-content/uploads/2018/08/joanna.jpg?resize=300%2C195&amp;ssl=1 300w, https://i2.wp.com/leverage.it/wp-content/uploads/2018/08/joanna.jpg?resize=768%2C498&amp;ssl=1 768w, https://i2.wp.com/leverage.it/wp-content/uploads/2018/08/joanna.jpg?resize=1024%2C664&amp;ssl=1 1024w\" sizes=\"(max-width: 1080px) 100vw, 1080px\" data-recalc-dims=\"1\" /></a></p>\n<h2><b>4. Space for growth</b></h2>\n<p><span style=\"font-weight: 400;\">This goes hand-in-hand with trust. When a company has carefully selected their team, trust is easily built. The more trust there is in within an office, the more free reign there will be for everyone to bring their vision to life, as a means to propel the company forward. Growth means the freedom to come up with a crazy idea and run with it.</span></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<h2><a href=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/DSC_1502.jpg?ssl=1\"><img class=\"alignnone wp-image-4155 size-full\" src=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/DSC_1502.jpg?resize=1080%2C728&#038;ssl=1\" alt=\"Leverage It team group photo\" width=\"1080\" height=\"728\" srcset=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/DSC_1502.jpg?w=4460&amp;ssl=1 4460w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/DSC_1502.jpg?resize=300%2C202&amp;ssl=1 300w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/DSC_1502.jpg?resize=768%2C517&amp;ssl=1 768w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/DSC_1502.jpg?resize=1024%2C690&amp;ssl=1 1024w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/DSC_1502.jpg?resize=1920%2C1294&amp;ssl=1 1920w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/DSC_1502.jpg?w=2160&amp;ssl=1 2160w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/08/DSC_1502.jpg?w=3240&amp;ssl=1 3240w\" sizes=\"(max-width: 1080px) 100vw, 1080px\" data-recalc-dims=\"1\" /></a></h2>\n<h2><b>5. Passion and positivity</b></h2>\n<p><span style=\"font-weight: 400;\">No, not in the fake, cheerleading kind of way. Genuine positivity and passion will spread through an office like wildfire. Sometimes it only takes one person to start the domino effect. Good morale is also highly impactful when it trickles down from those who&#8217;re taking on strong leadership roles.</span></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<h2><a href=\"https://i2.wp.com/leverage.it/wp-content/uploads/2018/08/teamedit.png?ssl=1\"><img class=\"alignnone wp-image-4160 size-full\" src=\"https://i2.wp.com/leverage.it/wp-content/uploads/2018/08/teamedit.png?resize=1080%2C915&#038;ssl=1\" alt=\"Leverage IT team outside\" width=\"1080\" height=\"915\" srcset=\"https://i2.wp.com/leverage.it/wp-content/uploads/2018/08/teamedit.png?w=4568&amp;ssl=1 4568w, https://i2.wp.com/leverage.it/wp-content/uploads/2018/08/teamedit.png?resize=300%2C254&amp;ssl=1 300w, https://i2.wp.com/leverage.it/wp-content/uploads/2018/08/teamedit.png?resize=768%2C651&amp;ssl=1 768w, https://i2.wp.com/leverage.it/wp-content/uploads/2018/08/teamedit.png?resize=1024%2C868&amp;ssl=1 1024w, https://i2.wp.com/leverage.it/wp-content/uploads/2018/08/teamedit.png?resize=1920%2C1627&amp;ssl=1 1920w, https://i2.wp.com/leverage.it/wp-content/uploads/2018/08/teamedit.png?w=2160&amp;ssl=1 2160w, https://i2.wp.com/leverage.it/wp-content/uploads/2018/08/teamedit.png?w=3240&amp;ssl=1 3240w\" sizes=\"(max-width: 1080px) 100vw, 1080px\" data-recalc-dims=\"1\" /></a><br />\n<b>6. Social initiatives</b></h2>\n<p><span style=\"font-weight: 400;\">This is so painfully obvious, but for good reason. It’s imperative for companies to build relationships through social initiatives. Company outings are not uncommon because of the impact that healthy interpersonal relationships has on a company’s productivity.</span></p>\n<p>&nbsp;</p>\n<h3>Consider this&#8230;</h3>\n<p><span style=\"font-weight: 400;\">Don’t let in-office go kart and exposed brick fool you. There are plenty of companies with cool amenities, with not-so-cool environments. The office vibe has been, and always will be a massive contributing factor to what makes a company successful. </span></p>\n<p><span style=\"font-weight: 400;\">What values do you </span><i><span style=\"font-weight: 400;\">value</span></i><span style=\"font-weight: 400;\"> when working with a company? Leave a comment down below. </span></p>\n<p>&nbsp;</p>\n', '<p>More and more companies are adopting office culture that values work-life balance and more flexible environments. By the same token, more and more companies are missing the mark by thinking healthy3 office culture means plopping a beanbag chair in the middle of the room and having beer on tap. &nbsp; What makes good organizational culture? [&hellip;]</p>\n', 4154, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37');
