(7, 4134, '2018-06-25T17:54:43', 3, '2018-06-25T17:54:43', 'how-our-leveragewins-provide-the-solutions-our-clients-need', 'publish', 'https://leverage.it/how-our-leveragewins-provide-the-solutions-our-clients-need/', 'How Our #LeverageWins Provide The Solutions Our Clients Need', '<p><span style=\"font-weight: 400;\">Life at LeverageIT is never boring! We’ve been busy with a lot of great projects, from logo creation to app development to web design to marketing—and we’ve been lucky to work with a wide range of clients with a diverse audience base. </span></p>\n<p><span style=\"font-weight: 400;\">Check out some of our latest #LeverageWins and how we do what we do. If you like what you see, get in touch so that we can take your project to the next level!</span></p>\n<p><a href=\"https://i2.wp.com/leverage.it/wp-content/uploads/2018/06/18-05-17-mediseen.jpg?ssl=1\"><img class=\" wp-image-4137 aligncenter\" src=\"https://i2.wp.com/leverage.it/wp-content/uploads/2018/06/18-05-17-mediseen.jpg?resize=350%2C350&#038;ssl=1\" alt=\"\" width=\"350\" height=\"350\" srcset=\"https://i2.wp.com/leverage.it/wp-content/uploads/2018/06/18-05-17-mediseen.jpg?resize=300%2C300&amp;ssl=1 300w, https://i2.wp.com/leverage.it/wp-content/uploads/2018/06/18-05-17-mediseen.jpg?resize=150%2C150&amp;ssl=1 150w, https://i2.wp.com/leverage.it/wp-content/uploads/2018/06/18-05-17-mediseen.jpg?resize=768%2C768&amp;ssl=1 768w, https://i2.wp.com/leverage.it/wp-content/uploads/2018/06/18-05-17-mediseen.jpg?resize=1024%2C1024&amp;ssl=1 1024w, https://i2.wp.com/leverage.it/wp-content/uploads/2018/06/18-05-17-mediseen.jpg?resize=560%2C560&amp;ssl=1 560w, https://i2.wp.com/leverage.it/wp-content/uploads/2018/06/18-05-17-mediseen.jpg?resize=900%2C900&amp;ssl=1 900w, https://i2.wp.com/leverage.it/wp-content/uploads/2018/06/18-05-17-mediseen.jpg?w=1080&amp;ssl=1 1080w\" sizes=\"(max-width: 350px) 100vw, 350px\" data-recalc-dims=\"1\" /></a></p>\n<p><a href=\"https://mediseen.ca/#!/patient-home\"><b>MediSeen</b></a></p>\n<p><span style=\"font-weight: 400;\">From day one, we’ve been all-hands-on-deck with MediSeen—an innovative health tech company that provides access to health care at home. </span></p>\n<p><span style=\"font-weight: 400;\"><strong>ISSUE/NEED:</strong> MediSeen offers over 18 different healthcare provider types, so it was important that we were able to give them a secure, easy-to-use platform with consistent branding.</span></p>\n<p><span style=\"font-weight: 400;\"><strong>SOLUTION:</strong> We built a full, interactive interface with an intuitive process from the moment someone books an appointment to when the service is complete. Patients are able to book their own appointments, providers can create calendars to streamline their house calls, and reviews of each appointment can be left in the app. LeverageIT was able to bring to life many of the components that set MediSeen apart from other health tech entities.</span></p>\n<p style=\"text-align: center;\"><a href=\"https://i1.wp.com/leverage.it/wp-content/uploads/2018/06/levpost1.jpg?ssl=1\"><img class=\" wp-image-4138 aligncenter\" src=\"https://i1.wp.com/leverage.it/wp-content/uploads/2018/06/levpost1.jpg?resize=350%2C262&#038;ssl=1\" alt=\"\" width=\"350\" height=\"262\" srcset=\"https://i1.wp.com/leverage.it/wp-content/uploads/2018/06/levpost1.jpg?resize=300%2C225&amp;ssl=1 300w, https://i1.wp.com/leverage.it/wp-content/uploads/2018/06/levpost1.jpg?resize=768%2C576&amp;ssl=1 768w, https://i1.wp.com/leverage.it/wp-content/uploads/2018/06/levpost1.jpg?resize=1024%2C768&amp;ssl=1 1024w, https://i1.wp.com/leverage.it/wp-content/uploads/2018/06/levpost1.jpg?resize=560%2C420&amp;ssl=1 560w, https://i1.wp.com/leverage.it/wp-content/uploads/2018/06/levpost1.jpg?resize=900%2C675&amp;ssl=1 900w, https://i1.wp.com/leverage.it/wp-content/uploads/2018/06/levpost1.jpg?resize=120%2C90&amp;ssl=1 120w, https://i1.wp.com/leverage.it/wp-content/uploads/2018/06/levpost1.jpg?w=1440&amp;ssl=1 1440w\" sizes=\"(max-width: 350px) 100vw, 350px\" data-recalc-dims=\"1\" /></a></p>\n<p><a href=\"http://swiftlegalfinance.com/\"><b>Swift Legal Finance</b></a></p>\n<p><span style=\"font-weight: 400;\">Based in Michigan, Swift Legal Finance helps clients who are awaiting legal settlement money, but need funds to take care of their day-to-day expenses. </span></p>\n<p><span style=\"font-weight: 400;\"><strong>ISSUE/NEED:</strong> As a new financial services company, they required a friendly brand that consumers could trust and one that attracted and engaged their audience. </span></p>\n<p><span style=\"font-weight: 400;\"><strong>SOLUTION:</strong> We worked with the Swift to conceptualize a knowledgeable and approachable brand. We designed and built a new website with captivating illustrations and simple, concise copy. Using Google Tag Manager, we identified and tracked key conversions, including form submissions and phone calls. LeverageIT is now working with Swift to start a marketing campaign, attracting new clients in the metro Detroit area. </span></p>\n<p style=\"text-align: center;\"><a href=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/06/TBY-2.jpg?ssl=1\"><img class=\" wp-image-4140 aligncenter\" src=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/06/TBY-2.jpg?resize=350%2C350&#038;ssl=1\" alt=\"\" width=\"350\" height=\"350\" srcset=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/06/TBY-2.jpg?resize=300%2C300&amp;ssl=1 300w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/06/TBY-2.jpg?resize=150%2C150&amp;ssl=1 150w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/06/TBY-2.jpg?resize=768%2C768&amp;ssl=1 768w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/06/TBY-2.jpg?resize=1024%2C1024&amp;ssl=1 1024w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/06/TBY-2.jpg?resize=560%2C560&amp;ssl=1 560w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/06/TBY-2.jpg?resize=900%2C900&amp;ssl=1 900w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/06/TBY-2.jpg?w=1080&amp;ssl=1 1080w\" sizes=\"(max-width: 350px) 100vw, 350px\" data-recalc-dims=\"1\" /></a></p>\n<p><a href=\"https://tiferesbaisyaakov.com/\"><b>Tiferes Bais Yaakov</b></a></p>\n<p><span style=\"font-weight: 400;\">We were honoured to work with Tiferes Bais Yaakov, a Jewish Orthodox girls’ high school, and partnered with them to bring their new site design visions to life. </span></p>\n<p><span style=\"font-weight: 400;\"><strong>ISSUE/NEED:</strong> The school had an outdated website that was slow to load, constantly getting hacked, and no longer represented the image of the school. </span></p>\n<p><span style=\"font-weight: 400;\"><strong>SOLUTION:</strong> LeverageIT built a revamped their website that utilized their new brand colours in a modern design. We created a secure site that was much easier for the client to update and maintain post-launch, giving them the empowerment to evolve the site as the school grows and changes. The project was completed on time and on budget, with no major roadblocks along the way. </span></p>\n<p>&nbsp;</p>\n<p><span style=\"font-weight: 400;\">These are just a few of our recent success stories that showcase the work we love to do. As you can see, life at LeverageIT is never boring—but luckily, it’s full of creativity, problem-solving, and best of all, fabulous teamwork. </span></p>\n<p><span style=\"font-weight: 400;\">Follow us on <a href=\"https://www.facebook.com/leverageitcorp/\">Facebook</a> and <a href=\"https://www.instagram.com/leverage.it/\">Instagram</a> to stay up-to-date on our new #LeverageWins and much more!</span></p>\n', '<p>Life at LeverageIT is never boring! We’ve been busy with a lot of great projects, from logo creation to app development to web design to marketing—and we’ve been lucky to work with a wide range of clients with a diverse audience base. Check out some of our latest #LeverageWins and how we do what we [&hellip;]</p>\n', 4139, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(8, 4120, '2018-06-05T21:21:37', 9, '2018-06-05T21:21:37', 'were-hiring-graphic-designer', 'publish', 'https://leverage.it/were-hiring-graphic-designer/', 'We&#8217;re Hiring: Graphic Designer', '<h3>About Us</h3>\n<p>We’re a tech-infused, design-driven digital agency located in Toronto, and we’re looking for a Graphic Designer to join our team! From app development to website creation to marketing and everything in between, we’re a one-stop shop for clients who want to make an impact with their online presences and marketing campaigns.</p>\n<p>Working at Leverage IT is never boring. We take on a variety of projects ranging in size and industry, so there’s lots to do and learn. Our clients are movers, shakers, and game changers—and so is our team. Alongside our developers, designers, and marketers, we’re looking for a skilled Graphic Designer to help take us to the next level.</p>\n<h3>About the role</h3>\n<p>What are we looking for in a Graphic Designer? Someone who is proficient in web-based work, but can handle the creation of offline marketing materials, too. Our Graphic Designer will work closely with Project Managers and Front End Developers, and will have the opportunity to work on a variety of projects from different industries.</p>\n<h3>Responsibilities</h3>\n<ul>\n<li>Design a variety of marketing materials including: web designs, social media graphics, power point presentations, email newsletters, brochures, and more.</li>\n<li>Design, modify and retouch photos.</li>\n<li>Manage social media presence and develop relevant content.</li>\n<li>Coordinate the ordering and distribution of promotional materials.</li>\n<li>Work with Project Manager to understand project objectives</li>\n<li>Follow design direction</li>\n<li>Research industry best practices, competitors to create inspired and thoughtful designs</li>\n<li>Ensure brand, content and image standards are consistent on all corporate materials.</li>\n<li>Maintain and update website content through a CMS interface.</li>\n</ul>\n<h3>Skills &amp; Qualifications</h3>\n<ul>\n<li>A diploma or degree in graphic design or communications (or equivalent)</li>\n<li>Proficiency in Adobe InDesign, Photoshop, Illustrator (must have all three)</li>\n<li>Experience with prototyping tools such as Sketch, Figma, InVision, Marvel, or others preferred</li>\n<li>HTML/CSS experience is a plus</li>\n<li>A strong attention to detail (copy, grammar, layout composition, images, colour, etc)</li>\n<li>A self starter mindset while being highly driven to grow</li>\n<li>An openness to giving and receiving feedback to better yourself as a designer and better the team</li>\n<li>Ability to thrive under pressure in a fast-paced multi-project environment</li>\n<li>A receptive attitude to creative direction and adapt to a multitude of changes</li>\n<li>An online portfolio that demonstrates strong aesthetics and design principles in layout design (must provide during application)</li>\n</ul>\n<h3>Interested? Reach out!</h3>\n\n                <div class=\'gf_browser_unknown gform_wrapper\' id=\'gform_wrapper_3\' ><a id=\'gf_3\' class=\'gform_anchor\' ></a><form method=\'post\' enctype=\'multipart/form-data\' target=\'gform_ajax_frame_3\' id=\'gform_3\'  action=\'/wp-json/wp/v2/posts?per_page=100#gf_3\'>\n                        <div class=\'gform_body\'><ul id=\'gform_fields_3\' class=\'gform_fields top_label form_sublabel_below description_below\'><li id=\'field_3_7\'  class=\'gfield field_sublabel_below field_description_below gfield_visibility_hidden\' ><label class=\'gfield_label\' for=\'input_3_7\' >Job Type</label><div class=\'ginput_container ginput_container_text\'><input name=\'input_7\' id=\'input_3_7\' type=\'text\' value=\'Graphic Designer\' class=\'medium\'      aria-invalid=\"false\" /></div></li><li id=\'field_3_1\'  class=\'gfield gfield_contains_required field_sublabel_below field_description_below gfield_visibility_visible\' ><label class=\'gfield_label gfield_label_before_complex\'  >Name<span class=\'gfield_required\'>*</span></label><div class=\'ginput_complex ginput_container no_prefix has_first_name no_middle_name has_last_name no_suffix gf_name_has_2 ginput_container_name\' id=\'input_3_1\'>\n                            \n                            <span id=\'input_3_1_3_container\' class=\'name_first\' >\n                                                    <input type=\'text\' name=\'input_1.3\' id=\'input_3_1_3\' value=\'\' aria-label=\'First name\'   aria-required=\"true\" aria-invalid=\"false\" />\n                                                    <label for=\'input_3_1_3\' >First</label>\n                                                </span>\n                            \n                            <span id=\'input_3_1_6_container\' class=\'name_last\' >\n                                                    <input type=\'text\' name=\'input_1.6\' id=\'input_3_1_6\' value=\'\' aria-label=\'Last name\'   aria-required=\"true\" aria-invalid=\"false\" />\n                                                    <label for=\'input_3_1_6\' >Last</label>\n                                                </span>\n                            \n                        </div></li><li id=\'field_3_2\'  class=\'gfield gfield_contains_required field_sublabel_below field_description_below gfield_visibility_visible\' ><label class=\'gfield_label\' for=\'input_3_2\' >Email<span class=\'gfield_required\'>*</span></label><div class=\'ginput_container ginput_container_email\'>\n                            <input name=\'input_2\' id=\'input_3_2\' type=\'text\' value=\'\' class=\'large\'    aria-required=\"true\" aria-invalid=\"false\"/>\n                        </div></li><li id=\'field_3_5\'  class=\'gfield field_sublabel_below field_description_below gfield_visibility_visible\' ><label class=\'gfield_label\' for=\'input_3_5\' >Phone</label><div class=\'ginput_container ginput_container_phone\'><input name=\'input_5\' id=\'input_3_5\' type=\'text\' value