(9, 4113, '2018-06-05T21:21:37', 9, '2018-06-05T21:21:37', 'were-hiring-full-stack-developer-2', 'publish', 'https://leverage.it/were-hiring-full-stack-developer-2/', 'We&#8217;re Hiring: Full Stack Developer', '<h3>About Us</h3>\n<p>We’re a tech-infused, design-driven digital agency located in Toronto, and we’re looking for a Full Stack Developer to join our team! From app development to website creation to marketing and everything in between, we’re a one-stop shop for clients who want to make an impact with their online presences and marketing campaigns.</p>\n<p>Working at Leverage IT is never boring. We take on a variety of projects ranging in size and industry, so there’s lots to do and learn. Our clients are movers, shakers, and game changers—and so is our team. Alongside our developers, designers, and marketers, we’re looking for a skilled Full Stack Developer to help take us to the next level.</p>\n<h3>About the role</h3>\n<p>Candidate must have experience developing web applications using PHP, JavaScript, CSS, and mySQL. We are looking for a highly motivated individual who can thrive in a fast-paced environment, work on multiple project simultaneously, and successfully contribute to the team. The ideal candidate will have a can-do attitude, passion for technology, extensive development experience, and will be able to get up to speed quickly.</p>\n<h3>RESPONSIBILITIES</h3>\n<ul>\n<li>Plan and develop new software</li>\n<li>Assist in complete database design (queries, indexing and structure)</li>\n<li>Ongoing re-development of our current software/web applications</li>\n<li>Minimal system administration (repairing corrupted tables, restarting services, etc.)</li>\n<li>Construct an API framework</li>\n</ul>\n<h3>REQUIRED EDUCATION &amp; EXPERIENCE</h3>\n<ul>\n<li>Bachelors or Masters degree in Computer Science and/or equivalent experience</li>\n<li>3+ years in the IT industry and a good understanding of the full life cycle of development</li>\n<li>5+ years of hands-on experience in programming database driven web sites in technologies</li>\n</ul>\n<h3>REQUIRED SKILLS</h3>\n<ul>\n<li>Experience with PHP MVC frameworks, preferably Laravel</li>\n<li>Experience with Javascript, JSON and Ajax</li>\n<li>Experience with Javascript framework such as jQuery and AngularJS 1.X (Node.js knowledge is a bonus).</li>\n<li>Experience with Git, a bonus</li>\n<li>Detail-oriented and highly organized with the ability to handle multiple tasks simultaneously and meet tight deadlines</li>\n<li>Proven ability to learn new technologies and deliver measurable results in an aggressive environment</li>\n<li>Experience with Apache Cordova, a bonus</li>\n<li>Experience collecting business requirements from clients and writing scope of works as well as understanding business requirements of complex apps</li>\n</ul>\n<h3>Interested? Reach out!</h3>\n\n                <div class=\'gf_browser_unknown gform_wrapper\' id=\'gform_wrapper_3\' ><a id=\'gf_3\' class=\'gform_anchor\' ></a><form method=\'post\' enctype=\'multipart/form-data\' target=\'gform_ajax_frame_3\' id=\'gform_3\'  action=\'/wp-json/wp/v2/posts?per_page=100#gf_3\'>\n                        <div class=\'gform_body\'><ul id=\'gform_fields_3\' class=\'gform_fields top_label form_sublabel_below description_below\'><li id=\'field_3_7\'  class=\'gfield field_sublabel_below field_description_below gfield_visibility_hidden\' ><label class=\'gfield_label\' for=\'input_3_7\' >Job Type</label><div class=\'ginput_container ginput_container_text\'><input name=\'input_7\' id=\'input_3_7\' type=\'text\' value=\'Full Stack Developer\' class=\'medium\'      aria-invalid=\"false\" /></div></li><li id=\'field_3_1\'  class=\'gfield gfield_contains_required field_sublabel_below field_description_below gfield_visibility_visible\' ><label class=\'gfield_label gfield_label_before_complex\'  >Name<span class=\'gfield_required\'>*</span></label><div class=\'ginput_complex ginput_container no_prefix has_first_name n