(10, 4110, '2018-06-05T21:21:37', 9, '2018-06-05T21:21:37', 'were-hiring-front-end-developer', 'publish', 'https://leverage.it/were-hiring-front-end-developer/', 'We&#8217;re Hiring: Front End Developer', '<h3>About us</h3>\n<p>We’re a tech-infused, design-driven digital agency located in Toronto, and we’re looking for a Front End Developer to join our team! From app development to website creation to marketing and everything in between, we’re a one-stop shop for clients who want to make an impact with their online presences and marketing campaigns.</p>\n<p>Working at Leverage IT is never boring. We take on a variety of projects ranging in size and industry, so there’s lots to do and learn. Our clients are movers, shakers, and game changers—and so is our team. Alongside our developers, designers, and marketers, we’re looking for a skilled Front End Developer to help take us to the next level.</p>\n<h3>About the role</h3>\n<p>What do we need in a Front End Developer? Someone with key development experience who is able to work well with a variety of team members and stakeholders. If you can code like a boss and develop sites that look great and function magnificently, we want you!</p>\n<h3>Responsibilities</h3>\n<ul>\n<li>Opportunity to work on projects from a variety of different industries</li>\n<li>Work closely with project manager, graphic designer, and other team members</li>\n<li>Development using front-end web technologies like HTML, CSS, and JavaScript</li>\n<li>Create mockups and prototypes for websites and mobile apps</li>\n<li>Help plan product features and initiatives by providing a design and front-end perspective</li>\n<li>Capture requirements, create documentation and communicate with stakeholders</li>\n</ul>\n<h3>Skills &amp; Qualifications</h3>\n<ul>\n<li>Solid experience in HTML5, Javascript and CSS</li>\n<li>Experience with WordPress is an asset</li>\n<li>Expertise in implementing the latest web and mobile design technique trends</li>\n<li>Knowledge of usability and UI/UX best practices.</li>\n<li>Experience integrating third party APIs</li>\n<li>Ability to read, write, and optimize front-end code for performance and robustness</li>\n<li>Loves to learn and explore new technologies</li>\n<li>Comfort with start-up environments — you’re an efficient thinker, and you roll with the punches when priorities shift</li>\n</ul>\n<h3>Interested? Reach out!</h3>\n\n                <div class=\'gf_browser_unknown gform_wrapper\' id=\'gform_wrapper_3\' ><a id=\'gf_3\' class=\'gform_anchor\' ></a><form method=\'post\' enctype=\'multipart/form-data\' target=\'gform_ajax_frame_3\' id=\'gform_3\'  action=\'/wp-json/wp/v2/posts?per_page=100#gf_3\'>\n                        <div class=\'gform_body\'><ul id=\'gform_fields_3\' class=\'gform_fields top_label form_sublabel_below description_below\'><li id=\'field_3_7\'  class=\'gfield field_sublabel_below field_description_below gfield_visibility_hidden\' ><label class=\'gfield_label\' for=\'input_3_7\' >Job Type</label><div class=\'ginput_container ginput_container_text\'><input name=\'input_7\' id=\'input_3_7\' type=\'text\' value=\'Front End Developer\' class=\'medium\'      aria-invalid=\"false\" /></div></li><li id=\'field_3_1\'  class=\'gfield gfield_contains_required field_sublabel_below field_description_below gfield_visibility_visible\' ><label class=\'gfield_label gfield_label_before_complex\'  >Name<span class=\'gfield_required\'>*</span></label><div class=\'ginput_complex ginput_container no_prefix has_first_name no_middle_name has_last_name no_suffix gf_name_has_2 ginput_container_name\' id=\'input_3_1\'>\n                            \n                            <span id=\'input_3_1_3_container\' class=\'name_first\' >\n                                                    <input type=\'text\' name=\'input_1.3\' id=\'input_3_1_3\' value=\'\' aria-label=\'First name\'   aria-required=\"true\" aria-invalid=\"false\" />\n                                                    <l