(11, 4099, '2018-06-05T21:21:37', 9, '2018-06-05T21:21:37', 'were-hiring-digital-analyst', 'publish', 'https://leverage.it/were-hiring-digital-analyst/', 'We&#8217;re Hiring: Digital Analyst', '<h3>About Us</h3>\n<p>We’re a tech-infused, design-driven digital agency located in Toronto, and we’re looking for a Digital Analyst to join our team! From app development to website creation to marketing and everything in between, we’re a one-stop shop for clients who want to make an impact with their online presences and marketing campaigns.</p>\n<p>Working at Leverage IT is never boring. We take on a variety of projects ranging in size and industry, so there’s lots to do and learn. Our clients are movers, shakers, and game changers—and so is our team. Alongside our developers, designers, and marketers, we’re looking for a knowledgeable Digital Analyst to help take us to the next level.</p>\n<h3>About the role</h3>\n<p>What makes a great Digital Analyst? We’re looking for a self-starter with initiative, creative thinking, and amazing research abilities. We want someone who’s passionate about problem solving, and who’s excited by figuring out solutions to marketing and data questions. The Digital Analyst will work closely with Project Managers, Graphic Designers, and Front-End Developers, and will have the opportunity to work on projects from a wide variety of industries.</p>\n<p>Duties will include managing SEO and PPC campaigns for clients, building dashboards and reports to track KPIs, and preparing weekly and monthly reports to showcase progress, identifying opportunities for improvement, and managing solution implementation.</p>\n<h3>Responsibilities</h3>\n<ul>\n<li>Experience creating, managing, optimizing effective Facebook ad campaigns</li>\n<li>Experience with building landing pages</li>\n<li>Understanding a client’s marketing journey, providing insight into optimization</li>\n<li>Ability to identify conversion bottlenecks and work to resolve them</li>\n<li>Ability to understand a user journey utilizing tools such as Branch.io, Mixpanel, Google Analytics, Google Tag Manager, etc.</li>\n<li>Communicate results from marketing campaigns, adding deeper insights and interpreting results correctly</li>\n<li>Conversion optimization on site, apps, etc.</li>\n<li>Great attention to detail</li>\n<li>Solid communication skills</li>\n<li>Team player</li>\n</ul>\n<h3>Skills &amp; Qualifications</h3>\n<ul>\n<li>A diploma or degree (preferable, not necessary)</li>\n<li>2-3 years of experience using data analytics tools for clients or companies</li>\n<li>HTML/CSS experience is a nice to have</li>\n<li>A strong attention to detail (copy, grammar, layout composition, images, colour, etc)</li>\n<li>A self starter mindset while being highly driven to grow</li>\n<li>Ability to thrive under pressure in a fast-paced multi-project environment</li>\n<li>Proficiency with: google tag manager, event and goal tracking, google analytics, adwords, performance monitoring of marketing campaigns, A/B testing, SEO</li>\n<li>Passion for data, analytics and its ability to improve businesses</li>\n<li>Experience with front-end web development technologies (JavaScript, HTML, CSS, JQuery).</li>\n</ul>\n<h3>Interested? Reach out!</h3>\n\n                <div class=\'gf_browser_unknown gform_wrapper\' id=\'gform_wrapper_3\' ><a id=\'gf_3\' class=\'gform_anchor\' ></a><form method=\'post\' enctype=\'multipart/form-data\' target=\'gform_ajax_frame_3\' id=\'gform_3\'  action=\'/wp-json/wp/v2/posts?per_page=100#gf_3\'>\n                        <div class=\'gform_body\'><ul id=\'gform_fields_3\' class=\'gform_fields top_label form_sublabel_below description_below\'><li id=\'field_3_7\'  class=\'gfield field_sublabel_below field_description_below gfield_visibility_hidden\' ><label class=\'gfield_label\' for=\'input_3_7\' >Job Type</label><div class=\'ginput_container ginput_container_text\'><input name=\'input_7\' id=\'input_3_7\' type=\'text\' value=\'Digital Analyst\' cla