nt to website creation to marketing and everything in between, we’re a one-stop shop for clients who want to make an impact with their online presences and marketing campaigns. Working at [&hellip;]</p>\n', 0, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(12, 3697, '2018-01-16T18:20:35', 8, '2018-02-06T19:50:07', 'new-facebook-update-content-people-favoured-content-businesses-brands-news', 'publish', 'https://leverage.it/new-facebook-update-content-people-favoured-content-businesses-brands-news/', 'New Facebook Update: Content from People Favoured Over Content from Businesses, Brands, &#038; News', '<p><span style=\"font-weight: 400;\">Last week Facebook CEO Mark Zuckerberg </span><a href=\"https://www.facebook.com/zuck/posts/10104413015393571\"><span style=\"font-weight: 400;\">announced changes</span></a><span style=\"font-weight: 400;\"> to the content Facebook users will be seeing, what does this mean for your business?</span></p>\n<p><span style=\"font-weight: 400;\">What Facebook’s users see when they’re using the app has been evolving ever since Facebook launched, so don’t panic. The gist is this: Facebook is prioritizing content from “real people” over content from news, brands, and companies (this category includes your Page). </span></p>\n<p><span style=\"font-weight: 400;\">The real change here is for news organizations, not brands and businesses. Back in 2014, Mark Zuckerberg announced that </span><a href=\"https://phys.org/news/2014-11-facebook-newspaper-media.html\"><span style=\"font-weight: 400;\">Facebook’s ambition is to be a personal ‘newspaper’ for its users</span></a><span style=\"font-weight: 400;\">, prioritizing content from news organization over other Pages. So many businesses and brands have already felt the sting of Facebook preferring other content over theirs.</span></p>\n<p><span style=\"font-weight: 400;\">The organic reach of content (how many of your followers see a post without you promoting it) has been decreasing for years, forcing more businesses to put money behind their posts.</span></p>\n<p><b><a href=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/01/Organic-Reach-Chart-1132x670.png?ssl=1\"><img class=\"alignnone wp-image-3699 size-full\" src=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/01/Organic-Reach-Chart-1132x670.png?resize=720%2C540&#038;ssl=1\" alt=\"\" width=\"720\" height=\"540\" srcset=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/01/Organic-Reach-Chart-1132x670.png?w=720&amp;ssl=1 720w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/01/Organic-Reach-Chart-1132x670.png?resize=300%2C225&amp;ssl=1 300w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/01/Organic-Reach-Chart-1132x670.png?resize=560%2C420&amp;ssl=1 560w\" sizes=\"(max-width: 720px) 100vw, 720px\" data-recalc-dims=\"1\" /></a></b></p>\n<p><b>Nevertheless, Facebook is still important for your business. Why?</b></p>\n<ol>\n<li><b>They have people’s attention</b></li>\n</ol>\n<p>Facebook still have a strong hold on people’s attention. Over <a href=\"https://mobilesyrup.com/2017/06/21/facebook-reaches-23-million-monthly-users-canada/\">64% of Canada’s population</a> log in to Facebook on a monthly basis, south of the border Facebook users an average of 40 minutes per day on the site.</p>\n<ol start=\"2\">\n<li><b> Facebook’s targeting is powerful and constantly improving</b></li>\n</ol>\n<p><span style=\"font-weight: 400;\">Did you know you can target people within a 5 mile geographical area? And you can target people through their email addresses on Facebook. And you can target people who have already visited your website, or a particular page on your website. </span></p>\n<ol start=\"3\">\n<li><b> The same targeting capabilities translate to Instagram</b></li>\n</ol>\n<p><span style=\"font-weight: 400;\">Instagram is a less crowded and more visual channel, that many users find extremely engaging (ahem, addictive may be a better word). It can work very well for certain types of businesses and best of all? It has the same targeting capabilities as Facebook!</span></p>\n<ol start=\"4\">\n<li><b>New ad types </b></li>\n</ol>\n<p><b>Lead Ads &#8211; </b><span style=\"font-weight: 400;\">Lead ads on Facebook make it easier for potential customers to submit their information to you, via any device. These ads, which appear natively in feeds — have some information already pre-filled, based on the information customers have shared with Facebook. The best part? The user never has to leave Facebook to complete your form!</span></p>\n<p><b><a href=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/01/lead-ads-fb.png?ssl=1\"><img class=\"alignnone wp-image-3698 size-full\" src=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/01/lead-ads-fb.png?resize=676%2C380&#038;ssl=1\" alt=\"\" width=\"676\" height=\"380\" srcset=\"https://i0.wp.com/leverage.it/wp-content/uploads/2018/01/lead-ads-fb.png?w=676&amp;ssl=1 676w, https://i0.wp.com/leverage.it/wp-content/uploads/2018/01/lead-ads-fb.png?resize=300%2C169&amp;ssl=1 300w\" sizes=\"(max-width: 676px) 100vw, 676px\" data-recalc-dims=\"1\" /></a></b></p>\n<p><b>Canvas Ads &#8211; </b><span style=\"font-weight: 400;\">Expand your newsfeed story with a fullscreen experience. Canvas ads help you shorten the distance between your message and your customer. With Canvas ads, people can watch engaging videos and photos, and swipe through carousels —all in a single ad.</span></p>\n<p><span style=\"font-weight: 400;\">Interested in trying Facebook marketing for your business? Have any questions about your current Facebook marketing efforts? Let us know, we’re happy to help!</span></p>\n', '<p>Last week Facebook CEO Mark Zuckerberg announced changes to the content Facebook users will be seeing, what does this mean for your business? What Facebook’s users see when they’re using the app has been evolving ever since Facebook launched, so don’t panic. The gist is this: Facebook is prioritizing content from “real people” over content [&hellip;]</p>\n', 3701, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(13, 3603, '2017-12-31T15:37:01', 9, '2018-02-06T17:22:22', '2017-year-review', 'publish', 'https://leverage.it/2017-year-review/', '2017 Year in Review', '<p>[vc_row][vc_column][vc_column_text]</p>\n<p style=\"text-align: center;\">As we bid farewell to 2017, we give you&#8230;</p>\n<h2 style=\"text-align: center;\">SNAPSHOT 2017</h2>\n<p>[/vc_column_text][/vc_column][/vc_row][vc_row][vc_column]<div class=\"grve-element grve-align-center\"><a href=\"https://leverage.it/year-review-2017/\" class=\"grve-btn grve-btn-medium grve-square grve-bg-primary-1 grve-bg-hover-primary-2\"><span><i class=\"fa fa-angle-right\"></i>Click here for the fancy version</span></a></div>[/vc_column][/vc_row][vc_row][vc_column][vc_column_text]We are extremely grateful for the opportunity to work with so many different types of companies this year as it gave us intriguing challenges and chances to grow, learn, and produce quality work that we can be proud of.</p>\n<p>This year our team evolved into just that&#8230;a team. Each of us can rely on the strengths of one another to help bring our projects to fruition. We are a weird and wacky bunch, but together we get S!@%#T done &#8211; which is also our unofficial moto.</p>\n<p>So from all of us at LeverageIT</p>\n<h3>Health and Happiness for 2018.</h3>\n<p>[/vc_column_text][/vc_column][/vc_row]</p>\n', '<p>[vc_row][vc_column][vc_column_text] As we bid farewell to 2017, we give you&#8230; SNAPSHOT 2017 [/vc_column_text][/vc_column][/vc_row][vc_row][vc_column][/vc_column][/vc_row][vc_row][vc_column][vc_column_text]We are extremely grateful for the opportunity to work with so many different types of companies this year as it gave us intriguing challenges and chances to grow, learn, and produce quality work that we can be proud of. This year our team [&hellip;]</p>\n', 3688, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(14, 3553, '2017-10-10T19:59:57', 10, '2018-02-06T19:54:57', '3-easy-steps-step-social-media-skills', 'publish', 'https://leverage.it/3-easy-steps-step-social-media-skills/', '3 Easy steps to step up your social media skills', '<p>Are you trying to be active on social media and feeling like your not getting it right?</p>\n<p>Don&#8217;t worry! we have all been there before and have to start somewhere after all.</p>\n<p>Our team has uncovered three key things that&#8217;ll really take your social media game to the next level</p>\n<p>Posting on facebook, instagram, and linked in and so on can seem like a pretty simple task. visit the site or app, write a post and done.</p>\n<p>You have to think about how people will react to your post. imagine you saw the post on your feed, would you stop and take a look at it?</p>\n<p>What value does it give your followers or potential followors?</p>\n<p>Is it sharable?</p>\n<p>&nbsp;</p>\n<p>You&#8217;ve been running your business&#8217; social media pages for some time now and have seen great results.</p>\n<ol>\n<li>Images (canva)</li>\n<li>Consistency</li>\n<li>Interact (with followers)</li>\n</ol>\n', '<p>Are you trying to be active on social media and feeling like your not getting it right? Don&#8217;t worry! we have all been there before and have to start somewhere after all. Our team has uncovered three key things that&#8217;ll really take your social media game to the next level Posting on facebook, instagram, and [&hellip;]</p>\n', 3570, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(15, 3532, '2017-09-12T19:50:49', 6, '2018-02-06T19:54:04', 'amazons-second-headquarters-toronto-detroit', 'publish', 'https://leverage.it/amazons-second-headquarters-toronto-detroit/', 'Amazon’s Second Headquarters in Toronto &#038; Detroit?', '<p><span style=\"font-weight: 400;\">Amazon announced their plan to build a second headquarters within North America. </span><span style=\"font-weight: 400;\">“Amazon HQ2 will be a complete headquarters for Amazon – not a satellite office,” the company said in a recent news release. Due to the growing technology markets in </span><i><span style=\"font-weight: 400;\">Toronto </span></i><span style=\"font-weight: 400;\">and</span><i><span style=\"font-weight: 400;\"> Detroit (insert crosslinks to both blog posts), </span></i><span style=\"font-weight: 400;\">Amazon should consider these cities for its second headquarters. </span></p>\n<p><img class=\"alignnone size-large wp-image-3533 aligncenter\" src=\"https://i0.wp.com/leverage.it/wp-content/uploads/2017/09/Amazon-Office-Desk.jpg?resize=1024%2C683&#038;ssl=1\" alt=\"Amazon Office Desk\" width=\"1024\" height=\"683\" srcset=\"https://i0.wp.com/leverage.it/wp-content/uploads/2017/09/Amazon-Office-Desk.jpg?resize=1024%2C683&amp;ssl=1 1024w, https://i0.wp.com/leverage.it/wp-content/uploads/2017/09/Amazon-Office-Desk.jpg?resize=300%2C200&amp;ssl=1 300w, https://i0.wp.com/leverage.it/wp-content/uploads/2017/09/Amazon-Office-Desk.jpg?resize=1920%2C1280&amp;ssl=1 1920w, https://i0.wp.com/leverage.it/wp-content/uploads/2017/09/Amazon-Office-Desk.jpg?w=2160&amp;ssl=1 2160w, https://i0.wp.com/leverage.it/wp-content/uploads/2017/09/Amazon-Office-Desk.jpg?w=3240&amp;ssl=1 3240w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" data-recalc-dims=\"1\" /></p>\n<p><span style=\"font-weight: 400;\">The fast growing technology authority recently announced their price drops at Whole Foods market on the first day of acquisition. The natural food grocery chain saw price cuts as much as 43% and Amazon is continuing to change the way people think of Whole Foods, formerly nicknamed Whole Paycheque. </span></p>\n<p><img class=\"alignnone size-large wp-image-3534 aligncenter\" src=\"https://i2.wp.com/leverage.it/wp-content/uploads/2017/09/Food-platter-charcuterie.jpg?resize=1024%2C767&#038;ssl=1\" alt=\"Whole Foods organic snacks\" width=\"1024\" height=\"767\" srcset=\"https://i2.wp.com/leverage.it/wp-content/uploads/2017/09/Food-platter-charcuterie.jpg?resize=1024%2C767&amp;ssl=1 1024w, https://i2.wp.com/leverage.it/wp-content/uploads/2017/09/Food-platter-charcuterie.jpg?resize=300%2C225&amp;ssl=1 300w, https://i2.wp.com/leverage.it/wp-content/uploads/2017/09/Food-platter-charcuterie.jpg?resize=560%2C420&amp;ssl=1 560w, https://i2.wp.com/leverage.it/wp-content/uploads/2017/09/Food-platter-charcuterie.jpg?resize=900%2C675&amp;ssl=1 900w, https://i2.wp.com/leverage.it/wp-content/uploads/2017/09/Food-platter-charcuterie.jpg?resize=1920%2C1438&amp;ssl=1 1920w, https://i2.wp.com/leverage.it/wp-content/uploads/2017/09/Food-platter-charcuterie.jpg?w=2160&amp;ssl=1 2160w, https://i2.wp.com/leverage.it/wp-content/uploads/2017/09/Food-platter-charcuterie.jpg?w=3240&amp;ssl=1 3240w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" data-recalc-dims=\"1\" /></p>\n<p><span style=\"font-weight: 400;\">Competition has caught up with Whole Foods and the new lower Amazon mandated prices have more comparative pricing to local supermarkets. Since announcing their plan for a second headquarters in North America, </span></p>\n', '<p>Amazon announced their plan to build a second headquarters within North America. “Amazon HQ2 will be a complete headquarters for Amazon – not a satellite office,” the company said in a recent news release. Due to the growing technology markets in Toronto and Detroit (insert crosslinks to both blog posts), Amazon should consider these cities [&hellip;]</p>\n', 3824, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(16, 3513, '2017-09-12T16:51:54', 6, '2018-02-06T19:52:26', 'technology-startups-midwest', 'publish', 'https://leverage.it/technology-startups-midwest/', 'Technology Startups in the Midwest', '<p><span style=\"font-weight: 400;\">Since we&#8217;re passionate about our city and startup culture, we previously featured a </span><i><span style=\"font-weight: 400;\">post on Toronto startups </span></i><span style=\"font-weight: 400;\">but our neighbours in the</span> <span style=\"font-weight: 400;\">Midwestern United States also have a huge venture. Although it’s a growing market, not many people think of “technology hub” when they think of the Midwest. More often than not, when people imagine the Midwest, they think calorie-dense, fried foods and cornfields but unfortunately overlook the emerging technology companies that are calling the Midwest states home. </span></p>\n<p><a href=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/Omaha-Nebraska-Startup.jpg?ssl=1\"><img class=\"size-large wp-image-3515 aligncenter\" src=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/Omaha-Nebraska-Startup.jpg?resize=1024%2C540&#038;ssl=1\" alt=\"Omaha Nebraska Startup City\" width=\"1024\" height=\"540\" srcset=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/Omaha-Nebraska-Startup.jpg?resize=1024%2C540&amp;ssl=1 1024w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/Omaha-Nebraska-Startup.jpg?resize=300%2C158&amp;ssl=1 300w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/Omaha-Nebraska-Startup.jpg?resize=1920%2C1013&amp;ssl=1 1920w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/Omaha-Nebraska-Startup.jpg?w=2160&amp;ssl=1 2160w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/Omaha-Nebraska-Startup.jpg?w=3240&amp;ssl=1 3240w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" data-recalc-dims=\"1\" /></a></p>\n<p><span style=\"font-weight: 400;\">In 2017, the Midwest is becoming more popular for technology startups. As found in <a href=\"https://www.usatoday.com/story/tech/news/2017/06/29/trump-election-tech-start-ups-midwest/100027750/\">USA Today</a>, most of the venture capitalists are actually leaving California and the Bay area and moving back home. These Midwesterners are getting back to their roots in hopes to seed aging rural and manufacturing centres that were bypassed during the tech boom. </span></p>\n<p><span style=\"font-weight: 400;\">The potential energy in these cities have not yet been taken advantage of and need proper investment and appropriate venture capital interest. Many Silicon Valley ex-pats that have moved back to the Midwest have brought with them their own brand of tech. Fewer entrepreneurs of the Midwest are focused on modern convenience apps for young urban dwellers and instead are taking on difficult problems for the region’s established industries. From insurance to retail to manufacturing and health care, they’re looking to find innovative solutions and bringing top talent from those industries and from Silicon Valley. </span></p>\n<p><img class=\"alignnone size-full wp-image-3527 aligncenter\" src=\"https://i2.wp.com/leverage.it/wp-content/uploads/2017/09/Bay-Area-infographic.png?resize=540%2C842&#038;ssl=1\" alt=\"Midwest Technology Startups USA Today\" width=\"540\" height=\"842\" srcset=\"https://i2.wp.com/leverage.it/wp-content/uploads/2017/09/Bay-Area-infographic.png?w=540&amp;ssl=1 540w, https://i2.wp.com/leverage.it/wp-content/uploads/2017/09/Bay-Area-infographic.png?resize=192%2C300&amp;ssl=1 192w\" sizes=\"(max-width: 540px) 100vw, 540px\" data-recalc-dims=\"1\" /></p>\n<p><span style=\"font-weight: 400;\">More than one-fourth of the Fortune 500 companies, 152, are based in the Midwest. This is creating a technology boom in the Midwestern United States that&#8217;s bringing these states to the forefront of the startup innovation. From a recent article found in USA Today, </span>Andrew Mager says he and his wife gave up their 425-square-foot, $2,400-a-month studio apartment in the Marina district of San Francisco. When they left San Francisco, they relocated to Detroit earlier this year and Mager, who works remotely as a software engineer for Postmates, says he and his wife can&#8217;t get over the expansiveness of their new three-bedroom in the Midwest. The 1,300-square-foot apartment they now have in Detroit costs nearly half what they used to pay.</p>\n<p class=\"p-text\">Another big draw for the Midwestern states? The prospering tech scene. While it doesn&#8217;t measure up to Silicon Valley, &#8220;Detroit is exploding with opportunities and we wanted to be part of it,&#8221; Mager, 32, says.</p>\n', '<p>Since we&#8217;re passionate about our city and startup culture, we previously featured a post on Toronto startups but our neighbours in the Midwestern United States also have a huge venture. Although it’s a growing market, not many people think of “technology hub” when they think of the Midwest. More often than not, when people imagine [&hellip;]</p>\n', 3529, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(17, 3481, '2017-09-11T17:34:15', 6, '2018-02-06T19:52:37', 'torontos-startup-scene-blowing', 'publish', 'https://leverage.it/torontos-startup-scene-blowing/', 'How Toronto&#8217;s startup scene is blowing up', '<p><span style=\"font-weight: 400;\">When asked where people think when it comes to tech startups, one of the places that come to mind and named most often is Silicon Valley.</span><span style=\"font-weight: 400;\"> A rich hub and leading startup ecosystem, Silicon Valley accounts for one third of venture capital investment in the United States. The United States has been a hub in the growing market for tech talent, however, skilled workers and new graduates are joining Canadian companies and Toronto is now North America&#8217;s fastest growing market. With 212,500 tech workers, Toronto is now the fourth largest tech talent market in North America.</span></p>\n<p><img class=\"aligncenter wp-image-3505 size-large\" src=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/San-Francisco-Silicon-Valley.jpg?resize=1024%2C683&#038;ssl=1\" alt=\"Silicon Valley\" width=\"1024\" height=\"683\" srcset=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/San-Francisco-Silicon-Valley.jpg?resize=1024%2C683&amp;ssl=1 1024w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/San-Francisco-Silicon-Valley.jpg?resize=300%2C200&amp;ssl=1 300w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/San-Francisco-Silicon-Valley.jpg?resize=1920%2C1280&amp;ssl=1 1920w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/San-Francisco-Silicon-Valley.jpg?w=2160&amp;ssl=1 2160w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/San-Francisco-Silicon-Valley.jpg?w=3240&amp;ssl=1 3240w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" data-recalc-dims=\"1\" /></p>\n<p><span style=\"font-weight: 400;\">In the last few years, Toronto has started to push and create opportunities for startups by offering incubators, accelerators and access to the tech community. As Canada&#8217;s strongest startup ecosystem as stated by <a href=\"https://techtoronto.org/Report2016/\">TechToronto</a>, Toronto has a growing startup ecosystem that contains 2,500 to 4,100 active startups and also has doubled more than national tech growth. Toronto&#8217;s technology ecosystem is a breeding ground for the latest startups and innovation. From large existing companies to smaller startups, many companies are flocking to Toronto. </span></p>\n<p><a href=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/Startup-office.jpg?ssl=1\"><img class=\"size-large wp-image-3508 aligncenter\" src=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/Startup-office.jpg?resize=1024%2C683&#038;ssl=1\" alt=\"desk space\" width=\"1024\" height=\"683\" srcset=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/Startup-office.jpg?resize=1024%2C683&amp;ssl=1 1024w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/Startup-office.jpg?resize=300%2C200&amp;ssl=1 300w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/Startup-office.jpg?resize=1920%2C1280&amp;ssl=1 1920w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/Startup-office.jpg?w=2160&amp;ssl=1 2160w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/09/Startup-office.jpg?w=3240&amp;ssl=1 3240w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" data-recalc-dims=\"1\" /></a></p>\n<p><span style=\"font-weight: 400;\">The key appeal to Toronto&#8217;s startup scene is the livability of the metropolis. Although rent is seen as high to the locals, in terms of other startup cities around the world, it&#8217;s considerably more affordable. Additionally, the cost of running a business in Toronto in terms of wages and real estate, is among the lowest in North America. This makes for a great starting point for tech startups wanting to take advantage of the new talent emerging. </span></p>\n<p><span style=\"font-weight: 400;\">An upcoming event in Toronto features technology startups and Canadian innovation. <a href=\"http://elevatetoronto.com/\">Elevate Toronto</a> is a three day event featuring Canadian startups as well as talent, founders, investors and corporate innovators interested in the ever growing technology market. </span></p>\n<p><a href=\"https://i2.wp.com/leverage.it/wp-content/uploads/2017/09/Toronto-Skyline.jpg?ssl=1\"><img class=\"size-large wp-image-3500 aligncenter\" src=\"https://i2.wp.com/leverage.it/wp-content/uploads/2017/09/Toronto-Skyline.jpg?resize=1024%2C532&#038;ssl=1\" alt=\"Toronto metropolis city\" width=\"1024\" height=\"532\" srcset=\"https://i2.wp.com/leverage.it/wp-content/uploads/2017/09/Toronto-Skyline.jpg?resize=1024%2C532&amp;ssl=1 1024w, https://i2.wp.com/leverage.it/wp-content/uploads/2017/09/Toronto-Skyline.jpg?resize=300%2C156&amp;ssl=1 300w, https://i2.wp.com/leverage.it/wp-content/uploads/2017/09/Toronto-Skyline.jpg?resize=1920%2C998&amp;ssl=1 1920w, https://i2.wp.com/leverage.it/wp-content/uploads/2017/09/Toronto-Skyline.jpg?w=2160&amp;ssl=1 2160w, https://i2.wp.com/leverage.it/wp-content/uploads/2017/09/Toronto-Skyline.jpg?w=3240&amp;ssl=1 3240w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" data-recalc-dims=\"1\" /></a></p>\n<p><span style=\"font-weight: 400;\">The startup culture in Toronto is growing and the downtown core has really come to the next level in terms of becoming a livable city where people can live, work and ride their bikes or transit to work in the same city. </span></p>\n<p><span style=\"font-weight: 400;\">We&#8217;ve gathered up a list of cool new startups here in Toronto for you to check out:</span></p>\n<ul>\n<li style=\"font-weight: 400;\"><a href=\"http://enthusiastgaming.com/\"><span style=\"font-weight: 400;\">Enthusiast Gaming</span></a></li>\n<li style=\"font-weight: 400;\"><a href=\"https://mediseen.ca/\"><span style=\"font-weight: 400;\">MediSeen</span></a></li>\n<li style=\"font-weight: 400;\"><a href=\"http://curbngo.com/\"><span style=\"font-weight: 400;\">Curbngo </span></a></li>\n</ul>\n', '<p>When asked where people think when it comes to tech startups, one of the places that come to mind and named most often is Silicon Valley. A rich hub and leading startup ecosystem, Silicon Valley accounts for one third of venture capital investment in the United States. The United States has been a hub in the [&hellip;]</p>\n', 3502, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(18, 3337, '2017-08-03T15:29:03', 14, '2017-11-16T18:51:48', 'protect-your-site-now-easy-steps', 'publish', 'https://leverage.it/protect-your-site-now-easy-steps/', 'Steps You Need To Take Right Now To Protect Your Site', '<h2>Three simple steps that will help you protect your site.</h2>\n<p><span style=\"font-weight: 400;\">Today, it is common for businesses and nonprofit organizations to accept payments online. However, this opens the door to more and more “bad guys” out to grab personal information and take advantage of those that are not being protected. In the following article we provide you with three important steps to protect your site. You may have heard of the Payment Card Industry Data Security Standards before, which is a set of rules governing how sensitive information can be stored and transmitted in order to ensure data privacy and security for all users. </span></p>\n<p><span style=\"font-weight: 400;\">Here are a few steps to move your site towards PCI compliance online:</span></p>\n<h3><b>1) Change your passwords</b></h3>\n<p><span style=\"font-weight: 400;\">Picture this common scenario: you get a default password from a vendor, then you pass it on to your co-worker. One week later, you are so used to typing in 473ngtw@! that you can do it with your eyes closed.  Bad idea! Hackers are familiar with default passwords and can easily gain access if they attempt the right site at the right time. Get into the habit of changing default passwords right away.</span></p>\n<p><a href=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/08/Change_Default_Password.jpg?ssl=1\"><img class=\"aligncenter wp-image-3340\" src=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/08/Change_Default_Password.jpg?resize=549%2C220&#038;ssl=1\" alt=\"change-password-site-protection\" width=\"549\" height=\"220\" srcset=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/08/Change_Default_Password.jpg?w=719&amp;ssl=1 719w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/08/Change_Default_Password.jpg?resize=300%2C120&amp;ssl=1 300w\" sizes=\"(max-width: 549px) 100vw, 549px\" data-recalc-dims=\"1\" /></a></p>\n<h3><b>2) Use a firewall</b></h3>\n<p><span style=\"font-weight: 400;\">A firewall examines any traffic attempting to access your site.  Based on a set of standard criteria, as well as any criteria specific to your site, the firewall will allow or block requests to your site. In addition, a firewall can prevent comment spamming on your blog &#8211; saving you the trouble of deleting all those unwelcome posts.  There are many companies that can provide a firewall &#8211; just to name a few: Cloudflare along with its CDN (Content Delivery Network), and Sitelock.</span></p>\n<p><span style=\"font-weight: 400;\"><img class=\"aligncenter wp-image-3339\" src=\"https://i2.wp.com/leverage.it/wp-content/uploads/2017/08/best-firewalls-for-windows-screenager-JsHQcn-clipart.png?resize=424%2C264&#038;ssl=1\" alt=\"use-firewall-protect-website\" width=\"424\" height=\"264\" srcset=\"https://i2.wp.com/leverage.it/wp-content/uploads/2017/08/best-firewalls-for-windows-screenager-JsHQcn-clipart.png?w=577&amp;ssl=1 577w, https://i2.wp.com/leverage.it/wp-content/uploads/2017/08/best-firewalls-for-windows-screenager-JsHQcn-clipart.png?resize=300%2C187&amp;ssl=1 300w\" sizes=\"(max-width: 424px) 100vw, 424px\" data-recalc-dims=\"1\" /></span></p>\n<h3><b>3) Keep your systems current</b></h3>\n<p><span style=\"font-weight: 400;\">Not only is it tedious, but it can be a major headache to update all applications your site might be using. That includes your CMS (i.e. WordPress) and all plugins, add-ons, etc. However, why is it strongly recommended? Here&#8217;s an example: a hacker manages to find a security loop in a plugin on your site which allows them to target your visitors. Meanwhile, an innocent user is attempting to make a donation to their favourite cause, and unknowingly sends money straight to the hacker&#8217;s bank account in Guatemala. By updating WordPress and plugins (or any other systems you might be using), you will minimize the risks caused to your site and site visitors.</span></p>\n<p><a href=\"https://i0.wp.com/leverage.it/wp-content/uploads/2017/08/maxresdefault-2.jpg?ssl=1\"><img class=\"aligncenter wp-image-3341\" src=\"https://i0.wp.com/leverage.it/wp-content/uploads/2017/08/maxresdefault-2.jpg?resize=389%2C257&#038;ssl=1\" alt=\"protect your site\" width=\"389\" height=\"257\" srcset=\"https://i0.wp.com/leverage.it/wp-content/uploads/2017/08/maxresdefault-2.jpg?w=2298&amp;ssl=1 2298w, https://i0.wp.com/leverage.it/wp-content/uploads/2017/08/maxresdefault-2.jpg?resize=300%2C199&amp;ssl=1 300w, https://i0.wp.com/leverage.it/wp-content/uploads/2017/08/maxresdefault-2.jpg?resize=1024%2C678&amp;ssl=1 1024w, https://i0.wp.com/leverage.it/wp-content/uploads/2017/08/maxresdefault-2.jpg?resize=1920%2C1271&amp;ssl=1 1920w, https://i0.wp.com/leverage.it/wp-content/uploads/2017/08/maxresdefault-2.jpg?w=2160&amp;ssl=1 2160w\" sizes=\"(max-width: 389px) 100vw, 389px\" data-recalc-dims=\"1\" /></a></p>\n<p><span style=\"font-weight: 400;\">These are a few tips to move your business or organization towards PCI Compliance. Visit </span><a href=\"https://www.pcicomplianceguide.org/\"><span style=\"font-weight: 400;\">https://www.pcicomplianceguide.org/</span></a><span style=\"font-weight: 400;\"> for a full list of PCI Compliance criteria.</span></p>\n', '<p>Three simple steps that will help you protect your site. Today, it is common for businesses and nonprofit organizations to accept payments online. However, this opens the door to more and more “bad guys” out to grab personal information and take advantage of those that are not being protected. In the following article we provide you [&hellip;]</p>\n', 3338, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(19, 3142, '2017-07-18T15:40:43', 14, '2018-02-06T19:55:08', 'ksm-developments-a-case-study-leverageit', 'publish', 'https://leverage.it/ksm-developments-a-case-study-leverageit/', 'KSM Developments: A Case Study', '<p><span style=\"font-weight: 400\">The LeverageIT team had a fantastic time branding, developing, and creating a whole new website for </span><a href=\"http://ksmdevelopments.com\"><span style=\"font-weight: 400\">KSM Developments. </span></a></p>\n<h2><b>About KSM Developments</b></h2>\n<p><a href=\"http://ksmdevelopments.com\"><span style=\"font-weight: 400\">KSM Developments</span></a><span style=\"font-weight: 400\"> is a global commercial real estate consulting &amp; development firm. KSM was founded in late 2015 in Toronto, and is focused on deploying global and local capital into the North American real estate market. </span></p>\n<h2><b>The Vision</b></h2>\n<p><span style=\"font-weight: 400\">When they approached us back in the winter of 2016, we enthusiastically took on the project. In the beginning, </span><a href=\"http://ksmdevelopments.com\"><span style=\"font-weight: 400\">KSM</span></a><span style=\"font-weight: 400\"> did not have a logo, brand, or website. Their objective was to have a beautiful website up and running that conveyed professionalism, expertise in their industry, and trustworthy. With these goals in mind, the LeverageIT members worked closely with KSM to develop branding and design that was a perfect reflection of the work they showcased.</span><br />\n<a href=\"https://i0.wp.com/leverage.it/wp-content/uploads/2017/07/July-13.jpg?ssl=1\"><img class=\"alignnone size-full wp-image-3143\" src=\"https://i0.wp.com/leverage.it/wp-content/uploads/2017/07/July-13.jpg?resize=1080%2C810&#038;ssl=1\" alt=\"July 13\" width=\"1080\" height=\"810\" srcset=\"https://i0.wp.com/leverage.it/wp-content/uploads/2017/07/July-13.jpg?w=4032&amp;ssl=1 4032w, https://i0.wp.com/leverage.it/wp-content/uploads/2017/07/July-13.jpg?resize=300%2C225&amp;ssl=1 300w, https://i0.wp.com/leverage.it/wp-content/uploads/2017/07/July-13.jpg?resize=1024%2C768&amp;ssl=1 1024w, https://i0.wp.com/leverage.it/wp-content/uploads/2017/07/July-13.jpg?resize=560%2C420&amp;ssl=1 560w, https://i0.wp.com/leverage.it/wp-content/uploads/2017/07/July-13.jpg?resize=900%2C675&amp;ssl=1 900w, https://i0.wp.com/leverage.it/wp-content/uploads/2017/07/July-13.jpg?resize=1920%2C1440&amp;ssl=1 1920w, https://i0.wp.com/leverage.it/wp-content/uploads/2017/07/July-13.jpg?w=2160&amp;ssl=1 2160w, https://i0.wp.com/leverage.it/wp-content/uploads/2017/07/July-13.jpg?w=3240&amp;ssl=1 3240w\" sizes=\"(max-width: 1080px) 100vw, 1080px\" data-recalc-dims=\"1\" /></a></p>\n<h5><em><span style=\"font-weight: 400\">“</span><span style=\"font-weight: 400\">LeverageIT has a great team of talented professionals that were dedicated and attentive to our company&#8217;s needs and delivered a top-tier service and product.&#8221;</span></em></h5>\n<p><em><span style=\"font-weight: 400\">-Founder, Jacob Iftah</span></em></p>\n<h3><a href=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/07/Screen-Shot-2017-07-18-at-11.28.02-AM.png?ssl=1\"><img class=\"alignnone size-full wp-image-3144\" src=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/07/Screen-Shot-2017-07-18-at-11.28.02-AM.png?resize=1080%2C649&#038;ssl=1\" alt=\"Screen Shot 2017-07-18 at 11.28.02 AM\" width=\"1080\" height=\"649\" srcset=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/07/Screen-Shot-2017-07-18-at-11.28.02-AM.png?w=2560&amp;ssl=1 2560w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/07/Screen-Shot-2017-07-18-at-11.28.02-AM.png?resize=300%2C180&amp;ssl=1 300w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/07/Screen-Shot-2017-07-18-at-11.28.02-AM.png?resize=1024%2C615&amp;ssl=1 1024w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/07/Screen-Shot-2017-07-18-at-11.28.02-AM.png?resize=1920%2C1154&amp;ssl=1 1920w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/07/Screen-Shot-2017-07-18-at-11.28.02-AM.png?w=2160&amp;ssl=1 2160w\" sizes=\"(max-width: 1080px) 100vw, 1080px\" data-recalc-dims=\"1\" /></a></h3>\n<p><span style=\"font-weight: 400\">In all, LeverageIT is pleased to have worked with </span><a href=\"http://ksmdevelopments.com\"><span style=\"font-weight: 400\">KSM Developments</span></a><span style=\"font-weight: 400\"> to create a stunning, modern brand and website. To see how your organization can benefit, please </span><a href=\"https://leverage.it/get-in-touch/\"><span style=\"font-weight: 400\">contact us</span></a><span style=\"font-weight: 400\">. We will be honoured to be a part in making your business stand out!</span></p>\n<p>&nbsp;</p>\n<p>Banner Image Photo Credit: Oscar Flores</p>\n', '<p>The LeverageIT team had a fantastic time branding, developing, and creating a whole new website for KSM Developments. About KSM Developments KSM Developments is a global commercial real estate consulting &amp; development firm. KSM was founded in late 2015 in Toronto, and is focused on deploying global and local capital into the North American real [&hellip;]</p>\n', 3149, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37');
