(20, 3135, '2017-07-07T14:33:06', 8, '2017-07-07T14:33:06', 'were-hiring-full-stack-developer', 'publish', 'https://leverage.it/were-hiring-full-stack-developer/', 'We&#8217;re Hiring: Full Stack Developer', '<p>Interested in working in a flexible and creative environment, while collaborating with an incredible team? Then this is your dream job. Candidate must have experience developing web applications using PHP, JavaScript, CSS, and mySQL. We are looking for a highly motivated individual who can thrive in a fast-paced environment, work on multiple project simultaneously, and successfully contribute to the team. The ideal candidate will have a can-do attitude, passion for technology, extensive development experience, and will be able to get up to speed quickly.</p>\n<p><strong>RESPONSIBILITIES</strong></p>\n<ul>\n<li>Plan and develop new software</li>\n<li>Assist in complete database design (queries, indexing and structure)</li>\n<li>Ongoing re-development of our current software/web applications</li>\n<li>Minimal system administration (repairing corrupted tables, restarting services, etc.)</li>\n<li>Construct an API framework</li>\n</ul>\n<p><strong>REQUIRED EDUCATION &amp; EXPERIENCE</strong></p>\n<ul>\n<li>Bachelors or Masters degree in Computer Science and/or equivalent experience</li>\n<li>3+ years in the IT industry and a good understanding of the full life cycle of development</li>\n<li>5+ years of hands-on experience in programming database driven web sites in technologies</li>\n</ul>\n<p><strong>REQUIRED SKILLS</strong></p>\n<ul>\n<li>Experience with PHP MVC frameworks, preferably Laravel</li>\n<li>Experience with Javascript, JSON and Ajax</li>\n<li>Experience with Javascript framework such as jQuery and AngularJS 1.X (Node.js knowledge is a bonus).</li>\n<li>Experience with Git, a bonus</li>\n<li>Detail-oriented and highly organized with the ability to handle multiple tasks simultaneously and meet tight deadlines</li>\n<li>Proven ability to learn new technologies and deliver measureable results in an aggressive environment</li>\n<li>Experience with Apache Cordova, a bonus</li>\n<li>Experience collecting business requirements from clients and writing scope of works as well as understanding business requirements of complex apps</li>\n</ul>\n<p><strong>Job Type:</strong> Full-time</p>\n<p><a href=\"http://indeedhi.re/2tZuppH\">Apply on Indeed</a> or by emailing your resume and CL to jobs[@]leverage.it</p>\n', '<p>Interested in working in a flexible and creative environment, while collaborating with an incredible team? Then this is your dream job. Candidate must have experience developing web applications using PHP, JavaScript, CSS, and mySQL. We are looking for a highly motivated individual who can thrive in a fast-paced environment, work on multiple project simultaneously, and [&hellip;]</p>\n', 3137, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(21, 3130, '2017-07-07T14:29:24', 8, '2017-07-07T14:33:27', 'were-hiring-digital-marketing-coordinator', 'publish', 'https://leverage.it/were-hiring-digital-marketing-coordinator/', 'We&#8217;re hiring: Digital Marketing Coordinator', '<p>We&#8217;re a growing digital agency in Toronto with a variety of exciting clients, ranging from start-ups to established industry leaders. We&#8217;re currently looking for a digital marketing coordinator who can help in the day-to-day tasks of account management and content creation. The ideal candidate should have strong written communication skills, have an excellent attention to detail and be interested in marketing or digital. As previously mentioned, we&#8217;re a growing agency and the right individual will have a great opportunity here to receive a lot of valuable experience and growth.</p>\n<p><strong>Job overview:</strong></p>\n<ul>\n<li>Compose content in the form of articles, blog posts, slideshows, social media posts, etc.</li>\n<li>Understanding of SEO basics</li>\n<li>Research, create, schedule, publish content according to online marketing plan</li>\n<li>Works closely with our Digital Marketing Lead</li>\n<li>Follow current online marketing trends to increase leads</li>\n<li>Experience designing and implementing social media campaigns on LinkedIn, Twitter, Facebook, YouTube, Instagram, etc.</li>\n<li>Should be proficient with Hootsuite (or another scheduling platform), Canva (or another design platform)</li>\n<li>Comfortable with Google Analytics, tracking key conversions, setting up goals, etc.</li>\n<li>Bonus: experience with SEM, SEO, PPC, Adwords, social advertising</li>\n</ul>\n<p><strong>Qualifications &amp; skills:</strong></p>\n<ul>\n<li>Excellent writing skills</li>\n<li>Good sense of design aesthetics</li>\n<li>Ability to work in a fast-paced work environment</li>\n<li>Perfectionist, pays great attention to details</li>\n<li>Excellent organizational and project management skills</li>\n<li>Good at researching topics</li>\n</ul>\n<p><strong>Experience:</strong></p>\n<ul>\n<li>1-2+ years in online marketing</li>\n<li>Bachelor’s Degree in marketing or advertising preferred</li>\n</ul>\n<p><strong>Job Type:</strong> Full-time</p>\n<p><strong>Apply:</strong></p>\n<p><a href=\"http://indeedhi.re/2sUC7fW\">Apply on Indeed</a> or by emailing your resume and CL to jobs[@]leverage.it</p>\n', '<p>We&#8217;re a growing digital agency in Toronto with a variety of exciting clients, ranging from start-ups to established industry leaders. We&#8217;re currently looking for a digital marketing coordinator who can help in the day-to-day tasks of account management and content creation. The ideal candidate should have strong written communication skills, have an excellent attention to [&hellip;]</p>\n', 3131, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(22, 3115, '2017-06-27T19:13:32', 14, '2018-02-06T17:30:36', 'doing-business-with-google-make-your-company-stand-out-with-timely-updates', 'publish', 'https://leverage.it/doing-business-with-google-make-your-company-stand-out-with-timely-updates/', 'Make Your Company Stand Out With Timely Updates', '<p><span style=\"font-weight: 400\">Take charge of what people see when they do a local search for your business. Make your company stand out and get the attention of people searching for your services or products by using </span><a href=\"https://www.google.com/business/?ppsrc=GPDA2\"><i><span style=\"font-weight: 400\">Google My Business</span></i></a><i><span style=\"font-weight: 400\">. </span></i><span style=\"font-weight: 400\">This week Google released a new feature that allows businesses to post special events and promotions on their Google listing. And the best news? It’s free to use!</span></p>\n<p><a href=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/06/Screen-Shot-2017-06-27-at-3.08.03-PM.png?ssl=1\"><img class=\"alignnone wp-image-3116\" src=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/06/Screen-Shot-2017-06-27-at-3.08.03-PM.png?resize=430%2C360&#038;ssl=1\" alt=\"Screen Shot 2017-06-27 at 3.08.03 PM\" width=\"430\" height=\"360\" srcset=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/06/Screen-Shot-2017-06-27-at-3.08.03-PM.png?resize=300%2C251&amp;ssl=1 300w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/06/Screen-Shot-2017-06-27-at-3.08.03-PM.png?resize=1024%2C858&amp;ssl=1 1024w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/06/Screen-Shot-2017-06-27-at-3.08.03-PM.png?w=1428&amp;ssl=1 1428w\" sizes=\"(max-width: 430px) 100vw, 430px\" data-recalc-dims=\"1\" /></a></p>\n<p><span style=\"font-weight: 400\">We currently have </span><a href=\"https://www.google.com/business/?ppsrc=GPDA2\"><i><span style=\"font-weight: 400\">Google My Business</span></i></a> <span style=\"font-weight: 400\">for LeverageIT. When we moved into our new office this month, we easily updated our location on our Google listing to <a href=\"https://www.google.ca/maps/place/LeverageIT/@43.7549858,-79.4733714,17z/data=!3m1!4b1!4m5!3m4!1s0x882b339ff754c60f:0x20725939189d7c5b!8m2!3d43.7549858!4d-79.4711827\">1170 Sheppard Street West</a>. The change took place instantly. </span></p>\n<p><a href=\"https://i2.wp.com/leverage.it/wp-content/uploads/2017/06/Screen-Shot-2017-06-27-at-3.09.04-PM.png?ssl=1\"><img class=\"alignnone wp-image-3117\" src=\"https://i2.wp.com/leverage.it/wp-content/uploads/2017/06/Screen-Shot-2017-06-27-at-3.09.04-PM.png?resize=424%2C353&#038;ssl=1\" alt=\"Screen Shot 2017-06-27 at 3.09.04 PM\" width=\"424\" height=\"353\" srcset=\"https://i2.wp.com/leverage.it/wp-content/uploads/2017/06/Screen-Shot-2017-06-27-at-3.09.04-PM.png?resize=300%2C250&amp;ssl=1 300w, https://i2.wp.com/leverage.it/wp-content/uploads/2017/06/Screen-Shot-2017-06-27-at-3.09.04-PM.png?w=920&amp;ssl=1 920w\" sizes=\"(max-width: 424px) 100vw, 424px\" data-recalc-dims=\"1\" /></a></p>\n<p><span style=\"font-weight: 400\">We recommend all of our clients to familiarize themselves with </span><a href=\"https://www.google.com/business/?ppsrc=GPDA2\"><i><span style=\"font-weight: 400\">Google My Business</span></i></a> <span style=\"font-weight: 400\">if you have not used it before. Be sure to take advantage of the new timely updates feature. </span></p>\n<p><span style=\"font-weight: 400\">We’ve come up with some examples of how this could be used:</span></p>\n<h3><b>Hosting An Event</b></h3>\n<p><span style=\"font-weight: 400\">Your business in Toronto is having a special event coming up, and you would like to spread the word. Go to the </span><a href=\"https://www.google.com/appserve/mkt/p/OKnuUA7LRQ4pAWjralol_DAWXl9S_vQhq6JmBzJIoCiVHZbmS8pIRsU8qK099GmIuEn-U80_PxESLllFdGOCztpGToTRTw8BJ7ofZZdxZa-Xfm2elJjLo8tVyamUIL9mb218wBNtj6WCL9WMOwga-VnCVJFldda4HI8SXue0_JDNqmJO07FmIptbkwNYCiDReYv_X568IZwCJwi9dqqv2EhQY34kfrmzydpy9cxK3c9fJ5BlOjZWi64=\"><span style=\"font-weight: 400\">“posts” tab</span></a><span style=\"font-weight: 400\">, create a call to action &#8211; such as “Find Out More”, and publish it. Anyone searching for your business in Toronto will see this event right in the listing. Feel free to include a time, date, and location!</span></p>\n<h3><b>Special Promotion</b></h3>\n<p><span style=\"font-weight: 400\">Maybe your business would like to celebrate its anniversary, or push out an improvement to a service or product. There are endless reasons you can create posts to broadcast your promotion. If you are a service business, a concise title like “Call us today and receive 15% off any services” will do. If your business makes products, a “buy one and get the second set 50% off” promo would work well. Choose a call-to-action that allows people to learn more about the promotion, whether that’s a link to your website or a phone number to call. </span></p>\n<h3><b>Announcements</b></h3>\n<p><span style=\"font-weight: 400\">Perhaps your business is opening a new location. Attract some attention through your Google listing “New Location Celebration” and invite people to a party! Include a photo of the new location, add a date and time, and publish the post you’ve created to be viewed by people when they search up your business locally. </span></p>\n<p>&nbsp;</p>\n', '<p>Take charge of what people see when they do a local search for your business. Make your company stand out and get the attention of people searching for your services or products by using Google My Business. This week Google released a new feature that allows businesses to post special events and promotions on their [&hellip;]</p>\n', 3122, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(23, 3069, '2017-05-16T14:29:22', 9, '2018-02-06T19:55:22', 'chai-lifeline-case-study', 'publish', 'https://leverage.it/chai-lifeline-case-study/', 'Chai Lifeline: A Case Study', '<p>Of  all of our favourite projects, developing and designing Chai Lifeline Canada’s website was truly a fun and fulfilling experience.</p>\n<p>Chai Lifeline is a non-profit organization which serves to help support families and children living with any illness with tutoring, counselling and events. With hundreds of volunteers and thousands of supported people, Chai Lifeline has become known one of the forerunners of support systems for children and families Canada-wide.</p>\n<h4><span style=\"font-weight: 400;\">The Vision</span></h4>\n<p><span style=\"font-weight: 400;\">Chai Lifeline is extremely well-known for their amazing work and the organization understood the importance of staying relevant and up to date in everything technological so they can better help those in need. </span></p>\n<p><a href=\"http://leverage.it/what-we-do/\">Leverage IT was up to the task.</a></p>\n<p>With the importance of Chai Lifeline’s objectives in mind, Leverage IT members went to work on developing and designing a website that delivered the Chai Lifeline’s motto: “Fight Illness with Love”.</p>\n<h4><span style=\"font-weight: normal;\">What We Did</span></h4>\n<ul>\n<li style=\"font-weight: 400;\"><b>Web Design &amp; Development: </b><span style=\"font-weight: 400;\">Our Leverage IT designers put much thought into the colour scheme, media and layout we built a website from the ground up that instills a sentiment of love, hope and positivity.</span></li>\n<li style=\"font-weight: 400;\"><b>SEO: </b><span style=\"font-weight: 400;\">In the website’s creation, Leverage IT also was able to implement SEO foundations to boost their online presence and increase website traffic.</span></li>\n<li style=\"font-weight: 400;\"><b>Modernization: </b><span style=\"font-weight: 400;\">Our designers mapped the site for easy navigation, and our content creators curated relevant and engaging content &amp; photos which appeal to the reader .</span></li>\n<li style=\"font-weight: 400;\"><b>Data Consolidation and Integration: </b><span style=\"font-weight: 400;\">Leverage IT was able to consolidate and link all of Chai Lifeline’s data together which made it easier to receive donations, promote events and track RSVPs and engage across all platforms.</span></li>\n</ul>\n<blockquote><p><i><span style=\"font-weight: 400;\">“</span></i><i><span style=\"font-weight: 400;\">Leverage.it created a beautiful website to elucidate for our donors and the community how their support makes a difference for the children and families we serve”</span></i></p></blockquote>\n<p><span style=\"font-weight: 400;\">&#8211; Craig Fried, MHA, Director of Development</span></p>\n<p><a href=\"https://chailifelinecanada.org/\"><span style=\"font-weight: 400;\">Click here to learn more about Chai Lifeline</span></a><span style=\"font-weight: 400;\">!</span></p>\n<p><span style=\"font-weight: 400;\">Leverage IT is so proud to be a part of what Chai Lifeline does to help children and their families. To see how your organization can benefit, please contact us and we’ll be honoured to be a part in making this world a better place for all!</span></p>\n\n                <div class=\'gf_browser_unknown gform_wrapper\' id=\'gform_wrapper_2\' ><form method=\'post\' enctype=\'multipart/form-data\'  id=\'gform_2\'  action=\'/wp-json/wp/v2/posts?per_page=100\'>\n                        <div class=\'gform_heading\'>\n                            <h3 class=\'gform_title\'>Reach Out</h3>\n                            <span class=\'gform_description\'>Form for after case study or blog post\'s Leverage plug</span>\n                        </div>\n                        <div class=\'gform_body\'><ul id=\'gform_fields_2\' class=\'gform_fields top_label form_sublabel_below description_below\'><li id=\'field_2_1\'  class=\'gfield gfield_contains_required field_sublabel_below field_description_below gfield_visibility_visible\' ><label class=\'gfield_label\' for=\'input_2_1\' >Name<span class=\'gfield_required\'>*</span></label><div class=\'ginput_container ginput_container_text\'><input name=\'input_1\' id=\'input_2_1\' type=\'text\' value=\'\' class=\'medium\'     aria-required=\"true\" aria-invalid=\"false\" /></div></li><li id=\'field_2_2\'  class=\'gfield field_sublabel_below field_description_below gfield_visibility_visible\' ><label class=\'gfield_label\' for=\'input_2_2\' >Phone</label><div class=\'ginput_container ginput_container_number\'><input name=\'input_2\' id=\'input_2_2\' type=\'text\'    value=\'\' class=\'medium\'      aria-invalid=\"false\"/></div></li><li id=\'field_2_3\'  class=\'gfield gfield_contains_required field_sublabel_below field_description_below gfield_visibility_visible\' ><label class=\'gfield_label\' for=\'input_2_3\' >Email<span class=\'gfield_required\'>*</span></label><div class=\'ginput_container ginput_container_text\'><input name=\'input_3\' id=\'input_2_3\' type=\'text\' value=\'\' class=\'medium\'     aria-required=\"true\" aria-invalid=\"false\" /></div></li><li id=\'field_2_4\'  class=\'gfield field_sublabel_below field_description_below gfield_visibility_visible\' ><label class=\'gfield_label\' for=\'input_2_4\' >How can Leverage help you?</label><div class=\'ginput_container ginput_container_textarea\'><textarea name=\'input_4\' id=\'input_2_4\' class=\'textarea medium\'      aria-invalid=\"false\"   rows=\'10\' cols=\'50\'></textarea></div></li>\n                            </ul></div>\n        <div class=\'gform_footer top_label\'> <div></div><input type=\'submit\' id=\'gform_submit_button_2\' class=\'gform_button button\' value=\'Submit\'  onclick=\'if(window[\"gf_submitting_2\"]){return false;}  window[\"gf_submitting_2\"]=true;  \' onkeypress=\'if( event.keyCode == 13 ){ if(window[\"gf_submitting_2\"]){return false;} window[\"gf_submitting_2\"]=tru