erves to help support families and children living with any illness with tutoring, counselling and events. With hundreds of volunteers and thousands of supported people, Chai Lifeline has [&hellip;]</p>\n', 2803, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(24, 3097, '2017-05-11T16:16:42', 9, '2018-02-06T19:55:31', 'payquad-solutions-case-study', 'publish', 'https://leverage.it/payquad-solutions-case-study/', 'Payquad Solutions: A Case Study', '<p>Payquad Solutions is exactly as stated. A solution.</p>\n<p><span style=\"font-weight: 400;\">The premise of Payquad’s service is to make the monthly task of paying rent or condo fees easy and seamless. With Payquad, residents can pay rent from any device, set up pre-authorized payments and even maximize credit card rewards points!</span></p>\n<h4><span style=\"font-weight: 400;\">The Vision</span></h4>\n<p><span style=\"font-weight: 400;\">Payquad’s goals were simple: create a powerful, yet user-friendly experience for automating rent payments both for the residents and property management companies.</span></p>\n<p><span style=\"font-weight: 400;\">That’s where Leverage.it was given its opportunity to shine.</span></p>\n<h4><span style=\"font-weight: 400;\">Services Provided</span></h4>\n<p><span style=\"font-weight: 400;\">After sitting down with Payquad personnel and getting an in-depth understanding of their business model, we were able to identify and execute a plan of action:</span></p>\n<ul>\n<li style=\"font-weight: 400;\"><b>Branding:</b><span style=\"font-weight: 400;\"> Designing and curating a brand theme which resonates with Payquad’s audience on all platforms</span></li>\n<li style=\"font-weight: 400;\"><b>Storytelling:</b><span style=\"font-weight: 400;\"> Offering both tenants and property management companies unique perspectives of each other</span></li>\n<li style=\"font-weight: 400;\"><b>Functioning: </b><span style=\"font-weight: 400;\">Creating a powerful and efficient portal which delivers payments quickly and securely</span></li>\n<li style=\"font-weight: 400;\"><b>Digitalizing:</b><span style=\"font-weight: 400;\"> Building a beautiful, user-friendly website and social media outlets with Payquad’s clients in mind</span></li>\n</ul>\n<p><span style=\"font-weight: 400;\">Leverage.it’s ability to provide Payquad with a full-service solution to prepare them to launch proved invaluable, as Payquad’s David Janowski was once heard saying: </span></p>\n<blockquote><p><span style=\"font-weight: 400;\">“Meir and the Leverage team have been a pleasure to deal with on a continual basis. The team&#8217;s technical knowledge and know-how is incredible and has helped us move our projects forward”.</span></p></blockquote>\n<p><span style=\"font-weight: 400;\">We don’t usually brag, but when we do it’s because we are proud of our accomplishments. See the results for yourself at </span><a href=\"http://www.payquad.com\"><span style=\"font-weight: 400;\">www.payquad.com</span></a><span style=\"font-weight: 400;\"> and fill out the form below to learn how we can help improve your business!</span></p>\n\n                <div class=\'gf_browser_unknown gform_wrapper\' id=\'gform_wrapper_2\' ><form method=\'post\' enctype=\'multipart/form-data\'  id=\'gform_2\'  action=\'/wp-json/wp/v2/posts?per_page=100\'>\n                        <div class=\'gform_heading\'>\n                            <h3 class=\'gform_title\'>Reach Out</h3>\n                        </div>\n                        <div class=\'gform_body\'><ul id=\'gform_fields_2\' class=\'gform_fields top_label form_sublabel_below description_below\'><li id=\'field_2_1\'  class=\'gfield gfield_contains_required field_sublabel_below field_description_below gfield_visibility_visible\' ><label class=\'gfield_label\' for=\'input_2_1\' >Name<span class=\'gfield_required\'>*</span></label><div class=\'ginput_container ginput_container_text\'><input name=\'input_1\' id=\'input_2_1\' type=\'text\' value=\'\' class=\'medium\'     aria-required=\"true\" aria-invalid=\"false\" /></div></li><li id=\'field_2_2\'  class=\'gfield field_sublabel_below field_description_below gfield_visibility_visible\' ><label class=\'gfield_label\' for=\'input_2_2\' >Phone</label><div class=\'ginput_container ginput_container_number\'><input name=\'input_2\' id=\'input_2_2\' type=\'text\'    value=\'\' class=\'medium\'      aria-invalid=\"false\"/></div></li><li id=\'field_2_3\'  class=\'gfield gfield_contains_required field_sublabel_below field_description_below gfield_visibility_visible\' ><label class=\'gfield_label\' for=\'input_2_3\' >Email<span class=\'gfield_required\'>*</span></label><div class=\'ginput_container ginput_container_text\'><input name=\'input_3\' id=\'input_2_3\' type=\'text\' value=\'\' class=\'medium\'     aria-required=\"true\" aria-invalid=\"false\" /></div></li><li id=\'field_2_4\'  class=\'gfield field_sublabel_below field_description_below gfield_visibility_visible\' ><label class=\'gfield_label\' for=\'input_2_4\' >How can Leverage help you?</label><div class=\'ginput_container ginput_container_textarea\'><textarea name=\'input_4\' id=\'input_2_4\' class=\'textarea medium\'      aria-invalid=\"false\"   rows=\'10\' cols=\'50\'></textarea></div></li>\n                            </ul></div>\n        <div class=\'gform_footer top_label\'> <div></div><input type=\'submit\' id=\'gform_submit_button_2\' class=\'gform_button button\' value=\'Submit\'  onclick=\'if(window[\"gf_submitting_2\"]){return false;}  window[\"gf_submitting_2\"]=true;  \' onkeypress=\'if( event.keyCode == 13 ){ if(window[\"gf_submitting_2\"]){return false;} window[\"gf_submitting_2\"]=true;  jQuery(\"#gform_2\").trigger(\"submit\",[true]); }\' /> \n            <input type=\'hidden\' class=\'gform_hidden\' name=\'is_submit_2\' value=\'1\' />\n            <input type=\'hidden\' class=\'gform_hidden\' name=\'gform_submit\' value=\'2\' />\n            \n            <input type=\'hidden\' class=\'gform_hidden\' name=\'gform_unique_id\' value=\'\' />\n            <input type=\'hidden\' class=\'gform_hidden\' name=\'state_2\' value=\'WyJbXSIsIjAyOGRkZjExYWMyMjZjNTFhNTllMTk5ZWY4OGM4ODViIl0=\' />\n            <input type=\'hidden\' class=\'gform_hidden\' name=\'gform_target_page_number_2\' id=\'gform_target_page_number_2\' value=\'0\' />\n            <input type=\'hidden\' class=\'gform_hidden\' name=\'gform_source_page_number_2\' id=\'gform_source_page_number_2\' value=\'1\' />\n            <input type=\'hidden\' name=\'gform_field_values\' value=\'\' />\n            \n        </div>\n                        </form>\n                        </div><script type=\'text/javascript\'> if(typeof gf_global == \'undefined\') var gf_global = {\"gf_currency_config\":{\"name\":\"U.S. Dollar\",\"symbol_left\":\"$\",\"symbol_right\":\"\",\"symbol_padding\":\"\",\"thousand_separator\":\",\",\"decimal_separator\":\".\",\"decimals\":2},\"base_url\":\"https:\\/\\/leverage.it\\/wp-content\\/plugins\\/gravityforms\",\"number_formats\":[],\"spinnerUrl\":\"https:\\/\\/leverage.it\\/wp-content\\/plugins\\/gravityforms\\/images\\/spinner.gif\"};jQuery(document).bind(\'gform_post_render\', function(event, formId, currentPage){if(formId == 2) {} } );jQuery(document).bind(\'gform_post_conditional_logic\', function(event, formId, fields, isInit){} );</script><script type=\'text/javascript\'> jQuery(document).ready(function(){jQuery(document).trigger(\'gform_post_render\', [2, 1]) } ); </script>\n', '<p>Payquad Solutions is exactly as stated. A solution. The premise of Payquad’s service is to make the monthly task of paying rent or condo fees easy and seamless. With Payquad, residents can pay rent from any device, set up pre-authorized payments and even maximize credit card rewards points! The Vision Payquad’s goals were simple: create [&hellip;]</p>\n', 3100, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(25, 3054, '2017-05-09T20:44:57', 5, '2017-05-10T15:35:55', 'app-market-fit', 'publish', 'https://leverage.it/app-market-fit/', 'Finding Your App’s “Market Fit”', '<p><span style=\"font-weight: 400;\"><br />\nSo, you think you’ve got a great app idea. Great! What you are going to do about it, is the real question.</span></p>\n<p><span style=\"font-weight: 400;\"><img class=\"size-medium wp-image-3094 alignleft\" src=\"https://i2.wp.com/leverage.it/wp-content/uploads/2017/05/Lit-Lightbulb-300x240.jpg?resize=300%2C240\" alt=\"Lit Lightbulb\" width=\"300\" height=\"240\" srcset=\"https://i2.wp.com/leverage.it/wp-content/uploads/2017/05/Lit-Lightbulb.jpg?resize=300%2C240&amp;ssl=1 300w, https://i2.wp.com/leverage.it/wp-content/uploads/2017/05/Lit-Lightbulb.jpg?resize=1024%2C821&amp;ssl=1 1024w, https://i2.wp.com/leverage.it/wp-content/uploads/2017/05/Lit-Lightbulb.jpg?resize=1920%2C1539&amp;ssl=1 1920w\" sizes=\"(max-width: 300px) 100vw, 300px\" data-recalc-dims=\"1\" />There is an old adage that states “More gold is mined from the mind of man than from the soil of the earth”.  The truth is, everyone has an idea and every idea for an app has potential to be the next Uber or Whatsapp but it all boils down to execution. </span></p>\n<p>&nbsp;</p>\n<p>Here are three quick things to execute in order to know whether the idea for an app you’ve mined is a lump of coal or the mother-lode. Without doing your homework, you’ll be pouring money and time into an app which might be mining nothing but rocks.</p>\n<h4><b><b>Think: Why Choose Me?</b></b></h4>\n<p>The first stage in figuring out the value of your app is to learn why people would use it. Start by thinking about what people would gain from your app in terms of time, functionality or financially.</p>\n<p><span style=\"font-weight: 400;\">Knowing what your customer lacks helps you better tweak your app to suit their needs. Also, it will help your marketing efforts later on when you need to identify your Target Audience.</span></p>\n<p><span style=\"font-weight: 400;\">Ask yourself: </span></p>\n<ol>\n<ol>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">“What problem am I addressing with my app?”</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">“Is my app providing a unique experience that cannot be gotten elsewhere?”</span></li>\n</ol>\n</ol>\n<h4>Speak: Would You Choose Me?</h4>\n<p><span style=\"font-weight: 400;\">While you might think you know what needs your app fulfills, chances are they aren’t even aware that they need anything. </span></p>\n<blockquote><p><span style=\"font-weight: 400;\">The best marketing is showing a customer why they </span><b><i>need</i></b><span style=\"font-weight: 400;\"> you.</span></p></blockquote>\n<p><span style=\"font-weight: 400;\">Have you ever thought about a new technology or product and thought “how did I ever live without it?” If so, you now know how your app has to make people feel.</span></p>\n<p><span style=\"font-weight: 400;\">Without diligent research, you will never know if your app will take off. Getting feedback on your idea from real, unbiased people (your Mom and BFF don’t count) will allow you to learn what bothers your potential client base and improve the final product.</span></p>\n<p><span style=\"font-weight: 400;\">Remember to keep an open mind when collecting data you might find yourself with a totally different (and better-selling) app in the end!</span></p>\n<h4><b><b>Act: Choose Me!</b></b></h4>\n<p>Now let’s get down to business. Test it.</p>\n<p><span style=\"font-weight: 400;\">Create a Beta version of your app and send it to as many people as possible. Give your guinea pigs some time to use it and then gather feedback; does it need more tweaking? Is your product really satisfying anyone’s needs? </span></p>\n<p><span style=\"font-weight: 400;\">Find your low-hanging fruit (a client acquired at minimal or no cost) and show them why and how you’re helping them in ways they never knew!<br />\n</span></p>\n<p><span style=\"font-weight: 400;\">A good sign would be a referral or share. If an app user shares it with someone else, that’s usually a good sign that you’re on the right track.</span></p>\n<p><span style=\"font-weight: 400;\">Do you have something that everyone needs but don’t know how to get it out there? </span><span style=\"font-weight: 400;\"><a href=\"http://leverage.it/what-we-do/\">Leverage.it  can help</a>!</span></p>\n<p><span style=\"font-weight: 400;\">We’ll meet with you and discuss your business, strategy and curate a plan of execution tailored to your apps technological needs and marketing audience. <a href=\"http://leverage.it/get-to-know-us/\">Our multi-talented staff members</a> can’t wait to show you how we can mine your mother lode idea!</span></p>\n\n                <div class=\'gf_browser_unknown gform_wrapper\' id=\'gform_wrapper_2\' ><form method=\'post\' enctype=\'multipart/form-data\'  id=\'gform_2\'  action=\'/wp-json/wp/v2/posts?per_page=100\'>\n                        <div class=\'gform_heading\'>\n                            <h3 class=\'gform_title\'>Reach Out</h3>\n                        </div>\n                        <div class=\'gform_body\'><ul id=\'gform_fields_2\' class=\'gform_fields top_label form_sublabel_below description_below\'><li id=\'field_2_1\'  class=\'gfield gfield_contains_required field_sublabel_below field_description_below gfield_visibility_visible\' ><label class=\'gfield_label\' for=\'input_2_1\' >Name<span class=\'gfield_required\'>*</span></label><div class=\'ginput_container ginput_container_text\'><input name=\'input_1\' id=\'input_2_1\' type=\'text\' value=\'\' class=\'medium\'     aria-required=\"true\" aria-invalid=\"false\" /></div></li><li id=\'field_2_2\'  class=\'gfield field_sublabel_below field_description_below gfield_visibility_visible\' ><label class=\'gfield_label\' for=\'input_2_2\' >Phone</label><div class=\'ginput_container ginput_container_number\'><input name=\'input_2\' id=\'input_2_2\' type=\'text\'    value=\'\' class=\'medium\'      aria-invalid=\"false\"/></div></li><li id=\'field_2_3\'  class=\'gfield gfield_contains_required field_sublabel_below field_description_below gfield_visibility_visible\' ><label class=\'gfield_label\' for=\'input_2_3\' >Email<span class=\'gfield_required\'>*</span></label><div class=\'ginput_container ginput_container_text\'><input name=\'input_3\' id=\'input_2_3\' type=\'text\' value=\'\' class=\'medium\'     aria-required=\"true\" aria-invalid=\"false\" /></div></li><li id=\'field_2_4\'  class=\'gfield field_sublabel_below field_description_below gfield_visibility_visible\' ><label class=\'gfield_label\' for=\'input_2_4\' >How can Leverage help you?</label><div class=\'ginput_container ginput_container_textarea\'><textarea name=\'input_4\' id=\'input_2_4\' class=\'textarea medium\'      aria-invalid=\"false\"   rows=\'10\' cols=\'50\'></textarea></div></li>\n                            </ul></div>\n        <div class=\'gform_footer top_label\'> <div></div><input type=\'submit\' id=\'gform_submit_button_2\' class=\'gform_button button\' value=\'Submit\'  onclick=\'if(window[\"gf_submitting_2\"]){return false;}  window[\"gf_submitting_2\"]=true;  \' onkeypress=\'if( event.keyCode == 13 ){ if(window[\"gf_submitting_2\"]){return false;} window[\"gf_submitting_2\"]=true;  jQuery(\"#gform_2\").trigger(\"submit\",[true]); }\' /> \n            <input type=\'hidden\' class=\'gform_hidden\' name=\'is_submit_2\' value=\'1\' />\n            <input type=\'hidden\' class=\'gform_hidden\' name=\'gform_submit\' value=\'2\' />\n            \n            <input type=\'hidden\' class=\'gform_hidden\' name=\'gform_unique_id\' value=\'\' />\n            <input type=\'hidden\' class=\'gform_hidden\' name=\'state_2\' value=\'WyJbXSIsIjAyOGRkZjExYWMyMjZjNTFhNTllMTk5ZWY4OGM4ODViIl0=\' />\n            <input type=\'hidden\' class=\'gform_hidden\' name=\'gform_target_page_number_2\' id=\'gform_target_page_number_2\' value=\'0\' />\n            <input type=\'hidden\' class=\'gform_hidden\' name=\'gform_source_page_number_2\' id=\'gform_source_page_number_2\' value=\'1\' />\n            <input type=\'hidden\' name=\'gform_field_values\' value=\'\' />\n            \n        </div>\n                        </form>\n                        </div><script type=\'text/javascript\'> if(typeof gf_global == \'undefined\') var gf_global = {\"gf_currency_config\":{\"name\":\"U.S. Dollar\",\"symbol_left\":\"$\",\"symbol_right\":\"\",\"symbol_padding\":\"\",\"thousand_separator\":\",\",\"decimal_separator\":\".\",\"decimals\":2},\"base_url\":\"https:\\/\\/leverage.it\\/wp-content\\/plugins\\/gravityforms\",\"number_formats\":[],\"spinnerUrl\":\"https:\\/\\/leverage.it\\/wp-content\\/plugins\\/gravityforms\\/images\\/spinner.gif\"};jQuery(document).bind(\'gform_post_render\', function(event, formId, currentPage){if(formId == 2) {} } );jQuery(document).bind(\'gform_post_conditional_logic\', function(event, formId, fields, isInit){} );</script><script type=\'text/javascript\'> jQuery(document).ready(function(){jQuery(document).trigger(\'gform_post_render\', [2, 1]) } ); </script>\n', '<p>So, you think you’ve got a great app idea. Great! What you are going to do about it, is the real question. There is an old adage that states “More gold is mined from the mind of man than from the soil of the earth”.  The truth is, everyone has an idea and every idea [&hellip;]</p>\n', 3093, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(26, 3049, '2017-05-09T17:29:26', 9, '2017-05-10T14:15:42', 'meet-our-new-graphic-design-intern', 'publish', 'https://leverage.it/meet-our-new-graphic-design-intern/', 'Meet our New Graphic Design Intern!', '<p><a href=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/05/14681626_10154795442741531_2509338313233837942_n.jpg\"><img class=\"aligncenter wp-image-3088\" src=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/05/14681626_10154795442741531_2509338313233837942_n.jpg?resize=477%2C480\" alt=\"Emily\" width=\"477\" height=\"480\" srcset=\"https://i1.wp.com/leverage.it/wp-content/uploads/2017/05/14681626_10154795442741531_2509338313233837942_n.jpg?w=953&amp;ssl=1 953w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/05/14681626_10154795442741531_2509338313233837942_n.jpg?resize=150%2C150&amp;ssl=1 150w, https://i1.wp.com/leverage.it/wp-content/uploads/2017/05/14681626_10154795442741531_2509338313233837942_n.jpg?resize=298%2C300&amp;ssl=1 298w\" sizes=\"(max-width: 477px) 100vw, 477px\" data-recalc-dims=\"1\" /></a><br />\nIt is our pleasure to introduce to you… (drumroll, please)</p>\n<p>Emily Campbell!</p>\n<p>Emily is a Graphic Design Ninja. She honed her talents at Humber College, and Leverage.It spotted her gift at Emily’s portfolio showing.</p>\n<p>Emily loves the branding aspect of design, and draws her inspiration from Paula Scher and hopes to one day be able to incorporate her favourite colour scheme (blue and yellow) into a successful product.</p>\n<p>Teamwork and a good office vibe is what’s most important to Emily.</p>\n<p>In her spare time, Emily enjoys nature, board games, Indie and Alternative music and chilling with her cat, Paul Anka.</p>\n', '<p>It is our pleasure to introduce to you… (drumroll, please) Emily Campbell! Emily is a Graphic Design Ninja. She honed her talents at Humber College, and Leverage.It spotted her gift at Emily’s portfolio showing. Emily loves the branding aspect of design, and draws her inspiration from Paula Scher and hopes to one day be able [&hellip;]</p>\n', 3050, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(27, 3002, '2017-03-13T22:57:24', 2, '2018-02-06T19:56:12', 'a-short-history-of-the-leverageit-website', 'publish', 'https://leverage.it/a-short-history-of-the-leverageit-website/', 'A short history of the LeverageIT website', '<p>So finally, after many moons, the shoemaker finally got some shoes. And by that I mean LeverageIT finally has a website that we&#8217;re not collectively cringing over. One may think it simple &#8211; this is literally what we do for a living. But take roundabout 20 web professionals and task them with agreeing on a vision and you&#8217;ll see, it ain&#8217;t no piece of cake.<br />\n&nbsp;<br />\nOver the years we have designed and even built iteration after iteration of a website for ourselves that have been ripped apart, often mocked (in a kindly fashion) and ultimately, scrapped. We struggled with showcasing our talents in an honest, personal, modern, and interesting way. Last Wednesday our clock started ticking when a client let us know that our current dismal site was malfunctioning to the point of suicide watch. Without the luxury of time, we suddenly did what every great procrastinator can do &#8211; we sprinted to the finish line. In 3 days we designed and built a site that we can show without excuses. While there&#8217;s still work to be done to perfect our online representation, we can finally breathe a sigh of relief that we&#8217;re not the embarrassment of the web community.<br />\n&nbsp;<br />\nAn unexpected side effect of building the site, was delving into our past projects for our portfolio page and the realization of the vast amount of clients we have been able to touch over the past years. Each one, a building block to the next, taught us how to listen, how to further refine our skill, how to learn or push back depending on the need. Our clients have afforded us the luxury of marketing our services for us, and for that we are forever grateful.<br />\n&nbsp;<br />\nNow don&#8217;t for a second think we won&#8217;t start this process all over next year when our next bright idea comes along.</p>\n', '<p>So finally, after many moons, the shoemaker finally got some shoes. And by that I mean LeverageIT finally has a website that we&#8217;re not collectively cringing over. One may think it simple &#8211; this is literally what we do for a living. But take roundabout 20 web professionals and task them with agreeing on a vision and [&hellip;]</p>\n', 3003, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(28, 2536, '2016-11-02T14:59:59', 7, '2018-02-06T17:30:47', 'life-as-a-graphic-design-intern-fresh-out-of-school', 'publish', 'https://leverage.it/life-as-a-graphic-design-intern-fresh-out-of-school/', 'My Experience as a Graphic Designer Intern (Fresh Out Of School)', '<p>Before I jump into my internship, I just wanted to quickly introduce myself. I’m a graphic designer fresh out of school and I love web design and branding.</p>\n<p>It has been a month since I began my internship at LeverageIT and within those 4 weeks, I’ve learned quite a bit and I know there’s still so much more for me to learn and I cannot wait. The Humber College Graphic Design program is 3 years, that including a summer internship that helps you get work experience. The summer internship portion is what I’m currently doing. This industry is extremely competitive so it only seems natural now that I would feel scared, nervous, happy and excited all at the same time.</p>\n<p>&nbsp;</p>\n<p><strong>HOW I GOT MY INTERNSHIP</strong></p>\n<p>At the end of the semester, a majority of the design programs have a portfolio night, attended by industry, friends, and family. It&#8217;s a great opportunity to get feedback on your portfolio. This is and was our night to shine, because what better way to find a job than to actually talk to the person that is able to hire you.</p>\n<p>This is where I met Ali. <span style=\"text-decoration: underline;\">Al</span>i is LeverageIT’s creative director and my mentor. Upon meeting him, I was immediately appreciative of him. We went through my portfolio together and he told me what he liked and what he didn’t. Ali who is experienced with website and UI/UX design, gave me a lot of feedback that I did not previously consider. Going to school, I had a big interest in web and app design, but I was unable to receive qualified feedback on my work from someone who is actually experienced in this field until I met Ali.</p>\n<p>&nbsp;</p>\n<p><strong>MY INTERNSHIP</strong></p>\n<p><strong>The Start</strong></p>\n<p>Coming in, I was extremely excited but at the same time, I had knots in my stomach. I was nervous for many reasons but mainly about making mistakes and fear of not being <em>good enough</em>. I was more excited than nervous but the two emotions would often compete. was excited that I found a digital agency that without me knowing, checked off the things on my list that I was looking for.</p>\n<p>What I Wanted vs What They Offered</p>\n<p>• I have such a big love and interest for <strong>web design</strong> and at LeverageIT this is what they do.</p>\n<p>• I actually never considered <strong>marketing</strong> before but it ended up being something I quite enjoyed after working on a few projects here that involve it.</p>\n<p>• I work with a lot of <strong>developers</strong> and it’s really cool to see a design being brought to life.</p>\n<p>• Free <strong><em>coffee</em></strong>. I think this one is self explanatory, free coffee is the best type of coffee.</p>\n<p>• LeverageIT is such a <strong>welcoming environment</strong> to work in. Working in an environment like this only makes me want to work harder to keep everyone and myself happy.</p>\n<p>&nbsp;</p>\n<p><strong>The Process<br />\n</strong>As an intern, I find it quite challenging. There’s a lot to learn in a short amount of time and expectations are high. There are so many designers who could have applied and I got it. This is my chance to prove myself. I’m constantly thinking to myself if what I’m doing is okay, are they happy? Do they like it? What can I improve on? What else can I do? Am I doing enough? What do I do if they don’t like it? So many questions ripping through my mind. And… it’s okay to have questions and especially to ask questions. It’s better to ask questions so both yourself and whoever you’re working with is on the same page. When assuming everything could go wrong and a lot of time can be wasted. The people you work with will most likely be very happy to help you out.</p>\n<p>&nbsp;</p>\n<p><strong>The End<br />\n</strong>Your internship is a great opportunity for you to learn. It’s the best time because you’re not quite a full-time member but you’re not a student either. You’re not treated like a student but you’re still learning and being taught. You’re not just there to learn, you are there to improve and gain experience. You might find that you really enjoy doing something you didn’t consider but took on the challenge anyways. Going into my internship, I’ve learned a lot and have become so much more curious. I’ve found an interest and liking for marketing, coding and development.  It’s a constant learning process that should never end because you won’t grow as a designer or person. It’s not about perfection but more of your progression. Something I took away at my interview is “have a curious mind.” And even the board room was saying it to my face “Stay hungry, stay foolish” Always wanting to learn and explore is a good mindset to have.</p>\n<p>&nbsp;</p>\n', '<p>Before I jump into my internship, I just wanted to quickly introduce myself. I’m a graphic designer fresh out of school and I love web design and branding. It has been a month since I began my internship at LeverageIT and within those 4 weeks, I’ve learned quite a bit and I know there’s still [&hellip;]</p>\n', 2942, '2019-04-11 02:14:20', '2019-04-26 01:14:37', '2019-04-26 01:14:37');
