(29, 2552, '2016-08-04T21:29:13', 4, '2017-03-10T17:03:43', 'leverageit-goes-to-techweek-toronto-2016', 'publish', 'https://leverage.it/leverageit-goes-to-techweek-toronto-2016/', 'LeverageIT goes to Techweek Toronto 2016', '<p>&nbsp;</p>\n<p>&nbsp;</p>\n<h1>The top 10 highlights from Techweek Toronto 2016</h1>\n<p><a href=\"https://i0.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/100.jpg\"><img class=\"aligncenter wp-image-2595 size-large\" src=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/100-1024x682.jpg?resize=1024%2C682\" alt=\"\" width=\"1024\" height=\"682\" data-recalc-dims=\"1\" /></a></p>\n<p><a href=\"https://i0.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/091.jpg\"><img class=\"aligncenter wp-image-2576 size-large\" src=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/091-1024x682.jpg?resize=1024%2C682\" alt=\"\" width=\"1024\" height=\"682\" data-recalc-dims=\"1\" /></a></p>\n<p><a href=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/081.jpg\"><img class=\"aligncenter size-large wp-image-2566\" src=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/081-1024x682.jpg?resize=1024%2C682\" alt=\"08\" width=\"1024\" height=\"682\" data-recalc-dims=\"1\" /></a></p>\n<p><a href=\"https://i2.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/7.jpg\"><img class=\"aligncenter wp-image-2600 size-large\" src=\"https://i2.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/7-1024x682.jpg?resize=1024%2C682\" alt=\"\" width=\"1024\" height=\"682\" data-recalc-dims=\"1\" /></a></p>\n<p><a href=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/061.jpg\"><img class=\"aligncenter wp-image-2577 size-large\" src=\"https://i0.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/061-1024x682.jpg?resize=1024%2C682\" alt=\"\" width=\"1024\" height=\"682\" data-recalc-dims=\"1\" /></a></p>\n<p><a href=\"https://i0.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/05.jpg\"><img class=\"aligncenter size-large wp-image-2558\" src=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/05-1024x682.jpg?resize=1024%2C682\" alt=\"05\" width=\"1024\" height=\"682\" data-recalc-dims=\"1\" /></a></p>\n<p><a href=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/041.jpg\"><img class=\"aligncenter wp-image-2590 size-large\" src=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/041-1024x682.jpg?resize=1024%2C682\" alt=\"\" width=\"1024\" height=\"682\" data-recalc-dims=\"1\" /></a></p>\n<p><a href=\"https://i0.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/3.jpg\"><img class=\"aligncenter size-large wp-image-2585\" src=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/3-1024x682.jpg?resize=1024%2C682\" alt=\"3\" width=\"1024\" height=\"682\" data-recalc-dims=\"1\" /></a></p>\n<p><a href=\"https://i2.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/002.jpg\"><img class=\"aligncenter wp-image-2594 size-large\" src=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/002-1024x682.jpg?resize=1024%2C682\" alt=\"\" width=\"1024\" height=\"682\" data-recalc-dims=\"1\" /></a></p>\n<p><a href=\"https://i0.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/01.jpg\"><img class=\"aligncenter size-large wp-image-2554\" src=\"https://i0.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/08/01-1024x682.jpg?resize=1024%2C682\" alt=\"01\" width=\"1024\" height=\"682\" data-recalc-dims=\"1\" /></a></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n', '<p>&nbsp; &nbsp; The top 10 highlights from Techweek Toronto 2016 &nbsp; &nbsp; &nbsp; &nbsp;</p>\n', 2944, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(30, 2514, '2016-05-30T18:18:21', 7, '2018-02-06T17:30:57', 'new-designer-julie', 'publish', 'https://leverage.it/new-designer-julie/', 'Meet our Newest Designer: Julie', '<p class=\"p1\">My name is Julie, and I’m a graphic designer. I studied graphic design and graduated from Humber College.</p>\n<p class=\"p1\"><span class=\"s1\">I’m a creative problem solver, I have a passion for functionality and design. I love and enjoy web design, UI/UX design,<br />\n</span><span class=\"s1\">and brand identity but that does not limit my skills for other mediums. I am open to the challenge. </span></p>\n<p class=\"p1\"><span class=\"s1\">I draw my inspiration from everything around me.  I’m attracted to all<br />\nminimalistic designs, I’m a firm believer in the “Less is more&#8221; approach.</span></p>\n<p class=\"p1\"><span class=\"s1\">Besides my design background, I enjoy playing with my Boston Terriers, watching Game of Thrones and eating<br />\nanything deep fried. </span></p>\n', '<p>My name is Julie, and I’m a graphic designer. I studied graphic design and graduated from Humber College. I’m a creative problem solver, I have a passion for functionality and design. I love and enjoy web design, UI/UX design, and brand identity but that does not limit my skills for other mediums. I am open to [&hellip;]</p>\n', 2946, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(31, 2501, '2016-03-16T17:23:31', 8, '2018-02-06T17:31:11', 'creating-a-mens-lifestyle-brand-aristocrat-socks', 'publish', 'https://leverage.it/creating-a-mens-lifestyle-brand-aristocrat-socks/', 'Creating a men&#8217;s lifestyle brand: Aristocrat Socks', '<p>Social media is saturated with lifestyle brands, everyone from individual bloggers, to street style photographers, to indie brands, and of course, style magazine, are clamouring for your attention&#8211;and more importantly&#8211;your dollars. So how do you create a new brand that can stand out from the noise?</p>\n<p>That was the challenge we faced when Samuel Werner approached us with his idea for a new high-end mens socks collection: <a href=\"http://aristocratsocks.com/\">Aristocrat Socks</a>. Mr. Werner had a look and feel in mind&#8211;he wanted it to be luxurious yet still affordable. His family&#8217;s history in producing top quality garments, meant access to the best materials and production facilities. We wanted to communicate that to our client.</p>\n<p>The solution:</p>\n<p>To stand out from other sock brands, many of which focus on quirkier, brighter designs with a hipster/skater crowd in mind. We decided to focus on a different crowd and create a more refined brand. We studied the history of menswear, how mens&#8217; style developed through the centuries and decades. The image of the &#8216;dandy&#8217; particularly resonated with the Aristocrat vision.</p>\n<p><a href=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/03/Screen-Shot-2016-03-16-at-12.55.52-PM.png\"><img class=\"alignnone size-full wp-image-2502\" src=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/03/Screen-Shot-2016-03-16-at-12.55.52-PM.png?resize=898%2C496\" alt=\"Screen Shot 2016-03-16 at 12.55.52 PM\" width=\"898\" height=\"496\" data-recalc-dims=\"1\" /></a></p>\n<p>We started thinking of men, art, and literature that resonated with our brand &#8211; we used this inspiration to create the copy.</p>\n<p>We also wanted to bring more modern elements into the brand, especially a feel of the city where Aristocrat was born&#8211;Toronto. Our first photoshoot was centred around the Werner&#8217;s office near Bathurst and Dupont. In addition to our brand imagery, our product naming was also inspired by the streets and areas nearby.</p>\n<p><a href=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/03/Screen-Shot-2016-03-16-at-1.08.20-PM.png\"><img class=\"alignnone size-full wp-image-2503\" src=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/03/Screen-Shot-2016-03-16-at-1.08.20-PM.png?resize=909%2C510\" alt=\"Screen Shot 2016-03-16 at 1.08.20 PM\" width=\"909\" height=\"510\" data-recalc-dims=\"1\" /></a></p>\n<p>The result is a brand that has a clean, modern feel but alludes back to <em>the good old days, </em>when getting dressed was a pleasure, not a chore, and men paid attention to every detail of their outfit, from head to toe&#8230;or sock.</p>\n<p><a href=\"https://i2.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/03/Screen-Shot-2016-03-16-at-1.23.21-PM.png\"><img class=\"alignnone size-full wp-image-2504\" src=\"https://i2.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/03/Screen-Shot-2016-03-16-at-1.23.21-PM.png?resize=898%2C510\" alt=\"Screen Shot 2016-03-16 at 1.23.21 PM\" width=\"898\" height=\"510\" data-recalc-dims=\"1\" /></a></p>\n', '<p>Social media is saturated with lifestyle brands, everyone from individual bloggers, to street style photographers, to indie brands, and of course, style magazine, are clamouring for your attention&#8211;and more importantly&#8211;your dollars. So how do you create a new brand that can stand out from the noise? That was the challenge we faced when Samuel Werner [&hellip;]</p>\n', 2948, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(32, 2482, '2016-02-21T19:54:53', 8, '2018-02-06T17:31:30', 'digital-marketing-metrics-and-achieving-business-goals-part-1', 'publish', 'https://leverage.it/digital-marketing-metrics-and-achieving-business-goals-part-1/', 'Digital Marketing Metrics and Achieving Business Goals: Impressions', '<p class=\"p1\"><span class=\"s1\">If your small business has a website, you&#8217;re probably already paying someone to do your digital marketing. However, digital marketing is vast and covers many things, with innovations happening daily. As with most business activities, it is important to measure the success of any digital marketing efforts you take on. For some, this comes easy but for others it can be a little harder and overwhelming. In a series of blog posts, I’ll explain the most commonly confused metrics to help you decide whether or not they’ll work toward achieving your business goals. </span></p>\n<p class=\"p2\"><span class=\"s1\"><b>Impressions</b></span></p>\n<p class=\"p1\"><span class=\"s1\"><b>Basic Definition:</b> The total number of times your ads show.<span class=\"Apple-converted-space\">  </span>This might be as images on the side or top of a website if you pay for display advertising, or as paid search results using AdWords.</span></p>\n<p class=\"p1\"><span class=\"s1\"><b>Does It Matter:</b> If your business goal is brand awareness, you&#8217;ll want your ads to show up for potential customers as many times and places as possible. Think of it as passing out flyers downtown. The to ask yourself is what you will gain from your ad showing more. Are your ads frequent and pervasive enough to be memorable? How will this brand awareness affect your revenue? Although you are paying for a large number of impressions, viewers may not be clicking or taking action based on your ads. </span></p>\n<p class=\"p1\"><span class=\"s1\">The form of advertising used may also determine the number of impressions your ads will get. If your advertising plan is &#8220;pay-per-click,&#8221; your daily/monthly budget may be reached with fewer impressions if you have a high clickthrough rate, but have the same effect on your ROI than if it took more impressions to get the same clicks. </span></p>\n<p class=\"p1\"><span class=\"s1\">Here’s an example:</span></p>\n<p class=\"p1\"><span class=\"s1\">Imagine your monthly PPC is $1,000. Each of your clicks costs $1, so you can afford 1,000 clicks per month. </span></p>\n<p class=\"p1\"><span class=\"s1\">In March, 5 out of every 100 people that saw your ad and clicked on it. This means that you totalled 20,000 impressions.</span></p>\n<p class=\"p1\"><span class=\"s1\">In April, you improved your ad and now 20 out of 100 people click on it. Your total number of impressions for this month was &#8220;only&#8221; 5,000.</span></p>\n<p class=\"p1\"><span class=\"s1\">Even though your number of impressions dropped by 75% (20,000 to 5,000) in the span of one month, the net result to your business is the exact same, because it resulted in the same number of clicks.</span></p>\n<p class=\"p1\"><span class=\"s1\">Depending on your objectives there can be an issue of having too few impressions. You might expect that your ads will be clicked on X many times producing X amount of revenue, but if they don&#8217;t show to enough people, this will take longer than expected. </span></p>\n<p class=\"p1\"><span class=\"s1\">Let&#8217;s say you operate in a niche industry, selling only green Mickey Mouse watches in Cincinnati, Ohio. Imagine that you&#8217;ve hired an AdWords manager to bring clicks to your e-commerce website. It’s likely that very few people in Cincinnati are searching Google for green Mickey Mouse watches, so your ads will likely not show very often. Since people won’t see your ad there will be very low amount of clicks. </span></p>\n<p class=\"p1\"><span class=\"s1\">Many advertising services offer pay-per-impression plans (PPM), and it&#8217;s important to know that it&#8217;s quite possible that your expenses are being measured using a &#8220;metric&#8221; that is not directly related to your revenue stream. In other words, your expenses are being measured based on the first step in the purchase process (awareness), and not allowing you to properly gage how they relate to the last step of the process (buying decision).</span></p>\n<p class=\"p1\">Keep an eye out for more posts around the key digital marketing metrics your business needs to know and measure.</p>\n', '<p>If your small business has a website, you&#8217;re probably already paying someone to do your digital marketing. However, digital marketing is vast and covers many things, with innovations happening daily. As with most business activities, it is important to measure the success of any digital marketing efforts you take on. For some, this comes easy [&hellip;]</p>\n', 2950, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(33, 2476, '2016-02-17T14:50:36', 1, '2018-02-06T17:44:30', 'tips-to-make-your-site-responsive-and-what-that-really-means-anyway', 'publish', 'https://leverage.it/tips-to-make-your-site-responsive-and-what-that-really-means-anyway/', 'Tips to make your site responsive (and what that really means anyway)', '<p><span style=\"font-weight: 400;\">We’re moving into the mobile world.  If you aren’t thinking of your site’s compatibility with different screen sizes, you’d better think again.</span></p>\n<p><a href=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/UNIVERSITY-PRESS.png\"><img class=\"alignnone size-full wp-image-2478\" src=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/UNIVERSITY-PRESS.png?resize=1080%2C589\" alt=\"UNIVERSITY PRESS\" width=\"1080\" height=\"589\" data-recalc-dims=\"1\" /></a></p>\n<p><span style=\"font-weight: 400;\">So what’s the answer?  How do we keep up with the times?  What do I have to do to provide a warm welcome to the growing percentage of mobile customers?</span></p>\n<p><span style=\"font-weight: 400;\">You might hear the term “responsive” thrown around.  If a site is “responsive” it means that it “responds” to different screen sizes.  So Joe on his PC, Kate on her tablet and Mark on his smartphone all visiting the same url will view content that fits nicely on their screen without scrolling horizontally for miles.</span></p>\n<p><span style=\"font-weight: 400;\">How is this achieved?  Here are a few tips for re-arranging your content for smaller screen sizes.</span></p>\n<ol>\n<li style=\"padding-left: 60px;\"><span style=\"color: #333333;\"><b>Stack away. </b><span style=\"font-weight: 400;\"> Where on a large screen you might have several columns across, or content laid out across your screen, on smaller screens content gets stacked vertically.  By using a framework like bootstrap from the get-go to lay out your page, this stacking will be achieved with little or no additional effort.</span></span></li>\n<li style=\"padding-left: 60px;\"><span style=\"color: #333333;\"><b>Scale down the content.</b><span style=\"font-weight: 400;\">  Every piece of content from your website might not be necessary for your mobile site.  Smaller screen size = cut to the chase.  No one wants to scroll down for 2 minutes to find what they are looking for.  Analyze your content and images to determine if each piece really adds value to your mobile clientele.  Where a small image on your site might be a nice compliment to your content, on your mobile device it might take over and get in the way.  Bottom line is that only the essentials should remain.</span></span></li>\n<li style=\"padding-left: 60px;\"><span style=\"color: #333333;\"><b>Kill the menu bar.  </b><span style=\"font-weight: 400;\">The menu is an important part of your mobile site, but to display it in the same way you would on your full-screen version would be a waste of valuable real estate.  The mobile menu icon has conventionally become the “3-bar”.   There are many options for how the actual menu can look and function but the idea is that all options are not visible all the time.</span></span></li>\n</ol>\n<p><span style=\"font-weight: 400;\">This has been an intro to building responsive sites.  Stay tuned for the next steps with responsive design&#8230;</span></p>\n', '<p>We’re moving into the mobile world.  If you aren’t thinking of your site’s compatibility with different screen sizes, you’d better think again. So what’s the answer?  How do we keep up with the times?  What do I have to do to provide a warm welcome to the growing percentage of mobile customers? You might hear [&hellip;]</p>\n', 2952, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(34, 2423, '2016-02-07T19:15:53', 8, '2018-02-06T19:56:30', 'dates-holidays-to-add-to-your-social-media-and-content-calendars-us-canada', 'publish', 'https://leverage.it/dates-holidays-to-add-to-your-social-media-and-content-calendars-us-canada/', 'Dates &#038; holidays to add to your social media and content calendars (US &#038; Canada)', '<p>Valentine&#8217;s Day is just around the corner, a day when brands jump on the bandwagon and <a href=\"http://www.momentology.com/5021-14-valentines-day-marketing-campaigns-to-swoon-over/\">create lovey-dovey content</a>. Making the most of current events is nothing new for brands, most have had an organized <a href=\"http://www.convinceandconvert.com/social-media-strategy/how-to-build-a-content-calendar-plus-a-free-template-for-2014/\">content calendar</a> with important dates, anniversaries, and events related to their industry. With social media, this phenomenon has became more prevalent, since the process of <a href=\"https://en.wikipedia.org/wiki/Real-time_marketing\">creating and publishing content is now a lot faster and easier</a>.</p>\n<p>Your brand can also take advantage of interesting events, dates, and holidays to help you create timely, relevant content. Below is a list of dates you should keep note of:</p>\n<p><a href=\"https://i2.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY.png\"><img class=\"alignnone wp-image-2435 size-full\" src=\"https://i2.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY.png?resize=1080%2C295\" alt=\"JANUARY\" width=\"1080\" height=\"295\" data-recalc-dims=\"1\" /></a></p>\n<ul>\n<li><span style=\"color: #333333;\">January 1st &#8211;  New Years Eve</span></li>\n<li><span style=\"color: #333333;\">January 18 &#8211; Martin Luther Kind Day</span></li>\n</ul>\n<p><a href=\"https://i2.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY-1.png\"><img class=\"alignnone size-full wp-image-2437\" src=\"https://i2.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY-1.png?resize=1080%2C295\" alt=\"JANUARY (1)\" width=\"1080\" height=\"295\" data-recalc-dims=\"1\" /></a></p>\n<ul>\n<li><span style=\"color: #333333;\">February &#8211; <a style=\"color: #333333;\" href=\"https://en.wikipedia.org/wiki/Super_Bowl\">Super Bowl</a> </span></li>\n<li><span style=\"color: #333333;\">February &#8211; <a style=\"color: #333333;\" href=\"https://en.wikipedia.org/wiki/Grammy_Award\">GRAMMYs</a></span></li>\n<li><span style=\"color: #333333;\">February &#8211; <a style=\"color: #333333;\" href=\"https://en.wikipedia.org/wiki/Academy_Awards\">Oscars, Academy Awards</a></span></li>\n<li><span style=\"color: #333333;\">February 14th &#8211; Valentine&#8217;s Day</span></li>\n<li><span style=\"color: #333333;\">February &#8211; 3rd Monday in February &#8211; Family Day (Canada)</span></li>\n</ul>\n<p><a href=\"https://i0.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY-2.png\"><img class=\"alignnone size-full wp-image-2438\" src=\"https://i0.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY-2.png?resize=1080%2C295\" alt=\"JANUARY (2)\" width=\"1080\" height=\"295\" data-recalc-dims=\"1\" /></a></p>\n<ul>\n<li><span style=\"color: #333333;\">March 17th &#8211; St. Patrick&#8217;s Day</span></li>\n<li><span style=\"color: #333333;\">March 20th &#8211; First Day of Spring</span></li>\n<li><span style=\"color: #333333;\">March 25th &#8211; Good Friday &#8211; (<em>Long Weekend)</em></span></li>\n<li><span style=\"color: #333333;\">March 27th &#8211; Easter</span></li>\n</ul>\n<p><a href=\"https://i0.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY-3.png\"><img class=\"alignnone size-full wp-image-2439\" src=\"https://i0.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY-3.png?resize=1080%2C295\" alt=\"JANUARY (3)\" width=\"1080\" height=\"295\" data-recalc-dims=\"1\" /></a></p>\n<ul>\n<li><span style=\"color: #333333;\">April 1st