/2016/02/JANUARY-6.png\"><img class=\"alignnone size-full wp-image-2443\" src=\"https://i0.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY-6.png?resize=1080%2C295\" alt=\"JANUARY (6)\" width=\"1080\" height=\"295\" data-recalc-dims=\"1\" /></a></p>\n<ul>\n<li>July 1st &#8211; Canada Day</li>\n<li><span style=\"color: #333333;\">July 2nd &#8211; Tour De Frnace </span></li>\n<li><span style=\"color: #333333;\">July 4th &#8211; Independence Day (US)</span></li>\n</ul>\n<p><a href=\"https://i2.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY-7.png\"><img class=\"alignnone size-full wp-image-2444\" src=\"https://i2.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY-7.png?resize=1080%2C295\" alt=\"JANUARY (7)\" width=\"1080\" height=\"295\" data-recalc-dims=\"1\" /></a></p>\n<ul>\n<li><span style=\"color: #333333;\">August 1st &#8211; Civic Holiday (Canada)</span></li>\n<li><span style=\"color: #333333;\">August 5th &#8211; Summer Olympics </span></li>\n</ul>\n<p><a href=\"https://i2.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY-8.png\"><img class=\"alignnone size-full wp-image-2445\" src=\"https://i2.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY-8.png?resize=1080%2C295\" alt=\"JANUARY (8)\" width=\"1080\" height=\"295\" data-recalc-dims=\"1\" /></a></p>\n<ul>\n<li><span style=\"color: #333333;\">September &#8211; Labor Day</span></li>\n<li><span style=\"color: #333333;\">September &#8211; Back-to-School</span></li>\n<li><span style=\"color: #333333;\">September 11th &#8211; Patriots Day</span></li>\n</ul>\n<p><a href=\"https://i2.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY-9.png\"><img class=\"alignnone size-full wp-image-2446\" src=\"https://i2.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY-9.png?resize=1080%2C295\" alt=\"JANUARY (9)\" width=\"1080\" height=\"295\" data-recalc-dims=\"1\" /></a></p>\n<ul>\n<li><span style=\"color: #333333;\">October 10th &#8211; Thanksgiving (Canada) </span></li>\n<li><span style=\"color: #333333;\">October 31st &#8211; Halloween</span></li>\n<li><span style=\"color: #333333;\">October &#8211; World Series (US)</span></li>\n</ul>\n<p><a href=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY-10.png\"><img class=\"alignnone size-full wp-image-2447\" src=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY-10.png?resize=1080%2C295\" alt=\"JANUARY (10)\" width=\"1080\" height=\"295\" data-recalc-dims=\"1\" /></a></p>\n<ul>\n<li><span style=\"color: #333333;\">November 11th &#8211; Veteran&#8217;s Day (US)</span></li>\n<li><span style=\"color: #333333;\">November 11th &#8211; Remembrance Day (Canada)</span></li>\n<li><span style=\"color: #333333;\">November 24th &#8211; Thanksgiving (US)</span></li>\n</ul>\n<p><a href=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY-11.png\"><img class=\"alignnone size-full wp-image-2448\" src=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/JANUARY-11.png?resize=1080%2C295\" alt=\"JANUARY (11)\" width=\"1080\" height=\"295\" data-recalc-dims=\"1\" /></a></p>\n<ul>\n<li><span style=\"color: #333333;\">December 25th &#8211; Christmas </span></li>\n<li><span style=\"color: #333333;\">December 26th &#8211; Boxing Day</span></li>\n</ul>\n<p><span style=\"color: #333333;\">If you need more specific calendar, you can find them here:</span></p>\n<ul>\n<li><span style=\"color: #333333;\"><a style=\"color: #333333;\" href=\"http://www.topendsports.com/events/calendar-2016.htm\">Sports events in 2016</a></span></li>\n<li><span style=\"color: #333333;\"><a style=\"color: #333333;\" href=\"http://www.itnsource.com/fr/specials/anniversaries\">Historical anniversaries and dates in 2016</a></span></li>\n<li><span style=\"color: #333333;\"><a style=\"color: #333333;\" href=\"http://www.famousbirthdays.com/\">Birthdays of famous people</a></span></li>\n</ul>\n<div id=\"attachment_2424\" style=\"width: 610px\" class=\"wp-caption alignright\"><img class=\"wp-image-2424\" src=\"https://i1.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/pharrell-arbys-had.jpg?resize=600%2C358\" alt=\"pharrell arbys had\" width=\"600\" height=\"358\" data-recalc-dims=\"1\" /><p class=\"wp-caption-text\">Arby&#8217;s took advantage of Pharrell Williams Hat at the 2014 GRAMMYs and caused a real-time social marketing sensation</p></div>\n<p>You can create content beforehand for special holidays and events, but sometimes the best content happens because someone was paying attention and created something at the right moment.  It&#8217;s what happened during the 2014 GRAMMYs when <a href=\"https://www.google.ca/url?sa=t&amp;rct=j&amp;q=&amp;esrc=s&amp;source=web&amp;cd=1&amp;cad=rja&amp;uact=8&amp;ved=0ahUKEwi049y6sObKAhVCOSYKHSWJB0EQFggcMAA&amp;url=http%3A%2F%2Farbys.ca%2F&amp;usg=AFQjCNEgfP6cJxv-2IariwUmvfMEn21LmA\">Arby</a>&#8216;s <a href=\"https://twitter.com/arbys/status/427614008946855936\">tweeted</a> about <a href=\"https://twitter.com/Pharrell\">Pharrell Williams</a> interesting hat choice.</p>\n<p>During the Grammys many brands live-tweet and post content in real-time across social platforms. Arby&#8217;s was one of these brands and kept a close eye on what was happening at the show, so when rapper/producer Pharrell showed up in a distinct headpiece that closely resembled Arby&#8217;s own logo, they jumped on the opportunity to connect the dots in a pretty funny way.</p>\n<p>While <a href=\"http://www.businessinsider.com/pharrells-ridiculous-grammy-hat-became-an-internet-meme-2014-1\">everyone was poking fun at Pharrell&#8217;s choice of hat</a>, it was Arby&#8217;s tweet that gained the most attention, because it was funny, timely, and very relevant. The tweet received over 79,000 retweets to date and the brand made headlines around the world for their use of real-time marketing.</p>\n<p>So, if you&#8217;ll be creating marketing content around a specific event or date, try and see if you can use smart real-time marketing to create something unique and special.</p>\n', '<p>Valentine&#8217;s Day is just around the corner, a day when brands jump on the bandwagon and create lovey-dovey content. Making the most of current events is nothing new for brands, most have had an organized content calendar with important dates, anniversaries, and events related to their industry. With social media, this phenomenon has became more prevalent, [&hellip;]</p>\n', 2954, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(35, 2406, '2016-02-04T17:10:30', 1, '2018-02-06T17:44:40', 'creating-a-more-kosher-miami-combining-geographical-search-database-filtering-for-a-new-site', 'publish', 'https://leverage.it/creating-a-more-kosher-miami-combining-geographical-search-database-filtering-for-a-new-site/', 'Finding Kosher food in Miami: Combining geographical search &#038; database filtering for Kosher Miami re-design', '<p>We&#8217;re proud and excited to launch a brand new website for <a href=\"http://koshermiami.org/\">Kosher Miami</a>, The Vaad HaKashrus of Miami-Dade, a non-profit organization dedicating to providing the region with certified Kosher establishments. We combine geographical search, database filtering, and a new design to create an improved customer experience.</p>\n<h3>Challenge:</h3>\n<p>Create a user-friendly, responsive site that can easily and quickly connect the Kosher community to establishments that meet their specific Kosher certifications.</p>\n<h3>Process:</h3>\n<p>Using database filters to search through a variety of certifications types and the latest google maps technology to find locations nearby.</p>\n<p>The new site also allows Kosher establishments to easily create their own online presence.</p>\n<h3>Technology used</h3>\n<ul>\n<li><span style=\"color: #333333;\">Custom built PHP, MySQL</span></li>\n<li><span style=\"color: #333333;\">WordPress</span></li>\n<li><span style=\"color: #333333;\">Google maps</span></li>\n<li><span style=\"color: #333333;\">Twitter API</span></li>\n</ul>\n<h3>Design Inspiration</h3>\n<ul>\n<li><span style=\"color: #333333;\">Clean, attractive design using a mix of culinary imagery</span></li>\n<li><span style=\"color: #333333;\">Seamless integration of map and search</span></li>\n<li><span style=\"color: #333333;\">A dark &amp; light integration to create contrast &amp; flow</span></li>\n</ul>\n<p><a href=\"https://i0.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/km_homepage_v2.jpg\"><img class=\"alignnone wp-image-2408 size-full\" src=\"https://i0.wp.com/www.leveragehosting.it/dev/wp-content/uploads/2016/02/km_homepage_v2.jpg?resize=1080%2C1907\" alt=\"km_homepage_v2\" width=\"1080\" height=\"1907\" data-recalc-dims=\"1\" /></a></p>\n', '<p>We&#8217;re proud and excited to launch a brand new website for Kosher Miami, The Vaad HaKashrus of Miami-Dade, a non-profit organization dedicating to providing the region with certified Kosher establishments. We combine geographical search, database filtering, and a new design to create an improved customer experience. Challenge: Create a user-friendly, responsive site that can easily and [&hellip;]</p>\n', 2956, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(36, 2315, '2016-01-04T16:09:54', 8, '2018-02-06T17:44:50', 'our-top-digital-marketing-trends-picks-for-2016', 'publish', 'https://leverage.it/our-top-digital-marketing-trends-picks-for-2016/', 'Our Top Digital Marketing Trend Picks for 2016', '<p>With 2015 behind the corner now, we figured we&#8217;d review some of the top trends digital marketing trends we saw throughout the past year, ones that we feel will be important in 2016 too. Without further ado, here they are:</p>\n<h4>Customized Calls-to-actions</h4>\n<p>As an increasing number of businesses are coming online, a larger variety of calls-to-actions is required to properly convert their customers. Some businesses have relatively straightforward goals online, for example if a business can sell online then a simple CTA to &#8216;buy&#8217; is required and the path to a conversion is pretty clear. Others have conversions that cannot be made online for one reason or another, they may not be able to sell online, or they&#8217;re not a B2C business, or their target audience is hard to reach online. Despite the inability to sell online, these businesses realize the other benefits of being online, e.g. increasing brand awareness, staying top-of-mind with their potential and prospective customers, keeping up (and surpassing) the competition, understanding current trends, providing information to customers, preparing customers for purchase and more. The customized CTA&#8217;s now provided by various social media ads platforms allow for more flexibility with ads, granting a wider variety of businesses the opportunity to create effective ads.</p>\n<p><strong>Twitter</strong> &#8211; can create campaigns around: increasing followers, tweet engagement, website clicks (or conversions), app installs or re-engagements, leads, video views, and custom campaigns.</p>\n<p><strong>Facebook</strong> &#8211; Boost your posts, promote your page, website clicks, website conversions, installs of app, app engagements, local ads (around a physical location), event ads, offer ads, and video views.</p>\n<p><strong>Instagram</strong> &#8211; Boost your posts, website clicks, website conversions, installs of app, app engagements, and video views.</p>\n<h4>Live streaming</h4>\n<p>Periscope has been named <a href=\"http://smallbiztrends.com/2015/12/periscope-named-app-year-small-business-headlines.html\">&#8216;App of the Year&#8217; by Apple</a>, Meerkat received more than 200,000 mentions on Twitter this March, and <a href=\"http://newsroom.fb.com/news/2015/12/introducing-live-video-and-collages/\">Facebook began rolling out live videos</a> to US users this month. It seems safe to say that live streaming is here to stay.</p>\n<h4>Sharing economy</h4>\n<p>The success of <a href=\"https://www.uber.com/\">Uber</a> and <a href=\"https://www.airbnb.com/\">Airbnb</a> has encouraged entrepreneurs around the globe to apply the shared-economy model to their own businesses. The sharing economy model is based on using technology to allow users to exchange goods and services amongst each other. It&#8217;s disrupting industries left and right, in <a href=\"http://www.cbc.ca/news/canada/toronto/3-things-to-know-about-toronto-city-council-s-uber-vote-1.3249187\">Toronto, city councillors are deciding</a> the operation of Uber in the city, while condo boards are struggling to figure out the <a href=\"http://www.theglobeandmail.com/life/home-and-garden/real-estate/toronto-condo-owners-warned-over-short-term-rentals/article23761219/\">legality of Airbnb</a>. Still, these growing pains, have not dissuaded excited entrepreneurs who are rising to the challenge of bringing the sharing economy to their industry. We had the pleasure of working with <a href=\"https://www.google.ca/url?sa=t&amp;rct=j&amp;q=&amp;esrc=s&amp;source=web&amp;cd=1&amp;cad=rja&amp;uact=8&amp;ved=0ahUKEwiI0_qJv5DKAhWHKh4KHYExCK0QFggcMAA&amp;url=https%3A%2F%2Fwww.linkedin.com%2Fin%2Fbenzlotnick&amp;usg=AFQjCNGRn5JRawM4Qov6SlGwFQhn96DW0A\">Ben Zlotnick</a> of <a href=\"http://adenearthworks.com\">Aden Earthworks</a> and <a href=\"http://incubes.ca/\">Incubes</a>, to develop <a href=\"http://edenapp.com/\">Eden</a>, an on-demand app for landscaping and snow removal.</p>\n<h4>Educational, funny, or shocking content</h4>\n<p>We no longer need to sell the importance of content, in the last few years most businesses realized that content vs. hard advertising/selling is the way to capture an audience&#8217;s attention. The content has to be engaging (and sometimes promoted) to get in front of users, or it should offer value, e.g. information, answers, solutions, or directions.  If your content is not providing one of these key service to your audience, it&#8217;s unlikely it&#8217;ll get much attention.</p>\n<h4>User-generated (&amp; up-voted) content</h4>\n<p>What&#8217;s so great about user-generated content? It&#8217;s authentic, human, and relatable. It may not always be high-quality, but it fosters a sense of community with its recipient, which is pretty special. We do not see this trend slowing down any time soon, take a look at the growth of Reddit communities in the last few years.</p>\n<p><img class=\"alignnone\" src=\"https://i0.wp.com/d28wbuch0jlv7v.cloudfront.net/images/infografik/normal/chartoftheday_3623_reddit_growth_n.jpg?resize=960%2C684&#038;ssl=1\" alt=\"\" width=\"960\" height=\"684\" data-recalc-dims=\"1\" /></p>\n<h4>Facebook&#8217;s changing role</h4>\n<p>When was the last time you saw someone upload an album to Facebook? Probably quite a while ago. Facebook is no longer the network it once was. Today it&#8217;s easier to learn what&#8217;s going on the other side of the world through Facebook rather than what&#8217;s happening with your friends and family. This media-fication of Facebook was, of course, Mark Zuckerberg&#8217;s goal all along in making Facebook everyone&#8217;s personal newspaper. But do young people <strong>want</strong> a personal newspaper? Do users <strong>want</strong> a newspaper that&#8217;s curated by Facebook&#8217;s algorithms?</p>\n<h4>A more sophisticated and lazy internet user</h4>\n<p>So hopefully by this point you&#8217;ve explain to your dad, grandma or gullible friend that there is no Nigerian prince that will send them copious amounts of money online, the concept of clickbait, the importance of privacy online, and the slim chance anyone is making $3000 cash a week online. As internet users spend more time online interacting with different types of content, they learn what kind of content is good and which to avoid. This familiarity with content types and new content formats has negative effects too, people rely increasingly on article titles and summaries, and less on reading complete articles. The issue with this is the internet user becomes lazier in a sense, and less likely to click through to a piece of content. This may seem disadvantageous at first, but it could work to your advantage if you place the most important messaging in your title and summary.</p>\n<p>We look forward to keeping a close eye on new and evolving trends in 2016, integrating and applying them to your business goals.</p>\n', '<p>With 2015 behind the corner now, we figured we&#8217;d review some of the top trends digital marketing trends we saw throughout the past year, ones that we feel will be important in 2016 too. Without further ado, here they are: Customized Calls-to-actions As an increasing number of businesses are coming online, a larger variety of calls-to-actions is required [&hellip;]</p>\n', 2958, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(37, 2032, '2014-10-14T15:43:06', 8, '2018-02-06T17:45:02', '10-things-to-remember-when-creating-a-landing-page', 'publish', 'https://leverage.it/10-things-to-remember-when-creating-a-landing-page/', '8 things to remember when creating a landing page', '<p>If you&#8217;ve invested in developing an online brand then landing pages should be of paramount importance to your business. They&#8217;re the link that collects information about visitors and traffic and turns them into prospects and leads. Though the goal behind landing pages may differ depending on your business, e.g. ecommerce vs. in-store purchase, the elements for an engaging landing page that drives people to take a valuable business action remain pretty consistent. Feel free to use the 10 key points we list below as a check-list to ensure your landing pages are well-built.</p>\n<p><!--more--></p>\n<ol>\n<li>\n<h4>Have an objective in mind</h4>\n<p>Your landing page should be built around a key objective, e.g. do you want this visitor to sign up for your newsletter? Would you like them to request a quote for your services? This is the key point to keep in mind while adding any elements to your page, remember to keep things simple and if you feel that a certain line of text takes away from the objective, then consider removing it instead of cluttering up important space.</li>\n<li>\n<h4>Grab their attention</h4>\n<p>Your landing page should be clear and relatively concise, but it should also be attractive, utilizing elements of design to allow a visitor to follow a logical path with the end-goal of driving a call-to-action. Here are <a href=\"http://blog.hubspot.com/marketing/landing-page-examples-list\">8 great landing page designs curated by Hubspot</a>.</p>\n<p><a href=\"https://i1.wp.com/leverage.it/wp-content/uploads/2014/10/customer-journey1.png\"><img class=\"wp-image-2310 size-large aligncenter\" src=\"https://i2.wp.com/leverage.it/wp-content/uploads/2014/10/customer-journey1-1024x577.png?resize=1024%2C577\" alt=\"customer journey1\" width=\"1024\" height=\"577\" data-recalc-dims=\"1\" /></a></li>\n<li>\n<h4>Stay true to your brand</h4>\n<p>Ensure that the design of the landing page matches the rest of your site, don&#8217;t turn your landing page into a microsite that confuses the visitor. Keep in mind the customer journey your visitor may take, e.g. seeing a social media post, visiting your site, moving through various pages and arriving at your landing page &#8211; and ensure that the experience is seamless and consistent.</li>\n<li>\n<h4>Think through the customer journey</h4>\n<p>As mentioned above, you want to really think through your customer journey. How will people arrive at this landing page? Will they come here from an online ad and therefore have certain expectations about what they find? Are you ensuring that you meet those expectations? Will they arrive at this page after browsing through your site? These are all important points to consider when building your landing page, you may require various landing pages based on different customer journeys. If you&#8217;re working on your &#8216;request a quote&#8217; landing page and its linked to from your product pages, then you won&#8217;t need to make that landing page discuss product info in detail or you may be repeating a lot of the info they just read on your product pages.</li>\n<li>\n<h4>Build trust and confidence</h4>\n<p>Including testimonials, customer quotes, positive reviews, etc. is a great way to minimize a visitor&#8217;s hesitation about going through with the CTA on your landing page.</li>\n<li>\n<h4>Have a clear call-to-action</h4>\n<p>Keeping your objective in mind, create a clear flow in your landing page, basing it around a single customer action that you want a visitor to complete before they leave your page. Not sure how to phrase yours? Here are <a href=\"http://cdn2.hubspot.net/hub/53/file-13222290-pdf/docs/ebooks/original%20files/hbebook20120307.pdf\">101 examples of call-to-actions.</a></li>\n<li>\n<h4>Give incentive for visitors to preform the CTA</h4>\n<p>Your product or services are great on their own and you will effectively communicate this by listing their benefits, but it never hurts to throw in a little something extra to increase conversions. Are you looking to increase email sign-ups? Offer a discount off on your products, or a freebee when they preform the desired action. Many companies will offer a free trial, e-book, webinar, contest entry, etc. in exchange for a prospect&#8217;s information.</li>\n<li>\n<h4>Measure and optimize</h4>\n<p>Make sure that you&#8217;re effectively tracking your conversions once your landing page is live. The more you know about where your visitors are coming from, who they are, and how they&#8217;re interacting with page the more you can do to ensure they preform the CTA.</li>\n</ol>\n<p>Helpful links:</p>\n<ul>\n<li><a href=\"http://www.thinkwithgoogle.com/tools/customer-journey-to-online-purchase.html\">Google&#8217;s customer journey to online purchase</a></li>\n<li><a href=\"https://www.formstack.com/the-anatomy-of-a-perfect-landing-page\">Formstack&#8217;s &#8216;anatomy of a landing page&#8217; infographic</a></li>\n<li><a href=\"http://blog.bufferapp.com/the-ultimate-guide-to-creating-effective-landing-pages\">Buffer&#8217;s ultimate guide to creating effective landing pages </a></li>\n<li><a href=\"http://boagworld.com/design/10-techniques-for-an-effective-call-to-action/\">10 techniques for an effective CTA</a></li>\n<li><a href=\"http://thelandingpagecourse.com/landing-page-101-intro/\">Unbounce&#8217;s landing page course</a></li>\n</ul>\n<p>Need help creating a web presence that drives business results? <a href=\"http://leverage.it/contact-2/\">Let us help</a>.</p>\n', '<p>If you&#8217;ve invested in developing an online brand then landing pages should be of paramount importance to your business. They&#8217;re the link that collects information about visitors and traffic and turns them into prospects and leads. Though the goal behind landing pages may differ depending on your business, e.g. ecommerce vs. in-store purchase, the elements for [&hellip;]</p>\n', 2960, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37');
INSERT INTO `blogs` (`id`, `wp_blog_id`, `blog_created_at`, `author_id`, `modified_at`, `slug`, `status`, `link`, `title`, `content`, `excerpt`, `featured_media`, `created_at`, `updated_at`, `deleted_at`) VALUES
(38, 2005, '2014-09-17T14:17:08', 8, '2018-02-06T17:45:20', 'were-all-content-creators-now-content-lessons-from-news-editors', 'publish', 'https://leverage.it/were-all-content-creators-now-content-lessons-from-news-editors/', 'We&#8217;re all content creators now: content lessons from news editors', '<p>The news media don&#8217;t have it figured all out, of course. We can easily see that when we look at the <a href=\"http://stateofthemedia.org/2013/newspapers-stabilizing-but-still-threatened/newspapers-by-the-numbers/\">declining newspaper revenue and readership year over year</a>. But news media are in the content business and as concepts like content marketing and brand journalism become more accepted, marketers are thrust into the content space too. So why not learn some lessons from the content pros: journalists and editors?</p>\n<p><!--more--></p>\n<p>The news media don&#8217;t have it figured all out, of course. We can easily see that when we look at the <a href=\"http://stateofthemedia.org/2013/newspapers-stabilizing-but-still-threatened/newspapers-by-the-numbers/\">declining newspaper revenue and readership year over year</a>. But news media are in the content business and as concepts like content marketing and brand journalism become more accepted, marketers are thrust into the content space too. So why not learn some lessons from the content pros: journalists and editors?</p>\n<p>&nbsp;</p>\n<h4><a href=\"https://i0.wp.com/leverage.it/wp-content/uploads/2014/09/Leverage_journalism_02.jpg\"><img class=\"aligncenter size-large wp-image-2355\" src=\"https://i0.wp.com/leverage.it/wp-content/uploads/2014/09/Leverage_journalism_02-1024x341.jpg?resize=1024%2C341\" alt=\"Leverage_journalism_02\" width=\"1024\" height=\"341\" data-recalc-dims=\"1\" /></a></h4>\n<h4>Pressure to drive traffic, ad revenue</h4>\n<p>News media have been under tremendous pressure to figure out how to profit from content online, and since their revenue is mostly ad-based, success translates to traffic. Marketers will agree that once you invest time in creating content, you&#8217;d like to get some traffic to it. Looking at how news media have tackled this problem and who has succeeded and how are valuable lessons for any content creators, marketers or journalists. Besides, isn&#8217;t it better to learn from the mistakes of others than your own?</p>\n<h4>Content lessons from journalists</h4>\n<p>So, without further ado, I&#8217;d like to share a presentation from the recent <a href=\"http://www.apme.com/news/186614/2014-ASNE-APME-Draft-Conference-Schedule-UPDATED.htm\">ASNE-APME 2014 conference</a>, where news papers editors met to discuss the <a href=\"http://www.poynter.org/latest-news/mediawire/269741/advice-for-newspaper-editors-pay-attention-to-buzzfeed/\">current state and future of their business</a>. If you want to read more about the various presentations, just look at the <a href=\"https://twitter.com/hashtag/editors14?src=hash\">#editors14 hashtag on twitter</a> (journalists adore twitter). The presentation I&#8217;d like to share focuses on growing audiences and offers valuable content lessons for all. Below are my favourite points from <a href=\"http://www.webbmediagroup.com/\">Webmedia Group</a>&#8216;s deck, but you can find it in its entirety below or <a href=\"http://www.slideshare.net/webbmedia/growing-audience-for-newspapers-asne-apme-conference-2014\">here</a>.</p>\n<h4>Creating content for a consumer, not their device</h4>\n<p>Focus on consumer vs. just their device. This is key, depending on your product or service, people are likely accessing your content on various devices, yes, but the keyword here is still people. It&#8217;s important not to focus too much on device, content must be easily accessible via various devices but don&#8217;t overlook the actual content and user &#8211; remember that at the end of the day, you&#8217;re developing content for people, not their devices.</p>\n<h4>4 audience parameters to keep in mind</h4>\n<p>A deep consideration of your audience. The presentation looks into several current realities of the consumer: time (content was developed for someone for a particular moment in time), activities (developed around what they&#8217;re doing in that moment), IQ/EQ (developed to meet their emotional and intellectual IQ), and behaviours (developed based on their behaviours). &#8211; As marketers we should be thinking about these parameters when developing content, try and apply these to your buyer persona and create content around them.</p>\n<h4>Plagiarizing from a plagiarizer?</h4>\n<p>&nbsp;</p>\n<p style=\"text-align: left;\"><a href=\"https://i0.wp.com/leverage.it/wp-content/uploads/2014/09/Leverage_buzzfeed.jpg\"><img class=\"aligncenter size-large wp-image-2357\" src=\"https://i2.wp.com/leverage.it/wp-content/uploads/2014/09/Leverage_buzzfeed-1024x295.jpg?resize=1024%2C295\" alt=\"Leverage_buzzfeed\" width=\"1024\" height=\"295\" data-recalc-dims=\"1\" /></a></p>\n<p style=\"text-align: left;\">Looking to <a href=\"http://www.buzzfeed.com/\">Buzzfeed</a> for inspiration. Now, I am not a big buzzfeed fan, in my opinion they just <a href=\"http://www.thewire.com/business/2013/03/buzzfeeds-happiest-facts-all-time-were-mostly-plagiarized-reddit/62918/\">recycle stale content from Reddit </a>and lack any originality, that being said, the content on Reddit is often great but not easily accessible to many. So, what Buzzfeed did was ingenious is a way; they took Reddit&#8217;s (<a href=\"http://nymag.com/daily/intelligencer/2014/09/benny-johnson-hired-by-national-review.html\">and others&#8217;</a>) content and made it accessible (turning it into lists, galleries) instead of Reddit&#8217;s forum format. The result? Viral content. Of course the content is often not Buzzfeed&#8217;s, but then again, it&#8217;s not really Reddit&#8217;s either, it&#8217;s their community&#8217;s; they&#8217;re the ones who upvote, troll, and comment. I had a chance to ask Reddit co-founder <a href=\"http://en.wikipedia.org/wiki/Alexis_Ohanian\">Alex Ohanian</a> what he thought about the blatant stealing of content ideas, and <a href=\"http://live.fastcompany.com/Event/Chat_with_reddit_co-founder_Alexis_Ohanian/92395947\">he didn&#8217;t seem to mind much</a>.</p>\n<p style=\"text-align: center;\"><iframe style=\"border: 1px solid #CCC; border-width: 1px; margin-bottom: 5px; max-width: 100%;\" src=\"//www.slideshare.net/slideshow/embed_code/38981379\" width=\"597\" height=\"486\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\" allowfullscreen=\"allowfullscreen\"> </iframe></p>\n<p><strong><a title=\"Growing Audience For Newspapers - ASNE/ APME Conference 2014\" href=\"https://www.slideshare.net/webbmedia/growing-audience-for-newspapers-asne-apme-conference-2014\" target=\"_blank\">Growing Audience For Newspapers &#8211; ASNE/ APME Conference 2014</a> </strong> from <strong><a href=\"http://www.slideshare.net/webbmedia\" target=\"_blank\">Webbmedia Group</a></strong></p>\n<p>Hopefully you&#8217;ve found some valuable lessons and commonalities between the problems journalists and editors face, and those we marketers face. It&#8217;s an interesting time in that industry, if you like to follow it further I recommend keeping an eye on <a href=\"http://www.poynter.org/\">Poynter</a> and <a href=\"http://www.cjr.org/\">CJR</a>.</p>\n', '<p>The news media don&#8217;t have it figured all out, of course. We can easily see that when we look at the declining newspaper revenue and readership year over year. But news media are in the content business and as concepts like content marketing and brand journalism become more accepted, marketers are thrust into the content space [&hellip;]</p>\n', 3010, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(39, 1970, '2014-09-15T16:07:45', 8, '2018-02-06T17:45:35', 'helpful-email-marketing-statistics-for-small-businesses-infographic', 'publish', 'https://leverage.it/helpful-email-marketing-statistics-for-small-businesses-infographic/', 'Helpful email marketing statistics for small businesses [INFOGRAPHIC]', '<p>Marketing efforts often focus heavily on lead generation, which is obviously an important step in the sales process, but lead nurturing efforts should not be overlooked &#8211; or leads will stay just that instead of progressing into customers. Hubspot has recently put together an infographic with tips on email marketing for small businesses that I&#8217;d like to share. But first, I&#8217;d like to explain why I like email marketing so much. <!--more--> Marketing efforts often focus heavily on lead generation, which is obviously an important step in the sales process, but lead nurturing efforts should not be overlooked &#8211; or leads will stay just that instead of progressing into customers. Hubspot has recently put together an infographic with tips on email marketing for small businesses that I&#8217;d like to share. But first, I&#8217;d like to explain why I like email marketing so much.</p>\n<h2>Control</h2>\n<p>Unlike with other channels, you can completely control how your marketing looks via email, e.g. you&#8217;re not limited to adding a single link, or a text limit (ahem, 140 characters), or photos of certain dimensions. Just make sure to pay close attention to how it renders on various devices and browsers by sending out a few tests.</p>\n<h2>Reach</h2>\n<p>I am a huge fan of social media marketing, but the reach you have with those networks can be deceiving, e.g. <a href=\"https://www.facebook.com/marketing/posts/10150839503836337\">the organic reach you have by sharing something with your own fans on Facebook is only 16%</a>, in order to reach the rest you&#8217;ll have to promote those posts at extra cost. With email, you will have the potential to reach everyone who receives your email at no extra cost.</p>\n<h2>Tracking</h2>\n<p>There are <a href=\"http://mailchimp.com/\">entire companies whose sole purpose is to ensure your email marketing is effective</a>, so they&#8217;ve created pretty elaborate tracking tools. In addition, there are <a href=\"http://mailchimp.com/resources/research/email-marketing-benchmarks/\">many stats out there on various industries</a>, which you can use as benchmarks in your campaigns&#8217; performances. <img class=\"wp-image-1971 size-large aligncenter\" src=\"https://i1.wp.com/leverage.it/wp-content/uploads/2016/01/7-insightful-email-marketing-stats-for-small-businesses.jpg?w=100%25\" alt=\"7 insightful email marketing stats for small businesses\" data-recalc-dims=\"1\" />   Are you currently doing email marketing? Can we help improve your performance? We&#8217;ve increased one of our clients email click-through rate ten-fold. <a href=\"http://leverage.it/contact-page/\">Contact us </a>if you&#8217;re interested in learning about our email marketing services.</p>\n', '<p>Marketing efforts often focus heavily on lead generation, which is obviously an important step in the sales process, but lead nurturing efforts should not be overlooked &#8211; or leads will stay just that instead of progressing into customers. Hubspot has recently put together an infographic with tips on email marketing for small businesses that I&#8217;d [&hellip;]</p>\n', 3012, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(40, 1949, '2014-09-12T09:22:15', 11, '2018-02-06T17:59:28', 'should-php-developers-learn-the-newest-frameworks-or-stick-to-the-classics', 'publish', 'https://leverage.it/should-php-developers-learn-the-newest-frameworks-or-stick-to-the-classics/', 'Should PHP Developers Learn the Newest Frameworks or Stick to the Classics?', '<div>PHP, much like most programming languages is very slow to evolve. If you coded PHP five or even ten years ago and know the basics of object oriented programming then you will still be able to read and write PHP code today. Even when a new branch is released, the adoption rate is very slow and developers are reluctant to use new features since their code won&#8217;t be portable if moved to an older shared server using an older version of PHP.</div>\n<div></div>\n<p><!--more--></p>\n<div></div>\n<div>However, unlike .NET and Ruby on Rails, PHP is just a language and not a complete framework. Although PHP alone will suffice for small sites that require minimal PHP code and are mostly HTML, when you start building medium to large scale projects you really need to use a framework. A Model View Controller (MVC) Framework will keep your code organized and divided and will allow you to re-use code in the framework for common tasks shared between most typical web projects (login, roles and permissions, forms, grids etc&#8230;). The question every new PHP developer asks is &#8220;what framework should I learn?&#8221;</div>\n<div></div>\n<h2>So what framework should you learn?</h2>\n<div>My First introduction to the MVC paradigm was through Zend, one of the oldest and heavily used PHP Frameworks. I didnt have a choice since I was taking over a project from an Indian team and learned a lot about the framework from learning their code which I had to work on. Zend, like older frameworks is somewhat bloated and slow. It tries to get involved in every aspect of your website (zend buttons, zend forms etc&#8230;). With older mature frameworks like Zend and Symfony2, even a simple Hello World page has a lag due to the overhead of the framework. The upside is that these two beasts have been around for a while, have a stable and robust code base and a huge community.</div>\n<div></div>\n<div>\n<div style=\"width: 592px\" class=\"wp-caption alignnone\"><img src=\"https://ci5.googleusercontent.com/proxy/ilf6FNAqq8tAohCzE8orO0fGRHS_83Pdo6Ug21xE-c88oXnRymCAG469cRtu__Hv_6ecgo5Ca4ttb8PltRCFD8negj9JHo3Z53beR9X0H1UnZ9jwz8ejdoy0gfnht5vYaLY=s0-d-e1-ft#http://www.highnd.com/wp-content/uploads/2012/09/php-frameworks-websites.png\" alt=\"\" width=\"582\" height=\"220\" /><p class=\"wp-caption-text\">Zend drop off</p></div>\n</div>\n<div></div>\n<div>I was tasked with starting a new large scale project about two years ago and did some serious research into PHP frameworks at the time. I chose to go with Yii, it was very popular, brand new, <a href=\"http://www.yiiframework.com/performance/\">fast</a> and cool. It came with code that would pre-build your models from a database schema including foreign relations which work with Yii&#8217;s active records. Im still working on this project today and have been happy with the framework, however, as time passed, so did the fad. Newer cooler and faster frameworks came out and the Yii community went down to 7.6% of PHP projects (see graph below for popularity of various PHP networks).</div>\n<div></div>\n<div><a href=\"https://i1.wp.com/leverage.it/wp-content/uploads/2014/09/framework-popularity-PHP-leaverageIT.png\"><img class=\"alignnone wp-image-1951 size-square-image\" src=\"https://i1.wp.com/leverage.it/wp-content/uploads/2014/09/framework-popularity-PHP-leaverageIT-600x600.png?resize=600%2C600\" alt=\"framework popularity PHP - leaverageIT\" width=\"600\" height=\"600\" data-recalc-dims=\"1\" /></a></div>\n<div></div>\n<div>When starting my next large project should I jump on the bandwagon and start learning Laravel or Phalcon or continue with Yii or Zend? Once Yii2 or another new framework comes out, support for Laravel and Phalcon will go down as new developers look for the latest and coolest. Furthermore, new frameworks may not have stable code nor a lot of help forums to research issues. There is a steep learning curve in tackling a new framework and it&#8217;s not worth it for just one project if you know another framework better.</div>\n<div></div>\n<div></div>\n<div>In conclusion, most of the MVC frameworks available today are more or less the same. They provide a secure skeleton that forces you to keep your code organized and can speed up development if you know the syntax well. Once you have learned a framework well, stick with it! Join communities, help out beginners and even consider contributing to its code base or reporting bugs. Like a programming language, the issue is less about which one you choose and more about how you use it. Don&#8217;t take shortcuts or hack the framework, use it as it was meant to be used</div>\n<div></div>\n<div></div>\n<div>Do you need help with your development needs? <a href=\"http://leverage.it/contact-2/\">Contact us today</a>.</div>\n', '<p>PHP, much like most programming languages is very slow to evolve. If you coded PHP five or even ten years ago and know the basics of object oriented programming then you will still be able to read and write PHP code today. Even when a new branch is released, the adoption rate is very slow [&hellip;]</p>\n', 3014, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(41, 1942, '2014-09-11T08:54:42', 11, '2018-02-06T18:00:39', 'understanding-google-exploring-the-search-engines-two-major-functions', 'publish', 'https://leverage.it/understanding-google-exploring-the-search-engines-two-major-functions/', 'Understanding Google: Exploring the Search Engine’s Two Major Functions', '<p>Over the years, <a href=\"google.com\">Google</a> has been an integral part of the way people use the Internet. I’m quite certain that at least one or two readers will have “Googled” a business using the <a href=\"https://www.google.com/chrome/browser/\">Google Chrome web browser</a>, and looked up their location on Google Maps. We’re so accustomed to using these services on a daily basis, that we rarely stop to think about the great “kindness” the Google gives us every day.</p>\n<p><!--more--></p>\n<p>The extremely broad question at hand is about the extent by which Google shapes the way we use the Internet, therefore potentially affecting the decisions that we make.</p>\n<p>However, this isn’t a philosophical essay on the terrible large multinational corporations that control our lives and store our most sensitive personal data.</p>\n<p>This is an article about how you, a business owner, can utilize this for your own gain.</p>\n<p>And of course, how <a href=\"http://leverage.it/\">LeverageIT</a> can help you get there.</p>\n<h2>Google: Organizing the World&#8217;s Information</h2>\n<p>Google has two major functions, the first of which is to make sure that you keep using its services for everything you need. The more synonymous it becomes with the Internet, the less of a chance there exists the possibility of you switching to one of their few competitors. For now, you have parody videos like this one to show the current state of searching online:</p>\n<p><iframe src=\"//www.youtube.com/embed/tYVCk10AzS0\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<h2>Google: $60 Billion in Revenue</h2>\n<p>The second function is to make some cash to pay their kids through college.</p>\n<p>That’s why, when I speak to clients about running Google AdWords for their business, I’m often disappointed at the current performance of their accounts. Tens to hundreds of thousands of dollars of annual spending are being wasted by managers who think that working with Google is as easy as using its search engine.</p>\n<p>This is where Google’s two major functions come back in. Google needs to maintain its set of standards each time someone uses their search engine. They don’t want people to search for “coffee beans” and get advertisements for “real estate.” If that were to happen, Google would lose the reputation that it has worked so hard to build up, and then you may even stop referring to Googling for information as “Googling,” and you may call it “searching.” It’s a scary thought, indeed.</p>\n<p>That’s why, you shouldn’t be shocked that you’re being over-charged for your sub-par ad, or if Google assesses it with such a low “quality score,” that it doesn’t even want to display it.</p>\n<p class=\"p1\"><span class=\"s1\">The second function of Google explains why they aren’t exactly helping you out. They constantly create new ways for AdWords account managers to have a more difficult time correctly utilizing their marketing dollars by making it difficult for them to figure out why their revenue hasn’t gone up this quarter. And then, once managers do begin to discover ways to improve your account, Google catches on, and then changes settings to either make it impossible to fit Google’s own standards at a low cost, or makes it so time-consuming for the average business owner, that they grow accustomed to wasting large percentages of their budgets.</span></p>\n<p class=\"p1\"><span class=\"s1\">Google essentially filters out the good from the bad, and then somehow profits even more from the bad. </span></p>\n<p class=\"p1\"><span class=\"s1\">At LeverageIT, we dedicate our time to making the most of your ad spending. This includes making both big and little changes that you don’t have the time to make, or didn’t even know about. </span></p>\n<p class=\"p1\"><span class=\"s1\">We perform research to understand your business, its industry, and Google’s plans to shape your potential customers. </span></p>\n<p class=\"p1\"><span class=\"s1\">You can do it yourself if you want to pay higher for each click, and pay for clicks that have nothing to do with your business.</span></p>\n<p class=\"p1\"><span class=\"s1\">Or you can <a href=\"http://leverage.it/contact-2/\">contact us</a>.</span></p>\n', '<p>Over the years, Google has been an integral part of the way people use the Internet. I’m quite certain that at least one or two readers will have “Googled” a business using the Google Chrome web browser, and looked up their location on Google Maps. We’re so accustomed to using these services on a daily [&hellip;]</p>\n', 3016, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(42, 1928, '2014-09-09T15:09:00', 11, '2018-02-06T19:08:40', 'twitter-makes-major-ecommerce-move-with-new-buy-button', 'publish', 'https://leverage.it/twitter-makes-major-ecommerce-move-with-new-buy-button/', 'Twitter makes major e-commerce move with new &#8216;buy&#8217; button', '<p><a href=\"twitter.com\">Twitter</a> has announced yesterday that they&#8217;re <a href=\"https://blog.twitter.com/2014/testing-a-way-for-you-to-make-purchases-on-twitter\">testing out a new &#8216;buy&#8217; button</a>. It will allow users to make purchases directly from their iOS or Android Twitter apps. When users click the &#8216;buy&#8217; button in a tweet, they will be prompted to fill in their payment and shipping information (which is then attached to their account), and make the purchase. The functionality is not available as of yet in Canada, it has only been rolled out to some users in the United States.</p>\n<p><!--more--></p>\n<p><iframe src=\"//www.youtube.com/embed/dEGk5LRumJM\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<p>Twitter&#8217;s head of commerce, <a href=\"https://twitter.com/NathanCHubbard\">Nathan Hubbard</a>,<a href=\"http://mashable.com/2014/09/08/twitter-commerce-test/?utm_cid=mash-com-fb-socmed-link\"> told Mashable</a> that this functionality was in the making ever since he was hired from Ticketmaster last year. The key differentiators between Twitter&#8217; &#8216;buy&#8217; button and other social networks&#8217; ventures into e-commerce have to do with Twitter&#8217;s underlying functionality. Hubbard differentiates Twitter from other social networks by saying that it&#8217;s real-time capabilities and presence of mass influencers will keep it ahead of the curve when it comes to e-commerce.</p>\n<p><a href=\"https://i0.wp.com/leverage.it/wp-content/uploads/2014/09/Twitter-buy-button-screenshot-everageit.jpg\"><img class=\"alignnone wp-image-1935 size-full\" src=\"https://i0.wp.com/leverage.it/wp-content/uploads/2014/09/Twitter-buy-button-screenshot-everageit-e1410275192524.jpg?resize=560%2C449\" alt=\"Twitter buy button screenshot everageit\" width=\"560\" height=\"449\" data-recalc-dims=\"1\" /></a></p>\n<p>Twitter&#8217;s penetration of the mobile market could make this new feature a very enticing offer for marketers. In fact, it&#8217;s projected that by 2017, <a href=\"http://www.emarketer.com/Article/Mobile-User-Bases-Facebook-Twitter-Keep-Growing/1010135\">87% of US Twitter users will access it through mobile devices</a>. The mobile arena is a very important one for Twitter, it <a href=\"http://www.popherald.com/content/2014/09/3111-twitter-facebook-ecommerce-business.html\">accounted for 81% of their revenue last year</a>. That being said, <a href=\"http://www.marketingcharts.com/online/smartphone-penetration-now-at-two-thirds-of-the-us-mobile-market-41248/\">Facebook is still the top mobile app</a> by reach with 77.6% penetration among iOS and Android smartphone users. And they announced they were <a href=\"http://mashable.com/2014/07/20/facebook-twitter-commerce/\">testing a &#8216;buy&#8217; button back in July</a>, so Twitter may have some catching up to do.</p>\n<p>We&#8217;ll be keeping a close eye on how brands are using Twitter&#8217;s new &#8216;buy&#8217; button in their marketing campaigns. You can do so too by following some of the initial accounts that Twitter is partnering with:</p>\n<ul>\n<li>Beartooth (<a href=\"https://twitter.com/intent/user?screen_name=beartoothband\">@beartoothband</a>)</li>\n<li>Brad Paisley (<a href=\"https://twitter.com/intent/user?screen_name=bradpaisley\">@bradpaisley</a>)</li>\n<li>Burberry (<a href=\"https://twitter.com/intent/user?screen_name=burberry\">@burberry</a>)</li>\n<li>Dan+Shay (<a href=\"https://twitter.com/intent/user?screen_name=DanAndShay\">@DanAndShay</a>)</li>\n<li>Death From Above 1979 (<a href=\"https://twitter.com/intent/user?screen_name=dfa1979\">@dfa1979</a>)</li>\n<li>Demi Lovato (<a href=\"https://twitter.com/intent/user?screen_name=ddlovato\">@ddlovato</a>)</li>\n<li>DonorsChoose (<a href=\"https://twitter.com/intent/user?screen_name=DonorsChoose\">@DonorsChoose</a>)</li>\n<li>Eminem (<a href=\"https://twitter.com/intent/user?screen_name=eminem\">@eminem</a>)</li>\n<li>GLAAD (<a href=\"https://twitter.com/intent/user?screen_name=glaad\">@glaad</a>)</li>\n<li>GLIDE (<a href=\"https://twitter.com/intent/user?screen_name=GlideSF\">@GlideSF</a>)</li>\n<li>Global Citizen (<a href=\"https://twitter.com/intent/user?screen_name=GlblCtzn\">@GlblCtzn</a>)</li>\n<li>The Home Depot (<a href=\"https://twitter.com/intent/user?screen_name=HomeDepot\">@HomeDepot</a>)</li>\n<li>Hunter Hayes (<a href=\"https://twitter.com/intent/user?screen_name=HunterHayes\">@HunterHayes</a>)</li>\n<li>Kiesza (<a href=\"https://twitter.com/intent/user?screen_name=kiesza\">@kiesza</a>)</li>\n<li>Keith Urban (<a href=\"https://twitter.com/intent/user?screen_name=keithurban\">@keithurban</a>)</li>\n<li>The Nature Conservancy (<a href=\"https://twitter.com/intent/user?screen_name=nature_org\">@nature_org</a>)</li>\n<li>Megadeth (<a href=\"https://twitter.com/intent/user?screen_name=Megadeth\">@Megadeth</a>)</li>\n<li>Mike Stud (<a href=\"https://twitter.com/intent/user?screen_name=mike_stud\">@mike_stud</a>)</li>\n<li>Panic! At The Disco (<a href=\"https://twitter.com/intent/user?screen_name=panicatthedisco\">@panicatthedisco</a>)</li>\n<li>Pharrell (<a href=\"https://twitter.com/intent/user?screen_name=pharrell\">@pharrell</a>)</li>\n<li>Paramore (<a href=\"https://twitter.com/intent/user?screen_name=paramore\">@paramore</a>)</li>\n<li>(RED) (<a href=\"https://twitter.com/intent/user?screen_name=RED\">@RED</a>)</li>\n<li>Ryan Adams (<a href=\"https://twitter.com/intent/user?screen_name=TheRyanAdams\">@TheRyanAdams</a>)</li>\n<li>Soundgarden (<a href=\"https://twitter.com/intent/user?screen_name=soundgarden\">@soundgarden</a>)</li>\n<li>The New Pornographers (<a href=\"https://twitter.com/intent/user?screen_name=TheNewPornos\">@TheNewPornos</a>)</li>\n<li>twenty one pilots (<a href=\"https://twitter.com/intent/user?screen_name=twentyonepilots\">@twentyonepilots</a>)</li>\n<li>Wiz Khalifa (<a href=\"https://twitter.com/intent/user?screen_name=wizkhalifa\">@wizkhalifa</a>)</li>\n<li>9/11 Day (<a href=\"https://twitter.com/intent/user?screen_name=911Day\">@911Day</a>)</li>\n</ul>\n', '<p>Twitter has announced yesterday that they&#8217;re testing out a new &#8216;buy&#8217; button. It will allow users to make purchases directly from their iOS or Android Twitter apps. When users click the &#8216;buy&#8217; button in a tweet, they will be prompted to fill in their payment and shipping information (which is then attached to their account), and [&hellip;]</p>\n', 3018, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(43, 1908, '2014-08-18T18:08:40', 8, '2018-02-06T19:08:50', 'why-the-ice-bucket-challenge-went-viral', 'publish', 'https://leverage.it/why-the-ice-bucket-challenge-went-viral/', 'Why the Ice Bucket Challenge went viral', '<p>You must have spotted at least one still-frame of a celebrity getting drenched by a bucket of water in your Facebook newsfeed this weekend. Maybe you&#8217;ve even been challenged to participate in what has become the latest viral marketing campaign, <a href=\"http://www.alsa.org/fight-als/ice-bucket-challenge.html\">the Ice Bucket Challenge</a>. The viral campaign has already got over <a href=\"http://blogs-images.forbes.com/niallmccarthy/files/2014/08/20140818_Ice_Bucketing_Fo.jpg\">2.2 million mention on twitter and 1.2 million videos on Facebook</a>.</p>\n<p><!--more--></p>\n<h2>What is it?</h2>\n<p>A social media marketing campaign to raise awareness for <a href=\"http://en.wikipedia.org/wiki/Amyotrophic_lateral_sclerosis\">ALS</a>, also known as Lou Gehrig&#8217;s disease. It&#8217;s a neurodegenerative disease characterized by a rapidly progressive weakness, as well as difficulty in speaking, swallowing, and breathing.</p>\n<p>The campaign was put together to raise money and awareness for ALSA &#8211; the ALS association. And saying the campaign is a success would be a grave understatement, the campaign has raised an unprecedented amount of money for the disorder &#8211; <a href=\"http://www.alsa.org/news/media/press-releases/ice-bucket-challenge-0818.html\">surpassing $15 million today</a>. The awareness raised by it is hard to calculate, but it&#8217;s safe to say that it&#8217;s likely surpassed a hundred million if we add up all the fans and followers of participating celebrities.</p>\n<h2><iframe src=\"//instagram.com/p/rznUCAgvgP/embed/\" width=\"612\" height=\"710\" frameborder=\"0\" scrolling=\"no\"></iframe></h2>\n<h2>How did it start?</h2>\n<p>According to <a href=\"http://www.alsa.org/news/archive/ice-bucket-challenge.html\">ALSA&#8217;s news release on August 6th</a>, it was former Boston College baseball captain Pete Frates and his family who helped the movement go viral. Frates has worked tirelessly since his diagnosis to raise awareness about the disease.</p>\n<h2>Why did it go viral?</h2>\n<p>The campaign has all the elements necessary for social virality, it contained a simple message, a clear call-to-action, and was easily spreadable.</p>\n<h4>Simple</h4>\n<p>The #IceBucketChallenge is incredibly simple. All the ingredients needed for participation and readily available for most people: smartphone, a bucket, water, and social profiles.  Over <a href=\"http://www.gsmarena.com/asymco_pricing_doesnt_affect_smartphone_adoption_in_the_us-news-8982.php\">70% of Americans</a> who own a phone have a smartphone, which makes recording and sharing videos via social a breeze. North of the border, here in Canada, <a href=\"http://catalyst.ca/infographic-2014-canadian-smartphone-market/\">over 56% own smartphones</a> &#8211; which means the #IceBucketChallenge has millions of potential participants.</p>\n<h4>Clear</h4>\n<p>One difficulty that many non-profits have is how to articulate the proper call-to-action in an awareness campaign. Most of them end up focusing on raising money for a cause by asking for donations. The #IceBucketChallenge did this too, one half of their message asks for donations, the other asks for participation and raising awareness. It&#8217;s this later part that has been at the root of the campaign&#8217;s virality and one reason is the clear call-to-action for participants. <strong>You know what you&#8217;re supposed to do because the person who nominated you is showing you</strong>, just take a bucket of ice water and pour it over your head.</p>\n<h4>Spreadable</h4>\n<p>The nomination part was key to spreading the message exponentially. Every person nominates multiple people to take the ice bucket challenge, e.g. Mark Zuckerberg and Bill Gates nominated three people, Justin nominated a <a href=\"http://instagram.com/justinbieber\">potential 19 million</a>.</p>\n<p>See a playlist of the popular IceBucketChallenge videos done so far:</p>\n<p><iframe src=\"//www.youtube.com/embed/XS6ysDFTbLU\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n', '<p>You must have spotted at least one still-frame of a celebrity getting drenched by a bucket of water in your Facebook newsfeed this weekend. Maybe you&#8217;ve even been challenged to participate in what has become the latest viral marketing campaign, the Ice Bucket Challenge. The viral campaign has already got over 2.2 million mention on twitter [&hellip;]</p>\n', 3020, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(44, 1900, '2014-08-13T15:50:15', 8, '2018-02-06T19:09:09', 'how-to-create-the-perfect-facebook-post-infographic', 'publish', 'https://leverage.it/how-to-create-the-perfect-facebook-post-infographic/', 'How to create the perfect Facebook post [infographic]', '<p>Facebook founder and CEO Mark Zuckerberg wasn&#8217;t kidding when he said he wanted to turn the social network into a &#8220;<a href=\"http://mashable.com/2014/01/19/facebook-news-feed-curation/\">personalized newspaper</a>&#8221; for users. Brands, celebrities, politicians, and media now have a lot more content in users Facebook news feeds. This means that your company will have to work a lot harder to get the attention of Facebook&#8217;s <a href=\"http://newsroom.fb.com/company-info/\">1.32 billion active monthly users</a>.</p>\n<p><!--more--></p>\n<p>How can you make sure that your next Facebook update drives the most engagement? The folks over at <a href=\"http://trackmaven.com/\">TrackMaven</a>, a data tracking software, <a href=\"http://trackmaven.com/blog/2014/08/nuts-bolts-perfect-facebook-post/\">analyzed over 1.5 million Facebook posts</a> to learn which elements get people to like, share, and click on your content. Here are a couple of interesting findings to keep in mind next time you create a Facebook post:</p>\n<ul>\n<li>Longer is better. Facebook is not Twitter, you don&#8217;t have a character limit to base your content around. According to research, posts with 80+ words get X2 engagement.</li>\n<li>Photos are your friends. Posts that contained photos increased engagement by 37%. Remember you can add a photo your post in various ways, e.g. sharing your own photo, adding a photo to a linked article, or sharing another page&#8217;s photo.</li>\n<li>Don&#8217;t forget the weekend. Sunday posts receive 35% more engagement, so make the most of Facebook post scheduler.</li>\n</ul>\n<p>See more findings from TrackMaven&#8217;s research below.</p>\n<p><img class=\"alignnone\" src=\"https://i0.wp.com/trackmaven.com/wp-content/uploads/2014/08/The-Nuts-and-Bolts-of-a-Perfect-Facebook-Post.jpg?resize=1080%2C3098\" alt=\"\" width=\"1080\" height=\"3098\" data-recalc-dims=\"1\" /></p>\n', '<p>Facebook founder and CEO Mark Zuckerberg wasn&#8217;t kidding when he said he wanted to turn the social network into a &#8220;personalized newspaper&#8221; for users. Brands, celebrities, politicians, and media now have a lot more content in users Facebook news feeds. This means that your company will have to work a lot harder to get the [&hellip;]</p>\n', 3022, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(45, 1889, '2014-07-25T21:12:07', 11, '2018-02-06T19:09:19', 'the-never-ending-google-search-algorithm-update', 'publish', 'https://leverage.it/the-never-ending-google-search-algorithm-update/', 'The Never Ending Google Search Algorithm Update', '<p>Google has never been shy when it comes to their search engine algorithm updates. They might be a little quiet on what “exactly” is being covered (i.e. spam sites, authority sites, the PageRank formula), but they aren’t shy about telling us that they have a newer and improved algorithm.</p>\n<p>For many webmasters, these algorithms are nothing more than hiccups. Most of the time, they affect “good” websites for a few days, and then everything gets sorted out. The algorithms are mainly focused at “bad” websites (i.e. Blackhat, Spammy) websites. These sites exploit weaknesses in the algorithm to jump ahead of their competition.<!--more--></p>\n<p>Since Google makes the bulk of their revenue from advertisers, they want the best results at the top. Spammy sites are not the “best” result and that’s why Google tries to keep them out of the results as much as possible.</p>\n<p>Blackhatters make great money staying in the Top 3 for their specific keywords. That’s why they work hard to find any weakness and then exploit it for as long as possible.</p>\n<p>This is why we have the “Never Ending Algorithm Update” …</p>\n<h3>Recent Changes By Google</h3>\n<p>Google has recently made four changes which affects search engine results. They are:</p>\n<ul>\n<li>Payday Loan 2.0, Released May 16, 2014</li>\n<li>Panda 4.0, Released May 19, 2014</li>\n<li>Payday Loan 3.0, Released June 12, 2014</li>\n<li>Authorship Photo Drop, June 28, 2014</li>\n</ul>\n<p>The Payday Loan releases affect sites that are explicitly spammy; sites with search queries focused on Viagra, Payday Loans and Casinos. Some blog networks use these sites to gain temporary traffic and/or PageRank. With the new changes, these sites and sites associated with them are being hit negatively, driving them down the SERP’s.</p>\n<p>The Panda 4.0 release is supposed to be a gentler version of Panda 3.0. Panda 3.0 put the hurt on websites using “duplicated” content and links from spammy sites. It took more authority links to offset and negative links and your rankings could drop in a blink of an eye. Panda 4.0 is still penalizing duplicate content, spammy links and abuse in general; however, they are trying to change the way it affects the rankings (i.e. how fast it drops, or moves up).</p>\n<p>The Authorship release doesn’t do much, except it no longer has a picture next your search engine link. Some users have reported a 20%+ increase in traffic since this change.<br />\nFor many, these changes won’t matter. For those who are constantly trying to exploit the system, there’s going to be some shaking going on. Of course, that won’t matter too much as they’ll just figure out another way around the system and then it’s back to another update from Google. The cycle continues …</p>\n<address>Written by our CEO &#8211; Meir Bulua</address>\n', '<p>Google has never been shy when it comes to their search engine algorithm updates. They might be a little quiet on what “exactly” is being covered (i.e. spam sites, authority sites, the PageRank formula), but they aren’t shy about telling us that they have a newer and improved algorithm. For many webmasters, these algorithms are [&hellip;]</p>\n', 3024, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(46, 1620, '2012-06-08T02:16:53', 11, '2018-02-06T19:09:34', 'your-website-facelift-know-why-your-website-is-ugly-first', 'publish', 'https://leverage.it/your-website-facelift-know-why-your-website-is-ugly-first/', 'Your Website Facelift:  Analytics, SEO and Functionality First', '<div>New technology has forced us to reconsider our faces in more ways than one.</div>\n<div></div>\n<div></div>\n<div>Consider the recent news, according to the American Society of Plastic Surgeons, that the body part inspiring more people to go under the knife is the chin.  &#8220;Chinplants&#8221; are becoming the fastest growing cosmetic surgery trend.</div>\n<div></div>\n<div></div>\n<div>The growth in online video conferencing has been identified as the motivation. Now we are forced to look at our own faces beyond the limitations of a bathroom mirror. We analyze, analyze and then analyze some more.</div>\n<div><!--more--></div>\n<h2>Jolie Chin</h2>\n<div>Similar facelifts are probably required on your website, especially if you have not taken enough time to analyze the data at hand, but instead focused on the most superficial elements.  Plastic surgeons will tell you that the key to a successfull surgery is spending considerable amounts of time analyzing the face to determine what chin would look good on what face.  An Angelina Jolie chin would not look good on New Jersey Governer Chris Christie irregardless of how bad he needs a chinplant.  Similarly, an e-commerce jewelry site would not necessarily have the same layout, call to action, and SEO requirements as a real estate company site.</div>\n<div></div>\n<div>When it comes to performing a facelift on your site, analyzing the available data at hand is ever so crucial to developing an effective website.  Ever since creative design firms began offering websites as part of their portfolio, it quite often happens that design trumps functionality. When a site looks too gorgeous, users have a hard time navigating. The &#8220;call to action&#8221; therefore remains elusive.</div>\n<h2>Analyzing Analytics</h2>\n<p><a class=\"frame-holder alignleft\" href=\"https://i2.wp.com/www.leviait.com/wp-content/uploads/2012/06/chinplants.jpg\" rel=\"shadowbox\"><img title=\"chinplants\" src=\"https://i2.wp.com/www.leviait.com/wp-content/uploads/2012/06/chinplants.jpg?resize=214%2C326\" alt=\"\" width=\"214\" height=\"326\" data-recalc-dims=\"1\" /></a><a class=\"frame-holder alignleft\" href=\"https://i0.wp.com/www.leviait.com/wp-content/uploads/2012/06/chinplants2.jpg\" rel=\"shadowbox\"><img title=\"chinplants2\" src=\"https://i0.wp.com/www.leviait.com/wp-content/uploads/2012/06/chinplants2.jpg?resize=214%2C326\" alt=\"\" width=\"214\" height=\"326\" data-recalc-dims=\"1\" /></a>Google analytics is free, it pretty much fills the need of most businesses, and can help you make informed decisions that can really affect your ROI.  There are some basic web protocals that even the most advanced of design firms don&#8217;t take into consideration when designing a website and should be fully understood as part of the analyzation phase.</p>\n<ol>\n<li>List your &#8220;call to action&#8221; in numbered order and implement all over the site &#8211; ( #1 &#8211; Sell T-shirts, #2 &#8211; Market our physical store, #3 &#8211; Like our facebook page)</li>\n<li>Reduce the buying process to 4 steps max.  Studies show that by integrating a payment system in your cart as opposed to outside providers such as Paypal and Bigcartel can almost double sales.</li>\n<li>Effectively communicate testimonials and media &#8211; If the product is a little abstract, users need verification that your product or service has been used effectively before and that you have even gained media attention</li>\n</ol>\n<p>Understanding your current web analytics cannot be underestimated.  Appliance Store is a family owned business since 1958 currently being passed on to the third generation in the family and with it a more effective online push.  They own multiple stores throughout Michigan and for years have invested heavily in print and radio advertising.  Jim Shwartz tells me, &#8220;For years we have focused on marketing our stores through radio and print, but considering the 10% decline in store sales, it is time to refocus on our online properties.&#8221;</p>\n<p>Their existing site was seeing significant traffic which made analyzing the data that much easier.   Data revealed that 95% of their web traffic flowed to their product pages while other pages showed a total of 9 visits all year!  An interesting statistic uncovered on a weight loss management company revealed that testimonials was the page most viewed by users but only became popular after the 2nd interaction.</p>\n<h2>SEO Foundations</h2>\n<p>At first glance, the simplest of business owners perceive SEO (if they even know what it stands for) to be cumbersome and highly technical.  While only partly true, Search Engine Optimization needs to be well thought out, prior to any website launch.  Understanding the foundations of SEO is crucial to either maintaining existing Google page rank, or setting the basis for allowing Google to actually find and index your site.  There are stories abound of firms that had built the nicest of WordPress sites, but had failed to install and implement any of the free SEO extensions. The increase in traffic and ultimately revenue by maintaining proper SEO foundations easily proves valuable.</p>\n<p>While simple and cheap websites proliferate the landscape, understand that you are essentially getting a hair dresser to perform a chinplant.</p>\n', '<p>New technology has forced us to reconsider our faces in more ways than one. Consider the recent news, according to the American Society of Plastic Surgeons, that the body part inspiring more people to go under the knife is the chin.  &#8220;Chinplants&#8221; are becoming the fastest growing cosmetic surgery trend. The growth in online video [&hellip;]</p>\n', 3026, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37');
