(47, 1495, '2011-12-29T12:55:42', 11, '2018-02-06T19:09:46', 'linkedin-generate-leads-and-close-them', 'publish', 'https://leverage.it/linkedin-generate-leads-and-close-them/', 'Know Who You Know &#8211; Building Your Network Through LinkedIN', '<p>Linkedin has been a part of my vocabulary really since its launch.  While I have been striving to build my online business networking world for years, it has only been recently that I have started to see its power and success.  The impetus to write this post actually came about through an incident I recently heard from one of my good friends.  It definitely wasn&#8217;t LinkedIn&#8217;s first success story nor will it be the last, however, it was one that happened with such fluidity and simplicity that it really made it a defining moment for me in my relationship with LinkedIN.</p>\n<p><!--more--></p>\n<p>In describing its power, it would probably be best to just tell over the story. Steve E. had been working at a respectable Toronto accounting firm for more than 5 years, having a love &#8211; hate relationship with the industry, but trying valiantly to excel at his job and provide for his family. One of his clients at the accounting firm was an overseas based Tech Incubator. They mentioned that they were looking for more investors in one of their local offerings. Thinking outside the box, Steve proceeded to LinkedIN, where he located a few peers that were working for private family-run investment firms.  Using his stature, he was able to cold call and lure them into meetings where he was able to close upwards of $20 million in investment dollars.  Steve attributed this success to the simplicity in discovering <strong>who were his prime targets and which of those prime targets he was already connected to</strong>.</p>\n<p>In searching for material for this post, I found an amazing google+ post (see this <a href=\"http://www.leviait.com/1474\">post</a> regarding how google+ posts are now in Google search terms) by <a href=\"https://profiles.google.com/117357232755322984060\" rel=\"author\">Abhilash Prakash</a>  &#8211;  <a title=\"16 Jun 2011 03:17:56\" href=\"https://profiles.google.com/117357232755322984060/buzz/TVPvAztnwQy\" target=\"_blank\">16 Jun 2011</a>  &#8211;<br />\n&#8220;I regret for underestimating the power of Linkedin all these days and wasting my time on Facebook&#8230; Even an incomplete profile like mine on Linkedin does wonders for me 🙂<br />\nI am Flying :-)&#8221;</p>\n<p>While most people laud LinkedIn for its ability to further job creation in terms of looking for employment or employees, I wish to focus on its innate ability to further networking for leads/sales generation.  Though it is impossible to put a price tag on marketing/branding, I will easily admit that I personally have not seen any dollars from a LinkedIn connection.  Since I have not generated any dollars from LinkedIn, it is definitely not my place to explain how to do so. You may however seek out a few posts which describe the best methods such as <a href=\"http://www.websuccessteam.com/WSTblog/2011/09/linkedin-lead-generation/\">Maximizing the power of LinkedIN</a> By Bob Speyer and Alison Brown or see the video below.</p>\n<p><object width=\"400\" height=\"225\" classid=\"clsid:d27cdb6e-ae6d-11cf-96b8-444553540000\" codebase=\"http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,40,0\"><param name=\"allowfullscreen\" value=\"true\" /><param name=\"allowscriptaccess\" value=\"always\" /><param name=\"src\" value=\"http://vimeo.com/moogaloop.swf?clip_id=21485474&amp;server=vimeo.com&amp;show_title=0&amp;show_byline=0&amp;show_portrait=0&amp;color=&amp;fullscreen=1&amp;autoplay=0&amp;loop=0\" /><embed width=\"400\" height=\"225\" type=\"application/x-shockwave-flash\" src=\"http://vimeo.com/moogaloop.swf?clip_id=21485474&amp;server=vimeo.com&amp;show_title=0&amp;show_byline=0&amp;show_portrait=0&amp;color=&amp;fullscreen=1&amp;autoplay=0&amp;loop=0\" allowfullscreen=\"allowfullscreen\" allowscriptaccess=\"always\" /></object></p>\n<p>Another story to illustrate LinkedIn&#8217;s penchant for closing deals.   Although Yosi Heber is very modest in demeanour, he has such an impressive resume and history of accolades that when first meeting him, you are completely blown away by his acute understanding of the simplicity of business and marketing.   His wide range of expertise took him from Marketing genius at Dannon where he invented the $550 milliion dollar yogurt kid category all the way to Chief Marketing Officer responsible for internet giants such as hotels.com, ticketmaster, and match.com.  Although one might think that a man of his stature and experience would not engage in new marketing capabilities, he is now President of Oxford Hills Partners which helps large conglomerates integrate digital media into their overall marketing and business efforts and is responsible for a patent pending strategic web assessment tool.  It is this understanding of the digital age which led him to the adoption of LinkedIn when it was in its infancy.  Combining Linkedin with his networking and marketing skills led Yosi to reconnect (adding his contact list to linkedin) with some of his former colleagues who had always looked up to him and who then proceeded to use Oxford Hills in devising their online marketing approach.</p>\n<p>Although business school pushes an abundance of knowledge and education, it really does come down to who you know.  <strong>LinkedIn lets you know who you know.</strong>    In order to close any deal you must have some sort of knowledge and service/product but that alone does not allow you in the door.  LinkedIn allows you to easily knock on the <strong>right</strong> door and be <strong>allowed</strong> in.  The key to building up a strategic online community of newtorkers is to constantly engage them subtly with what you are actually doing, who your other clients are and what you can offer them.  If there was one thing I would advise Linkedin networkers,  it would to be passive about your pitch and to refrain from constantly barraging prospective clients with targeted emails and messages.  By being active engaging people, answering questions and quietly promoting your services, people will learn to respect you.</p>\n<p>Aside from the obvious benefit of business networking to actually find and solicit leads, LinkedIn can actually be a great way of finding the right people to answer your questions and issues.  I had recently purchased a subscrition based service to a digital carrier and aside from the lack of fine print, the customer service agents were absolutely horrible on the phone.  I was getting nowhere and quite frustrated. So I headed to LinkedIN, searched for the culprit company and found out that I was connected to the Ceo of the Canadian operations.  I invited him to connect with me and proceeded to recount my tale in the 300 characters an invitation is alloted.   He never accepted my invitation, however I did receive an email shortly thereafter offering me a full year free.</p>\n<p>Whatever you actually use it for, LinkedIn will be become your most well connected friend.</p>\n<p><a href=\"http://vimeo.com/21485474\">Welcome Back to Good Old Fashioned Networking and Deal Making via LinkedIn</a> from <a href=\"http://vimeo.com/mmlabs\">MMLabs</a> on <a href=\"http://vimeo.com\">Vimeo</a>.</p>\n', '<p>Linkedin has been a part of my vocabulary really since its launch.  While I have been striving to build my online business networking world for years, it has only been recently that I have started to see its power and success.  The impetus to write this post actually came about through an incident I recently heard [&hellip;]</p>\n', 3028, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(48, 1486, '2011-12-15T05:01:10', 11, '2018-02-06T19:11:16', 'lets-get-technical-ubercart-free-order-with-recurring-billing', 'publish', 'https://leverage.it/lets-get-technical-ubercart-free-order-with-recurring-billing/', 'Lets Get Technical: Ubercart Free Order with Recurring billing', '<p>In working on a recent project we encountered a problem. The client wanted the ubercart to have certain functions, namely:</p>\n<ul>\n<li>Recurring billing</li>\n<li>Coupon codes up to and including 100% off</li>\n</ul>\n<p>No rocket science, right? It wasn’t that easy to make it work though, we needed three modules:</p>\n<ul>\n<li><a href=\"http://drupal.org/project/uc_recurring\">UC Recurring Payments and Subscriptions</a></li>\n<li><a href=\"http://drupal.org/project/uc_coupon\">Ubercart Discount Coupons</a></li>\n<li><a href=\"http://drupal.org/project/uc_free_order\">UC Free Order Payment Method</a></li>\n</ul>\n<p><!--more--></p>\n<p>In working on a recent project we encountered a problem. The client wanted the ubercart to have certain functions, namely:</p>\n<ul>\n<li>Recurring billing</li>\n<li>Coupon codes up to and including 100% off</li>\n</ul>\n<p>No rocket science, right? It wasn’t that easy to make it work though, we needed three modules:</p>\n<ul>\n<li><a href=\"http://drupal.org/project/uc_recurring\">UC Recurring Payments and Subscriptions</a></li>\n<li><a href=\"http://drupal.org/project/uc_coupon\">Ubercart Discount Coupons</a></li>\n<li><a href=\"http://drupal.org/project/uc_free_order\">UC Free Order Payment Method</a></li>\n</ul>\n<h4>How to allow for free checkouts without a payment method?</h4>\n<p>You probably understand the need for the first two, but why do we need the last one? When you shop online and are told you are getting a 100% coupon, and then on the last step of checkout are asked for Credit card details, it sure looks suspicious, and could turn away a lot of customers.</p>\n<h4>Replacing the credit card payment method</h4>\n<p>The solution to that is to tell Ubercart that when order total is less then one cent, there is a different payment method that is to replace the credit card method. This is where this module comes in. Here is how the module creator summarized it:</p>\n<blockquote>\n<div>“The UC Free Order Payment Method module works in conjunction with the payment checkout pane using the order total preview to present a “Free order” payment method to customers when their order total drops to $0.00 or less. By default, this method will be hidden with Javascript and displayed only when appropriate. Server side verification of an order total on checkout form submission is used to prevent customers from gaming the system.”</div>\n</blockquote>\n<div></div>\n<p>And it does work great, except when you have a recurring item in the cart, at which point Ubercart acts confused, on one side it has the free order method saying that since you have a $0 order you should use the “free payment method”, on the other end is the recurring payment module saying since this order has recurring product, you should use one of the payment methods (like paypal wps) that support recurring billing. The solution we came up with was to extend the free payment method to support the recurring billing.</p>\n<p>The developers who worked on this are:</p>\n<ul>\n<li>David Adler from <a title=\"binahsoft\" href=\"http://www.binahsoft.com/\">www.binahsoft.com</a></li>\n<li>Nathan Bomshteyn from <a title=\"bomshteyn.com\" href=\"http://bomshteyn.com/\">bomshteyn.com</a></li>\n</ul>\n', '<p>In working on a recent project we encountered a problem. The client wanted the ubercart to have certain functions, namely: Recurring billing Coupon codes up to and including 100% off No rocket science, right? It wasn’t that easy to make it work though, we needed three modules: UC Recurring Payments and Subscriptions Ubercart Discount Coupons [&hellip;]</p>\n', 3030, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(49, 1474, '2011-12-11T14:59:46', 11, '2018-02-06T19:11:04', 'googled-googly-eyed', 'publish', 'https://leverage.it/googled-googly-eyed/', 'I&#8217;ve Been GOOGLED', '<p>I will finally admit.  I have been googled.  I could be referring to the easy ability to uncover all online dirt on anyone by searching their name in google, which I will candidly reveal is something I do all the time when hearing of a potential client or person.  In fact, Ken Auletta in his book entitled, &#8220;Googled: The end of the world as we know it&#8221;, uses the term googled in this type of context as he says in his opening lines:</p>\n<blockquote><p>&#8220;The world has been googled. Type a question in the google search box, as do more than 70 percent of all searchers worldwide, and in about half a second answers appear.&#8221;</p></blockquote>\n<p>While wikipedia stays away from an official position on the term googled, Urban Dictionary ventures to define, &#8220;To do an internet search on someone/ something..&#8221;</p>\n<p><!--more--></p>\n<p>I will finally admit.  I have been googled.  I could be referring to the easy ability to uncover all online dirt on anyone by searching their name in google, which I will candidly reveal is something I do all the time when hearing of a potential client or person.  In fact, Ken Auletta in his book entitled, &#8220;Googled: The end of the world as we know it&#8221;, uses the term googled in this type of context as he says in his opening lines:</p>\n<blockquote><p>&#8220;The world has been googled. Type a question in the google search box, as do more than 70 percent of all searchers worldwide, and in about half a second answers appear.&#8221;</p></blockquote>\n<p>While wikipedia stays away from an official position on the term googled, Urban Dictionary ventures to define, &#8220;To do an internet search on someone/ something..&#8221;</p>\n<p>While I am sure many people have googled my name and I will continue to use &#8216;googled&#8217; in that context, when I say I have been googled, I am actually referring to my total insubordination to google when it comes to my online life.  It slowly crept up on me starting with basic searching, and then gradual application usage such as gmail, calendar and documents for my personal life. Three years ago, Google started encroaching on my business life when they launched Google Apps. Now, I am permanently hooked.</p>\n<h4>Google Apps and Google+</h4>\n<p>The reality of all that google has done for the business consumer in the past few years will result in direct business for their social media, primarily in the success of Google+.  Let me explain by taking a look at the numbers.  Google Apps is currently signing up 5000 new business&#8217;s a day on the strength of its lower cost (80 percent lower) than its competitor, Microsoft Office 360.  While google is still struggling to sign up larger corporations due to Office&#8217;s entrenchment and the challenge of converting end users to a new operating system, it still dominates the small/medium sized business world.  Contrary to popular belief, it is small/medium sized businesses that are the largest employers in North America and it is they who are looking for more internal collaboration and project management, while utilizing a simple cost-effective solution and one that can integrate with their personal lives.  It is these users who will fuel Google+ growth.  And these users google needs to focus on.</p>\n<h4>What Google must do to compete with Twitter, Facebook, and LinkedIn</h4>\n<div>It really is simple.  In order for Google+ to at least play in the same league as Facebook, Twitter and LinkedIn, it must focus on its most valuable base and cater its offering to them.  In its capacity as a social media platform, as well as integration with Docs, Chat, Calendar, Maps, Reader, Groups, etc&#8230;, Google+ should initially position itself as a business and project based social networking application.  It should open up its wall posts to project-based online collaboration through google docs, calendar for milestones, and assignment of tasks to its contacts.</div>\n<div></div>\n<h4>Bringing business and personal together with Google+</h4>\n<div></div>\n<div>Once the 75 million google apps users begin to utilize the business functionality of Google+, it will be inevitable that they will see the same value in sharing with their personal friends.  Then we will be able to finish off the saying, &#8220;Facebook can make friends, Twitter can make you famous, Linkedin can make you money and Google+ will make you in control.&#8221;</div>\n', '<p>I will finally admit.  I have been googled.  I could be referring to the easy ability to uncover all online dirt on anyone by searching their name in google, which I will candidly reveal is something I do all the time when hearing of a potential client or person.  In fact, Ken Auletta in his [&hellip;]</p>\n', 3032, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(50, 1445, '2011-11-07T12:54:14', 11, '2018-02-06T19:10:52', 'social-media', 'publish', 'https://leverage.it/social-media/', 'Social Media-fried: The Big Four Networks You Should Focus On', '<p>Is social media starting to get you confused as an entrepreneur?  With so many social media platforms and little time for building actual sales, entrepreneurs and business owners are starting to get &#8220;social media-fried&#8221;.  In an attempt to help solve these issues, marketing companies have been aggressively offering &#8216;Social Media Marketing&#8217;, large conglomerates have created new executive level positions such as CSMO (Chief Social Media Officer), and <a href=\"http://www.cnbc.com/id/41395941\">billions of dollars are now being pushed toward social media marketing</a>.</p>\n<p><!--more--></p>\n<p>Is social media starting to get you confused as an entrepreneur?  With so many social media platforms and little time for building actual sales, entrepreneurs and business owners are starting to get &#8220;social mediafried&#8221;.  In an attempt to help solve these issues, marketing companies have been aggressively offering Social Media Marketing, large conglomerates have created new executive level positions such as CSMO (Chief Social Media Officer), and <a href=\"http://www.cnbc.com/id/41395941\">billions of dollars</a> are now being pushed toward social media marketing.</p>\n<p>However much we discuss the impressive rise of social media among Fortune 500 companies a new report does suggest that vs. small to medium sized businesses its growth was in fact, decreased. This year, <a href=\"http://www.gosimplysocial.com/blog/big-fans-of-social-media-the-fortune-500-companies/\">62 percent of large corporations</a> took advantage of the Twittersphere, up just 2 percentage points over 2010. Also this year, 58 percent of firms manage Facebook pages as compared to 56 percent last year.</p>\n<p>However the same study indicates that smaller corporations &#8212; specifically, those included in the annual Inc. 500 listing of American&#8217;s fastest-growing companies &#8212; host twice as many blogs than their bigger, better-known brethren. And 71 percent of Inc. 500-listed companies have Facebook pages, while 59 percent use Twitter on a regular basis.</p>\n<p>This post is not about lauding the effect proper implementation of social media can actually have on their marketing efforts or bottom dollar.  We all know it actually works.  There is no need to quote the astronomical numbers (just one in particular &#8211; 45% of all Indian marketing dollars are now targeted to social media companies).</p>\n<p>Now although we know most small businesses do have some sort of social media representation vs. fortune 500 companies, it&#8217;s the continuing array of platforms that is getting us all confused.  Most have got the &#8220;big three&#8221; covered, namely Facebook, Twitter and now LinkedIn, but it&#8217;s all the new platforms and add-ons that keep springing on up that have got us all bent out of shape.</p>\n<p>To make matters worse, Google, the largest software company in the world, decided to join the fray after their first attempt, Google Buzz failed miserably.  With Google+ totally integrated with all their other applications, we are being pushed against the wall to create the, &#8220;Final four&#8221;.</p>\n<p><a class=\"frame-holder alignleft\" href=\"https://i0.wp.com/www.leviait.com/wp-content/uploads/2011/11/google-+.jpeg?resize=259%2C194\"><img title=\"google +\" src=\"https://i0.wp.com/www.leviait.com/wp-content/uploads/2011/11/google-+.jpeg?resize=259%2C194\" alt=\"\" width=\"259\" height=\"194\" data-recalc-dims=\"1\" /></a>While I may not have the answers to solving the cumbersome task of understanding every social media company out there, I do have ample reason to suggest which companies we should be targeting and investing most of our social media strategy on.  There will always be new and clever social media companies emerging on the market and other successful ones gaining in popularity and functionality, however our valuable company attention span needs to have focus and a limited approach in order to be successful.</p>\n<p>Although I do happen to be a google groupie and therefore have a tainted and bias position, it is illogical to suggest any other company who will be as dynamic a force.  In another blog post, I will explain the many reasons I believe Google+ will eventually emerge as a social media superpower if it is not considered one already.  However, in order not to leave you hanging, I will suggest the primary reason which is really quite simple.  The fact that Google already dominates the search, email, cloud based business platforms, and has the largest data centres in the world is just a testament to their ability to merge and integrate all their myriad cloud applications together.  This is the single most pivotal reason Google+ will be able to dominate the landscape and merge email, search, business marketing, youtube, online business collaboration and communications together with their new social media application.</p>\n<p>So there is no need to get confused.  Just get focused on the &#8220;big four&#8221; and you will emerge as a social media maven.</p>\n', '<p>Is social media starting to get you confused as an entrepreneur?  With so many social media platforms and little time for building actual sales, entrepreneurs and business owners are starting to get &#8220;social media-fried&#8221;.  In an attempt to help solve these issues, marketing companies have been aggressively offering &#8216;Social Media Marketing&#8217;, large conglomerates have created [&hellip;]</p>\n', 3034, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(51, 1439, '2011-11-04T00:13:22', 11, '2018-02-06T19:10:45', 'be-like-walmart', 'publish', 'https://leverage.it/be-like-walmart/', 'Walmart&#8217;s Success? It&#8217;s Inventory Management System', '<p><span class=\"Apple-style-span\" style=\"line-height: 18px;\">If you happen to be standing in the middle of a big box retailer such as Target or Walmart, and you look around, you happen to be witnessing one of history&#8217;s greatest logistical triumphs.  Retailers such as <a href=\"http://www.walmart.ca/en\">Walmart</a>, <a href=\"http://www.bestbuy.ca/\">Best Buy</a> and <a href=\"www.homedepot.ca/\">Home Depot</a> stock thousands of items from all over the world.  At any given time, Walmart, the world&#8217;s largest retailer, manages around $32 billion in inventory from items made in more than 70 countries.</span></p>\n<p><!--more--></p>\n<div>If you happen to be standing in the middle of a big box retailer such as Target or Walmart, and you look around, you happen to be witnessing one of history&#8217;s greatest logistical triumphs.  Retailers such as <a href=\"http://www.walmart.ca/en\">Walmart</a>, <a href=\"http://www.bestbuy.ca/\">Best Buy</a> and <a href=\"www.homedepot.ca/\">Home Depot</a> stock thousands of items from all over the world.  At any given time, Walmart, the world&#8217;s largest retailer, manages around $32 billion in inventory from items made in more than 70 countries.</div>\n<div></div>\n<div>With numbers such as these, it is imperative to have an effective, and efficient<a href=\"http://en.wikipedia.org/wiki/Inventory_management_software\"> inventory management system</a>.  Walmart&#8217;s particular system helps it maintain its signature &#8220;everyday low prices&#8221; by informing store managers which products are selling and which are taking up shelf and warehouse space.</div>\n<div></div>\n<div>It is easy to attribute Walmart&#8217;s incredible rise to #1 retailer in the world to great products, cheap prices and strategic placement of stores.  It has the &#8220;<span style=\"color: #333333;\"><a href=\"http://www.usanfranonline.com/resources/supply-chain-management/walmart-keys-to-successful-supply-chain-management/#.VBjmAC5dVEk\">highest sales per square foot, inventory turnover, and operating profit of any discount retailer</a>&#8220;. </span>However, <a href=\"http://en.wikipedia.org/wiki/Walton_family\">the Walton family</a>, founders of Walmart are all eager to admit that it was due to their heavy investment in IT and communications systems to effectively track sales and inventory that enabled them reduce ineffective inventory, appropriately price products, and keep real-time track of logistics and product placement.</div>\n<div></div>\n<div>Although dreaming of becoming Walmart is a touch unrealistic, learning from them and other great companies is what makes us move onward, and one day, just maybe, become chief supplier to Walmart. And although we can&#8217;t invest $4 billion dollars in IT systems like Walmart, we must understand the reason behind their investment and that we can on a smaller scale create the proper infrastructure.</div>\n', '<p>If you happen to be standing in the middle of a big box retailer such as Target or Walmart, and you look around, you happen to be witnessing one of history&#8217;s greatest logistical triumphs.  Retailers such as Walmart, Best Buy and Home Depot stock thousands of items from all over the world.  At any given time, Walmart, the [&hellip;]</p>\n', 3040, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(52, 1381, '2011-09-05T16:35:39', 11, '2018-02-06T19:10:34', 'increasing-clouds', 'publish', 'https://leverage.it/increasing-clouds/', 'The gathering cloud computing', '<div style=\"text-align: left;\">As the summer clouds begin to dissipate to make way for the laden clouds of winter, there are some clouds that just don&#8217;t seem to go away and are only increasing in their intensity.  <a href=\"http://en.wikipedia.org/wiki/Cloud_computing\">Cloud computing</a> is all the rage. &#8220;It&#8217;s become the phrase du jour,&#8221; <a href=\"http://www.infoworld.com/article/2683784/cloud-computing/what-cloud-computing-really-means.html\">says Gartner senior analyst Ben Pring</a>, echoing many of his peers. The problem is that (as with Web 2.0) everyone seems to have a different definition.</div>\n<div style=\"text-align: left;\"></div>\n<div style=\"text-align: left;\"><span class=\"Apple-style-span\" style=\"font-family: arial, verdana, \'Lucida Grande\', sans-serif;\">Chances are, you use Google products a lot, whether to search online, watch YouTube videos, or download a book.  You are effectively using the cloud.  </span><span style=\"font-family: \'Lucida Grande\', Arial, sans-serif;\">The reality and the simple definition is that cloud computing is </span>where our digital data no longer exists on our home computers, but in server farms. The basic advantage is that we can access it from anywhere, reduces infrastructure costs and allows the easy scalability required of adapting software applications.</div>\n<div style=\"text-align: left;\"></div>\n<div style=\"text-align: left;\"><!--more--></div>\n<div style=\"text-align: left;\">\n<div>As the summer clouds begin to dissipate to make way for the laden clouds of winter, there are some clouds that just don&#8217;t seem to go away and are only increasing in their intensity.  <a href=\"http://en.wikipedia.org/wiki/Cloud_computing\">Cloud computing</a> is all the rage. &#8220;It&#8217;s become the phrase du jour,&#8221; <a href=\"http://www.infoworld.com/article/2683784/cloud-computing/what-cloud-computing-really-means.html\">says Gartner senior analyst Ben Pring</a>, echoing many of his peers. The problem is that (as with Web 2.0) everyone seems to have a different definition.</div>\n<h2>What is cloud computing?</h2>\n<div><span class=\"Apple-style-span\">Chances are, you use Google products a lot, whether to search online, watch YouTube videos, or download a book.  You are effectively using the cloud.  </span>The reality and the simple definition is that cloud computing is when our digital data no longer exists on our home computers, but in server farms. The basic advantage is that we can access it from anywhere, reduces infrastructure costs and allows the easy scalability required of adapting software applications.</div>\n<div></div>\n<h3>Cloud computing explained: Google Apps</h3>\n</div>\n<div>A case in point would be the adoption of <a href=\"http://www.google.com/enterprise/apps/business/\">Google Apps</a> into the day to day running of LeverageIT which is now being deployed to 1 in 5 medium-sized businesses.  Utilizing Google Apps has streamlined our email communication, document collaboration, and the efficient scheduling of meetings and events.  <a href=\"https://docs.google.com\">Google Docs</a> is effectively making a strong point of eliminating or reducing in-house office collaboration.  With developers now in multiple countries, Google Apps has allowed us to stay in constant communication, collaboration and accountability.</div>\n<div></div>\n<div>In another blog post, I will share the specific benefits of Google Apps and what we have used to effectively transform our business to Web 2.0.  As you can tell, I happen to be a big fan of Google and their enterprise software.  Being that I am such a big fan, I am however disappointed that Google only rolled out Google+ to non-apps, non-paying users.  It is enticing to think about the collaboration that will eventually be achieved through Google Circles, Group Video chat.  Basically, utilizing a social media platform specifically for business communication and collaboration.</div>\n<div></div>\n<div>Thinking and working in a cloud has transformed me and my business.  But am I relying too much on Google?</div>\n', '<p>As the summer clouds begin to dissipate to make way for the laden clouds of winter, there are some clouds that just don&#8217;t seem to go away and are only increasing in their intensity.  Cloud computing is all the rage. &#8220;It&#8217;s become the phrase du jour,&#8221; says Gartner senior analyst Ben Pring, echoing many of [&hellip;]</p>\n', 3042, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(53, 921, '2011-04-27T13:52:16', 11, '2018-02-06T19:10:25', 'wordpress-vs-drupal', 'publish', 'https://leverage.it/wordpress-vs-drupal/', 'WordPress or Drupal &#8211; That is the Question', '<p>I spend most of my working days working with <a title=\"Drupal\" href=\"http://www.drupal.org/\" rel=\"homepage\">Drupal</a> so it’s no surprise that my first <a title=\"Blog\" href=\"http://en.wikipedia.org/wiki/Blog\" rel=\"wikipedia\">blog post</a> on my personal site was about Drupal. You probably noticed though, that my blog runs on <a title=\"WordPress\" href=\"http://wordpress.org/\" rel=\"homepage\">WordPress</a>. I know someone will point it out to me and ask me why, and I got this question today from a friend of mine. So I decided to write a blog post about the general difference between WordPress and Drupal, and when you should choose one or the other.</p>\n<p>Let&#8217;s start with an excerpt from the WordPress.org site:</p>\n<blockquote><p>WordPress started as just a blogging systems, but has evolved to be used as full <a title=\"Content management system\" href=\"http://en.wikipedia.org/wiki/Content_management_system\" rel=\"wikipedia\">content management system</a> and so much more through the <a href=\"http://wordpress.org/extend/\">thousands of plug-ins, widgets, and themes</a>, WordPress is limited only by your imagination. (And tech chops.)</p></blockquote>\n<p>Now my thoughts based on experience and observation:</p>\n<p><!--more--></p>\n<p><a href=\"https://wordpress.com/\">WordPress</a> is an excellent system to use when creating a <a title=\"Website\" href=\"http://en.wikipedia.org/wiki/Website\" rel=\"wikipedia\">website</a> that lets you quickly get your thoughts out on the web, but while it is often used as a blog, it can be configured to work in many other interesting ways as well. I have used it several times with clients that are brand new to the Internet and having a website, yet they can pick this system up and use it quicker than the other two (<a href=\"https://www.drupal.org/\">Drupal</a> or <a title=\"Joomla\" href=\"http://www.joomla.org/\" rel=\"homepage\">Joomla</a>). Since WordPress is already developed to work as a blog, though, it can be set up to do so without much trouble. Comments are already built into the system, as well as pinging services, multiple blogger profiles, track-backs and more. Most of the time nothing needs to be done to those systems either, because they already work the way that the user would want them to.</p>\n<h3>WordPress, however, is not to be used for everything.</h3>\n<p>While I know there are e-commerce sites powered by WordPress, people have had little success (it&#8217;s there, just not much) using WordPress as a shopping cart. The reason that WordPress was created, was to put the keys of starting your own websites in everyone&#8217;s hands, take for instance their famed <a href=\"https://www.youtube.com/watch?v=ell0SiTZyX8\">five-minute install</a>. But by doing it they stripped it to the bare minimum, which in turn now stops people from wanting to customize it to do more advanced things. It is supposed to be used as built, out of the box, because any modification that you give to it may very well cause it to break. You will find many users of WordPress complaining that it is not developer-friendly and rightfully so. When WordPress releases new updates, sites have been known to disappear or lose previously made modifications.</p>\n<h3><strong>WordPress Pros:</strong></h3>\n<ul>\n<li>Simple to use – no need for modifications</li>\n<li>Excellent for blogging or sharing thoughts in a sequential manner</li>\n<li>Not need to be tech-savvy to use</li>\n</ul>\n<h3><strong>WordPress Cons:</strong></h3>\n<ul>\n<li>Not very developer-friendly</li>\n<li>The community seems to like to complain much more than the Drupal community</li>\n<li>Upgrades, while they are extremely easy to do, sometimes bring more bugs than fixes, and the more plugins you have the bigger the chance of it happening</li>\n</ul>\n<h3>When Drupal is a better fit for you</h3>\n<p>If you are the type of person who would rather hand-code the content of your pages than use a <a title=\"WYSIWYG\" href=\"http://en.wikipedia.org/wiki/WYSIWYG\" rel=\"wikipedia\">WYSIWYG</a> Editor, or if you enjoy tweaking the code that makes up the framework of a website, then Drupal is probably for you. This advanced content management system, sometimes more closely resembles a developer platform than a traditional CMS. It&#8217;s not to say that only developers can use the system though, but to say that they will feel more at home here than in the other two. Interestingly, being more developer-friendly does not automatically make it more <a title=\"Usability\" href=\"http://en.wikipedia.org/wiki/Usability\" rel=\"wikipedia\">user friendly</a> in fact the developer has to work hard to make it that way if they need the end-product to do so.</p>\n<p>There are dozens more functions that can be used to develop in Drupal than in WordPress. Every single node has its own set of commands and tags that can be placed elsewhere to manipulate the function of the site, and this makes for a very intense experience (whether or not you know what you are doing). For those that are not so developer-minded, this can be the trial of their lives, but for people who live in code well, they can literally get lost developing some very cool websites.</p>\n<h3>Why Drupal doesn&#8217;t always look that great</h3>\n<p>Now, Drupal websites can act and function in some pretty cool ways, but Drupal has the problem that it just doesn’t look that great (at least not without long hours of work…). I have seen very few websites built in Drupal that look and feel as good as they function. Not that they don’t exist they are just few compared to the other ones. And the problem is not that it&#8217;s not themable, take for example a site we made (in conjunction with <a href=\"http://u2r1media.com/\">U2R1media</a>) for <a href=\"http://amaravati.ca/\">Amaravati</a>, a gorgeous site but we spent probably almost twice the time on the theming as on functionality. So the problem is just the opposite its very theme-able and customizable, but out of the box it looks like a site back from nineties, and theming has an extremely steep learning curve. You can especially see this in the theme directory on the <a title=\"Drupal\" href=\"http://drupal.org/\">Drupal.org</a> website, where there are dozens of these themes built to prove the exact point I just made. It’s a shame really, because with all of the development advancements the software has, it would almost be perfect with a stronger usability and design interface. It has made huge improvements with the core 6.x but more is needed and according to what I have read and seen about Drupal core 7.x they are putting a lot of effort into this area, but we will have to wait until it’s first stable release is out and then some time until all the important modules have their stable releases out the door.</p>\n<h3><strong>Drupal Pros:</strong></h3>\n<ul>\n<li>Extremely developer-friendly.</li>\n<li>Strong community to help discern the dozens (hundreds) of functions, modules and patches available.</li>\n<li>Can be used to create some really awesome websites that can outperform a majority of other sites out there.</li>\n<li>Scales as no other system would</li>\n</ul>\n<h3><strong>Drupal Cons:</strong></h3>\n<ul>\n<li>Not very designer and user-friendly. It’s hard for someone with little code knowledge to make the leaps required to do the very cool things that Drupal is becoming known for.</li>\n<li>Themes for Drupal has been a huge case of fail (until recently). Probably because it has been developers, not designers, that are making the themes.</li>\n<li>Getting a Drupal website published could cost you more time, and thus more money, than WordPress website.</li>\n<li>While WordPress could be hosted on very cheap hosting, Drupal needs an access to a lot of RAM.</li>\n</ul>\n<h3>A vote of confidence for Drupal</h3>\n<p>Drupal was all over the news a couple of month ago when <a title=\"The White House\" href=\"http://whitehouse.gov/\">WhiteHouse.gov</a> remade their website in Drupal, it was definitely a vote of confidence in Drupal’s security by a site thats one of the most targeted by hackers in the world. Now while WordPress was not chosen by the White House, it’s known that BlackBerry is considered a brand of secure communications, so much so that even the President of United States Barack Obama was permitted by his security team to have one, and when they recently remade their <a title=\"Inside BlackBerry Blog\" href=\"http://blogs.blackberry.com/\">Inside BlackBerry blog</a> they used WordPress. So as far as Security is concerned, i would say it should not be on top of your list if you create in either one of the systems.</p>\n<p>What do you consider to be the pros and cons of each system? Do you disagree with any of the remarks I made about them? please feel free to leave a comment.</p>\n<p>Written by our <a title=\"Drupal Guru\" href=\"http://www.bomshteyn.com\">Drupal &amp; WordPress Guru</a> Nathan</p>\n', '<p>I spend most of my working days working with Drupal so it’s no surprise that my first blog post on my personal site was about Drupal. You probably noticed though, that my blog runs on WordPress. I know someone will point it out to me and ask me why, and I got this question today from a friend of mine. [&hellip;]</p>\n', 3036, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(54, 919, '2011-04-27T13:49:46', 11, '2018-02-06T20:14:03', 'amazon-is-on-a-massive-hiring-spree-but-why', 'publish', 'https://leverage.it/amazon-is-on-a-massive-hiring-spree-but-why/', 'Native vs. Non-native: We&#8217;re Talking Mobile', '<p>It’s 2011 and debate rages on in the mobile industry over the future of applications.</p>\n<p>On one hand, people seem to love native client apps. A quick download process from an app store, and the shiny icon is sitting on the mobile device’s desktop, ready to go.</p>\n<p>What’s more, as a developer, I might even get paid for it. But if I want to reach lots of users, I have to write different code for every single device platform: iPhone, Android, Symbian. That’s a lot of code to keep in sync. And I need users to keep updating the applications every time I make a small change.</p>\n<p><!--more--></p>\n<p>It’s 2011 and debate rages on in the mobile industry over the future of applications.</p>\n<p>On one hand, people seem to love native client apps. A quick download process from an app store, and the shiny icon is sitting on the mobile device’s desktop, ready to go.</p>\n<p>What’s more, as a developer, I might even get paid for it. But if I want to reach lots of users, I have to write different code for every single device platform: iPhone, Android, Symbian. That’s a lot of code to keep in sync. And I need users to keep updating the applications every time I make a small change.</p>\n<p>On the other hand, the mobile web. Build a site which looks and feels like a self-contained application but which can render nicely on a variety of platforms. (<span style=\"color: #ff6600;\">HTML5</span> and <span style=\"color: #ff6600;\">Jquery</span> mobile are proving this to be true). I might not be able to make money by selling access to it, but I can update the site whenever I want, and users will see the latest and greatest version.</p>\n<p>In reality, there’s an essential role to be played by both types of application – as there is for computing in general. But the debate still continues and <span style=\"color: #ff6600;\">LeverageIT</span> can guide you to decide what fits best for your company.</p>\n<p>We believe that mobile goes beyond apps. To engage customers or enable employees, businesses must be able to expose core functionality to the right people and on the right devices. Consumer-facing mobile products must be rich and engaging, while internal apps must be secure and efficient. Whether through iPhone app development or broader consulting services, our mission is to empower our clients to make the most of mobile.</p>\n', '<p>It’s 2011 and debate rages on in the mobile industry over the future of applications. On one hand, people seem to love native client apps. A quick download process from an app store, and the shiny icon is sitting on the mobile device’s desktop, ready to go. What’s more, as a developer, I might even [&hellip;]</p>\n', 3038, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(55, 918, '2011-04-27T13:47:44', 11, '2018-02-06T19:10:03', 'cleats-and-data-clarity', 'publish', 'https://leverage.it/cleats-and-data-clarity/', 'Cleats and Data Integrity: The Locker Room Story', '<p dir=\"ltr\">It started 37 years ago with a pair of football cleats made of kangaroo leather. That&#8217;s how John Forzani, an ex- football player who couldn&#8217;t find his favorite pair of cleats decided to open The Locker Room in Calgary.</p>\n<p dir=\"ltr\">Now, after a colorful few decades that saw massive expansion, the Forzani story is about to end with a $770 million dollar takeover bid.</p>\n<p dir=\"ltr\"><!--more--></p>\n<p dir=\"ltr\">It started 37 years ago with a pair of football cleats made of kangaroo leather. That&#8217;s how John Forzani, an ex- football player who couldn&#8217;t find his favorite pair of cleats decided to open The Locker Room in Calgary.</p>\n<p dir=\"ltr\">Now, after a colorful few decades that saw massive expansion, the Forzani story is about to end with a $770 million dollar takeover bid.</p>\n<p dir=\"ltr\">In a quote from CTV news, &#8220;Indeed, technology woes are just as much a part of Forzani&#8217;s history as kangaroo-leather shoes. In the early &#8217;90s the Forzani group launched a public offering and went after their competitors by buying up Sport Chek and Sports Experts. That&#8217;s when things started falling apart. The three banners each had their own computer system, there were two different buying offices, and an inventory management system that created deficiencies.</p>\n<p dir=\"ltr\">&#8220;It almost cost us the company,&#8221; Mr. Forzani, said in an interview Monday. &#8220;The key factor is that we didn&#8217;t have the proper technology&#8221;. The enlarged company ended up with tens of millions of dollars in excess inventory and had to slash prices.</p>\n<p dir=\"ltr\">Now we should all be so fortunate to receive buyout offers of this magnitude, but the reality is that Technology is at the CORE of your business.</p>\n<p dir=\"ltr\">LeverageIT has spent many hours with one of our clients customizing a midware application that processes orders from Magento to multiple warehouses and dropshippers.  It is with this data integrity and core data  functionality that we were striving for.</p>\n', '<p>It started 37 years ago with a pair of football cleats made of kangaroo leather. That&#8217;s how John Forzani, an ex- football player who couldn&#8217;t find his favorite pair of cleats decided to open The Locker Room in Calgary. Now, after a colorful few decades that saw massive expansion, the Forzani story is about to [&hellip;]</p>\n', 3044, '2019-04-11 02:14:21', '2019-04-26 01:14:37', '2019-04-26 01:14:37'),
(56, 25, '2019-04-25T21:14:20', 9, '2019-04-26T00:31:15', 'are-you-ready-to-buy-your-house', 'publish', 'http://blogs.bdmrat.com/are-you-ready-to-buy-your-house', 'Are You Ready To Buy Your House?', '\n<p class=\"text-center\"><img src=\"http://blogs.bdmrat.com/wp-content/uploads/2019/04/ready_to_buy_own_house.jpg\" alt=\"ready_to_buy_own_house\"></p>\n<p style=\"text-align: left;\">Owning house can be the dream of your life . But it comes with a range of responsibility and liabilities. Think beforehand if you are ready for them. Answer the following question, know if you are ready.&nbsp;</p>\n<p><strong>Costs come in many forms</strong></p>\n<p>Paying mortgage is not the only cost. Costs come in different forms: property tax, repair and renovation, utility, home insurance, maintenance. Have you considered them all ?</p>\n<p><strong>House is a long term commitment</strong></p>\n<p>Do you have stable job or any other source of income for a longer period of time?</p>\n<p><strong>House requires some extra time</strong></p>\n<p>Living in a rented house is easy. Just writing a cheque in every month. Do you have enough time to supervise the maintenance or paying the bills?</p>\n<p>If your answers are yes, you are ready.</p>\n', '<p>Owning house can be the dream of your life . But it comes with a range of responsibility and liabilities. Think beforehand if you are ready for them. Answer the following question, know if you are ready. </p>\n', 26, '2019-04-26 01:14:36', '2019-04-29 03:48:30', NULL);
