(57, 61, '2019-04-27T01:23:21', 9, '2019-04-27T01:23:21', 'a-new-crosswalk-rule-in-on-drivers-must-know-to-avoid-penalty', 'publish', 'http://blogs.bdmrat.com/a-new-crosswalk-rule-in-on-drivers-must-know-to-avoid-penalty', 'A new crosswalk rule in ON drivers must know to avoid penalty', '\n<p class=\"text-center\" ><img src=\"http://blogs.bdmrat.com/wp-content/uploads/2019/04/cross_walk.jpg\" alt=\"\"0/></p>\n<h4><strong>A new crosswalk law in ON is in place. Article explains why confusion between crossover and crosswalk may lead to fine and demerits points.</strong></h4>\n<p>Crossover or Crosswalk? Does it differ a lot to you?</p>\n<p>Many people could use the words interchangeably in their everyday conversation. And it would not change the meaning.   </p>\n<p>You can still use the words interchangeably in your talk. It would not cost you money.  But if you mix them up while you are driving, you may have to pay $150-$500 and get 3 demerits points.  There is new rule in place with effect from January 01, 2016.</p>\n<p>A pedestrian crossover is a pedestrian crossing facility identified by specific signs, pavement markings and overhead lights in combination with pedestrian-activated flashing beacons.</p>\n<p>A crosswalk is a crossing location usually found at intersections with traffic signals, pedestrian signals or stop signs.</p>\n<p><strong> </strong></p>\n<p><em><strong>Starting January 1st, 2016</strong>, drivers (including cyclists) must stop and yield the whole roadway at:</em></p>\n<ul>\n<li><em>pedestrian crossovers; and,</em></li>\n<li><em>at school crossings where there is a crossing guard displaying a school crossing stop sign.</em></li>\n</ul>\n<p><em>These rules apply at pedestrian crossovers identified with specific signs, road markings and lights – the new rules do not apply to pedestrian crosswalks at intersections with stop signs or traffic signals, unless a school crossing guard is present.</em></p>\n<p> </p>\n<p>The phrase “yield the whole roadway” suggests that you have to wait until pedestrians have completely crossed the road.</p>\n<p>This rule is not applicable to crosswalks at normal intersections. However, you have to adhere to existing traffic signal rules.</p>\n<p><strong>Fines</strong></p>\n<p>Drivers will be fined <strong>$150 to $500 and 3 demerit points</strong> for offences at pedestrian crossings, school crossings and at crosswalks where there are traffic signals. The maximum fine for running a red light &#8211; a practice that puts pedestrians at risk &#8211; is $200 to $1000.</p>\n<p>Fines are <strong>doubled in Community Safety Zones,</strong> near schools and public areas. These areas are clearly marked with signs.</p>\n<p> </p>\n<p>You can learn more detail from <a href=\"http://www.mto.gov.on.ca/english/safety/pedestrian-safety.shtml\" target=\"_blank\" rel=\"noopener noreferrer\">new traffic rule about pedestrian crossover </a>at MTO website. The Globe and mail  has nice article on<a href=\"http://www.theglobeandmail.com/globe-drive/culture/commuting/what-is-the-new-crosswalk-rule-in-ontario-and-whats-the-reason-for-it/article28392316/\" target=\"_blank\" rel=\"noopener noreferrer\"> new traffic rules about crossover and crosswalk</a>.</p>\n', '<p>A new crosswalk law in ON is in place. Article explains why confusion between crossover and crosswalk may lead to fine and demerits points. Crossover or Crosswalk? Does it differ a lot to you? Many people could use the words interchangeably in their everyday conversation. And it would not change the meaning.    You can [&hellip;]</p>\n', 62, '2019-04-29 03:48:29', '2019-04-29 03:48:29', NULL),
(58, 57, '2019-04-27T01:19:02', 9, '2019-04-27T01:19:02', 'how-to-treat-and-prevent-urine-infection-naturally', 'publish', 'http://blogs.bdmrat.com/how-to-treat-and-prevent-urine-infection-naturally', 'How to treat and prevent urine infection naturally', '\n<p class=\"text-center\"><img src=\"http://blogs.bdmrat.com/wp-content/uploads/2019/04/treat_UTI_naturally.png\" alt=\"\"/></p>\n<p>Urinary Tract Infection (UTI) is one of the most common infections that can complicate your life. If you are a woman, chance of suffering from UTI is lot higher. Women suffer more frequently than man.</p>\n<h2>Symptoms of UTI</h2>\n<ul>\n<li>Painful urination and burning</li>\n<li>Frequent urges for urination</li>\n<li>Urine may be cloudy and even tinged with blood</li>\n<li>Fever</li>\n</ul>\n<h2>Treating Urine Infection naturally</h2>\n<p>While in more severe cases antibiotics are more appropriate, you may want to <a href=\"http://www.everydayhealth.com/urinary-tract-infections/helpful-home-remedies-for-urinary-tract-infections.aspx\" target=\"_blank\" rel=\"noopener noreferrer\">try natural ways to fight milder form of UTI</a>.</p>\n<p>Here are some of the ways-</p>\n<ul>\n<li>Drink plenty of fluid ( water or non-caffeinated beverage)</li>\n<li>Avoid alcohol and drinks with high Sugar</li>\n<li>Apply gentle heat to pelvic area</li>\n<li>Eat foods with lot vitamin C. Juice of citrus fruits are particularly helpful.</li>\n<li>Cranberry juice is regarded as one of the best remedy for Urine infection.</li>\n</ul>\n<h2>Preventing UTI</h2>\n<ul>\n<li>Quit smoking.</li>\n<li>Wear loose cotton clothing and underwear.</li>\n<li>Wipe yourself clean from front to bottom.</li>\n<li>Urinate after sex.</li>\n</ul>\n<p>The video from WaysandHow explained <a href=\"https://www.youtube.com/watch?v=FyIr7pWpEh8\" target=\"_blank\" rel=\"noopener noreferrer\">how to treat and prevent UTI naturally</a> in detail. However, be careful to use baking soda. Over intake of baking soda could be dangerous.</p>\n', '<p>Urinary Tract Infection (UTI) is one of the most common infections that can complicate your life. If you are a woman, chance of suffering from UTI is lot higher. Women suffer more frequently than man. Symptoms of UTI Painful urination and burning Frequent urges for urination Urine may be cloudy and even tinged with blood [&hellip;]</p>\n', 58, '2019-04-29 03:48:30', '2019-04-29 03:48:30', NULL),
(59, 54, '2019-04-27T01:12:38', 9, '2019-04-27T01:19:59', 'defrost-car-windshield-in-seconds', 'publish', 'http://blogs.bdmrat.com/defrost-car-windshield-in-seconds', 'Defrost car windshield in seconds', '\n<p class=\"text-center\"><img src=\"http://blogs.bdmrat.com/wp-content/uploads/2019/04/defrost_car_window.png\" alt=\"\"></p>\n<p>Who loves to scrape ice from windshield in icy cold morning? Nobody does. Moreover, you should be very careful. Any forceful stroke may damage your windshield.</p>\n<p>Defroster solution might cost you money. But there is one simple way, you can try. Mix 2/3 cup of&nbsp;<a href=\"https://en.wikipedia.org/wiki/Rubbing_alcohol\" target=\"_blank\" rel=\"noopener noreferrer\">rubbing alcohol</a>&nbsp;with 1/3 cup of water. Put it in spray bottle. That should work immediately. Freezing point of Alcohol is ridiculously low (-180<sup>0</sup>&nbsp;C). It should melt the ice in seconds. Me</p>\n<p>You do not believe me. Check out these two trustworthy posts.</p>\n<p><a href=\"https://www.facebook.com/WATE.KenWeathers/?fref=photo\" target=\"_blank\" rel=\"noopener noreferrer\">Meteorologist Ken weather</a>&nbsp;explains the process.</p>\n<p><a href=\"http://www.independent.co.uk/news/uk/home-news/how-to-defrost-your-windscreen-very-very-quickly-a6811141.html\" target=\"_blank\" rel=\"noopener noreferrer\">Defrost windshield</a>&nbsp;in seconds in Independent.</p>\n', '<p>Who loves to scrape ice from windshield in icy cold morning? Nobody does. Moreover, you should be very careful. Any forceful stroke may damage your windshield. Defroster solution might cost you money. But there is one simple way, you can try. Mix 2/3 cup of&nbsp;rubbing alcohol&nbsp;with 1/3 cup of water. Put it in spray bottle. [&hellip;]</p>\n', 55, '2019-04-29 03:48:30', '2019-04-29 03:48:30', NULL),
(60, 51, '2019-04-27T01:06:55', 9, '2019-04-27T01:06:55', 'steps-to-buy-a-house-in-toronto', 'publish', 'http://blogs.bdmrat.com/steps-to-buy-a-house-in-toronto', 'Steps to buy a house in Toronto', '\n<p class=\"text-center\"><img src=\"http://blogs.bdmrat.com/wp-content/uploads/2019/04/Steps-to-buy-a-house.jpg\" alt=\"\"/></p>\n<p><span class=\"example1\">Buying a house is perhaps one of the most difficult decisions you make in life. Not only because of the huge amount money  you are investing, but also because you and family are going to spend the best time of life in that lovely place. The process is also not very easy. You have to go through a rigorous procedure to own a house.<strong> The scope of the article is not to make you specialized person, rather to make you knowledgeable enough to start the job.  </strong></span>        </p>\n<h2><strong><a href=\"http://www.banglatoronto.ca/infoblog/ready-to-buy-house\" target=\"_blank\" rel=\"noopener noreferrer\">Are you ready to buy a house?</a></strong></h2>\n<p> You certainly have some savings to invest. You can roughly estimate the amount you need to borrow and what amount you have to pay monthly. Then you can decide if your financial health is good enough to afford a house.</p>\n<h2><strong><a href=\"http://www.banglatoronto.ca/infoblog/know-your-financial-strength-before-search-for-house\" target=\"_blank\" rel=\"noopener noreferrer\">Measure your financial strength from a specialist</a></strong></h2>\n<p>If you think, you are ready. Now this is the time to verify how much amount loan you are entitled to get. Get a pre-approval. Pre-approval is usually valid for 90 days.</p>\n<h2><strong>Find an agent</strong></h2>\n<p>Finding a right agent is the most crucial decision you have to make. Pick an agent who has enough experience and, and above all, who you can trust. An experienced agent will guide you through the whole process.</p>\n<h2><strong><a href=\"http://www.banglatoronto.ca/infoblog/Searching-your-dream-home\">Looking for House</a></strong></h2>\n<p>It’s good to list out what are things you must want in house. Look online resources to find the house/condo that meets need and falls within budget.  Make a list. Research on the neighborhood. Pick the best among list. Making a decision for a house is perhaps very difficult to make. Remember nobody ever gets perfect house. Try to pick the best one.</p>\n<h2><strong><a href=\"http://www.banglatoronto.ca/infoblog/making-an-offer-and-closing-the-deal\" target=\"_blank\" rel=\"noopener noreferrer\">Formal offer for the property</a></strong></h2>\n<p>Offering for a property is a delicate, leaves a little room for the mistake. This is a legally binding documents which includes price, specifications and other details.  You might land in bidding war, an experienced realtor would guide you through this process.</p>\n<h2><strong><a href=\"http://www.banglatoronto.ca/infoblog/making-an-offer-and-closing-the-deal\" target=\"_blank\" rel=\"noopener noreferrer\">Finalize the offer</a></strong></h2>\n<p>Once your offer is accepted, you will be able to submit the security deposit. At this stage , your lender would  perform  appraisal and verify the financial information. A home inspection has to be done as well to close the deal.</p>\n<h2><strong>Close the deal</strong></h2>\n<p>This is the final step when legal and financial obligations are met. Usually attorney and lender are involved in the process. Now you are proud home owner! Chill!</p>\n', '<p>Buying a house is perhaps one of the most difficult decisions you make in life. Not only because of the huge amount money  you are investing, but also because you and family are going to spend the best time of life in that lovely place. The process is also not very easy. You have to [&hellip;]</p>\n', 52, '2019-04-29 03:48:30', '2019-04-29 03:48:30', NULL),
(61, 47, '2019-04-27T01:02:31', 9, '2019-04-27T01:02:31', 'making-an-offer-and-closing-the-deal', 'publish', 'http://blogs.bdmrat.com/making-an-offer-and-closing-the-deal', 'Making an offer and closing the deal', '\n<p class=\"text-center\"><img src=\"http://blogs.bdmrat.com/wp-content/uploads/2019/04/making_an_offer.jpg\" alt=\"\"/></p>\n<p>Once you select your house, you need to make an offer to purchase the property. Offer is legally binding documents, needs lots of experience to prepare. Offer leaves little room for mistakes. Work diligently with your realtor to prepare the document. Offer is a part of negotiation too. An experienced realtor exactly know what you need to do to ensure the purchase.   Since the offer is   legal binding, you might ask your lawyer to look at it. Offer usually includes-</p>\n<ul>\n<li><strong>Names<br /></strong>Your legal name, the name of the vendor and the legal civic address of the property.</li>\n<li><strong>Price<br /></strong>The price you are offering to pay.</li>\n<li><strong>Things included</strong><br />Any items in or around the home that you think are included in the sale should be specifically stated in your offer. Some examples might be window coverings and appliances.</li>\n<li><strong>Amount of your deposit</strong></li>\n<li><strong>The closing day</strong><br />The closing day is the date you take possession of the home. It is usually 30 – 60 days after the date of agreement. But, it can be 90 days, or even longer.</li>\n<li><strong>Request for a current land survey of the property</strong></li>\n<li><strong>Date the offer expires</strong><br />After this date the offer becomes null and void — that means it’s no longer valid.</li>\n<li><strong>Other conditions</strong><br />Other conditions may include a satisfactory home inspection report, a property appraisal, and lender approval of mortgage financing. This means that the contract will become final only when the conditions are met.</li>\n</ul>\n<p><strong>What happens after the offer?</strong></p>\n<p>After you make the offer, the seller can accept the offer or make a counter offer by asking you to increase the price. During the process of this back and forth negotiations, you might have to increase the price a little and/ or compromise few things. Experienced realtors are very good at it. You might also land in bidding war. Your realtor would definitely help you to win the war.</p>\n<p>Reference: <a href=\"https://www.cmhc-schl.gc.ca/\" target=\"_blank\" rel=\"noopener noreferrer\">CMHC website</a></p>\n', '<p>Once you select your house, you need to make an offer to purchase the property. Offer is legally binding documents, needs lots of experience to prepare. Offer leaves little room for mistakes. Work diligently with your realtor to prepare the document. Offer is a part of negotiation too. </p>\n', 48, '2019-04-29 03:48:30', '2019-04-29 03:48:30', NULL),
(62, 43, '2019-04-26T00:49:14', 9, '2019-04-26T00:49:14', 'searching-your-dream-home', 'publish', 'http://blogs.bdmrat.com/searching-your-dream-home', 'Searching your dream home', '\n<p class=\"text-center\"><img  src=\"http://blogs.bdmrat.com/wp-content/uploads/2019/04/searching_your_dream_home.jpg\" alt=\"\"/></p>\n<p>Now you know your maximum budget. You have chosen the preferred neighborhoods. You know your requirements about home. You know the relevant terminologies. You can start looking for your house. Off course, your chosen realtor would be guiding you through the process. But more than 90% Canadians also search online.  </p>\n<p>There are plenty of resources out there to help you out. You can search the following list of websites. </p>\n<ul>\n<li>             <strong> Realtor.ca</strong></li>\n<li><strong>              Zoocasa.com</strong></li>\n<li><strong>              thedirt.co</strong></li>\n<li><strong>              theredpin.com</strong></li>\n<li><strong>              homebuyers.com</strong></li>\n</ul>\n<p>You can also go into the renowned real estate company’s website to find their offerings.</p>\n<p> </p>\n<p>You have to be very strategic from the beginning of the process. You need to build a list of properties which you think are within your financial reach and meet your need. Finally you have to do a comparative studies to select the best option for you. You can take help form<a href=\"https://www.cmhc-schl.gc.ca/en/co/buho/hostst/upload/Home-hunting-comparison-worksheet.pdf\" target=\"_blank\" rel=\"noopener noreferrer\"> this tool</a> to compare the properties you have selected initially.</p>\n', '<p>Now you know your maximum budget. You have chosen the preferred neighborhoods. You know your requirements about home. You know the relevant terminologies. You can start looking for your house. Off course, your chosen realtor would be guiding you through the process. But more than 90% Canadians also search online.   There are plenty of [&hellip;]</p>\n', 44, '2019-04-29 03:48:30', '2019-04-29 03:48:30', NULL),
(63, 39, '2019-04-26T00:43:55', 9, '2019-04-26T00:49:47', 'things-you-need-to-know-before-searching-house', 'publish', 'http://blogs.bdmrat.com/things-you-need-to-know-before-searching-house', 'Things you need to know before searching house', '\n<p class=\"text-center\"><img class=\"alignnone size-medium wp-image-40\" src=\"http://blogs.bdmrat.com/wp-content/uploads/2019/04/searching_house.jpg\" alt=\"\" srcset=\"http://blogs.bdmrat.com/wp-content/uploads/2019/04/searching_house.jpg 600w, http://blogs.bdmrat.com/wp-content/uploads/2019/04/searching_house-276x300.jpg 276w\" sizes=\"(max-width: 600px) 100vw, 600px\" /></p>\n<p><strong>Know what you want in your house</strong></p>\n<p>Before even start to look for your dream home, you might want to finalize your requirements. Certainly, it’s very difficult get everything you want in a house. So you might have to compromise your need due to the limitation of your budget.</p>\n<p>Make a list of things you must have in your house. Then make a list of things you would never allow in your house. Lastly, make a list of things which you would love to have, but not mandatory. You can use a&nbsp;<a href=\"https://www.cmhc-schl.gc.ca/en/co/buho/hostst/wosh_013.cfm\" class=\"broken_link\">home feature checklist</a>&nbsp;to figure out your requirement.</p>\n<p><strong>Choosing a neighborhood</strong></p>\n<p>Location is perhaps one of the crucial decision you have to make. &nbsp;There are lot of things you might consider before choosing a house. But it’s impossible to get everything in a single neighborhood. Some of the most important things you must consider are-</p>\n<ul>\n<li>Accessibility of the neighborhood to school, groceries, health services, gym and local parks.</li>\n<li>Safety is the biggest concern for everyone. You can check the crime report here before choosing the neighborhood.</li>\n<li>Demographic profile of neighborhood influences lot of buyer’s decision. You can access to the census data from Stat Canada or you can ask your realtor to get an overview of the demographic profile.</li>\n<li>As all of your family members may not be using cars all the time, you might consider accessibility of the public transport.</li>\n</ul>\n<p>Before selecting, do not forget to go in person, to get a look and feel of the neighborhood.</p>\n<p><strong>New home vs Resale home</strong></p>\n<p>Design: Newly built home definitely&nbsp;&nbsp; reflects latest trends, features and design. You can expect older features and design in resale home.</p>\n<p>Choice: For new home, you may have flexibility to choose certain feature. Or you may be able to add some features by extra money. As resale home are already built, you will hardly have any choice.</p>\n<p>Costs: Newly built homes are usually more costly than resale houses. You have to pay taxes for new built. On the other hand, maintenance cost of the resale home is higher than new house. You have to carefully consider the long term impact of maintenance and renovation cost.&nbsp;</p>\n<p>Warranty: New home may come with warranty. There is warranty for resale home.</p>\n<p><strong>&nbsp;Types of House</strong></p>\n<p>There are different types houses available for you to buy. Based on your requirements and financial capabilities, you will which type is most suitable for you. &nbsp;Most popular types are-</p>\n<p>Single-family Detached</p>\n<p>A single-family detached home is one dwelling unit. It stands alone, and sits on its own lot. This often gives the family a greater degree of privacy.</p>\n<p>Single-family Semi-detached</p>\n<p>A semi-detached home is a single-family home that is joined on one side to another home. It can offer many of the advantages of a single-family detached home. It is often less expensive to buy and maintain.</p>\n<p>Duplex</p>\n<p>A duplex is a building containing two single-family homes, located one above the other. Sometimes, the owner lives in one unit and rents the other.</p>\n<p>Row House (Townhouse)</p>\n<p>Row houses (also called townhouses) are several similar single-family homes, side-by-side, joined by common walls. They can be freehold or condominiums. They offer less privacy than a single-family detached home, although each has a separate outdoor space. These homes can cost less to buy and maintain, although some are large, luxury units.</p>\n<p>Stacked Townhouse</p>\n<p>Stacked townhouses are usually two-storey homes. Two two-story homes are stacked one on top of the other. The buildings are usually attached in groups of four or more. Each unit has direct access from the outside.</p>\n<p>Apartment</p>\n<p>A self-contained unit in part of a building consisting of a room or set of rooms including kitchen and bathroom facilities.</p>\n<p><strong>Types of ownership&nbsp;</strong></p>\n<p>There are two forms of ownership.</p>\n<p>Freehold</p>\n<p>Freehold means that one person (or two, such as joint ownership by spouses) owns the land and house outright. There is no space co-owned or co-managed with owners of other units.</p>\n<p>Freehold owners can do what they want with their property — up to a point. They must obey municipal bylaws, subdivision agreements, building codes and federal and provincial laws, such as those protecting the environment.</p>\n<p>Detached and semi-detached homes, duplexes and townhouses are usually owned freehold.</p>\n<p>Condominium</p>\n<p>Condominium ownership means you own the unit you live in and share ownership rights for the common space of the building. Common space includes areas such as corridors, the grounds around the building, and facilities such as a swimming pool and recreation rooms. Condominium owners together control the common areas through an owners’ association. The association makes decisions about using and maintaining the common space.</p>\n<p>&nbsp;&nbsp;</p>\n<p>Reference:&nbsp;<a href=\"https://www.cmhc-schl.gc.ca/\" target=\"_blank\" rel=\"noopener noreferrer\">CMHC Website</a></p>\n', '<p>Know what you want in your house Before even start to look for your dream home, you might want to finalize your requirements. Certainly, it’s very difficult get everything you want in a house. So you might have to compromise your need due to the limitation of your budget. Make a list of things you [&hellip;]</p>\n', 40, '2019-04-29 03:48:30', '2019-04-29 03:48:30', NULL),
(64, 32, '2019-04-26T00:14:24', 9, '2019-04-26T00:31:57', 'know-your-financial-strength-before-you-look-for-house', 'publish', 'http://blogs.bdmrat.com/know-your-financial-strength-before-you-look-for-house', 'Know your financial strength before you look for house', '\n<p class=\"text-center\"><img src=\"http://blogs.bdmrat.com/wp-content/uploads/2019/04/financial-strength.jpg\" alt=\"\" ></p>\n<p>Now you are mentally prepared. You have a stable income source. You have an amount for down payment.&nbsp; But you are not sure about the maximum amount you can invest to buy your dream home. We have a very handy&nbsp;<a href=\"http://www.banglatoronto.ca/calculator\" target=\"_blank\" rel=\"noopener noreferrer\">Affordability Calculator</a>&nbsp;to let you know about financial strength.</p>\n<p>&nbsp;Excited to check on the tool. Please hold it for few minutes more. We strong suggest to learn few things before you use the tool.</p>\n<p><strong>Down Payment:</strong></p>\n<p>This is the amount you have to pay upfront. The rule for minimum down payment has recently been changed. The minimum down payment for a house up to $500000 is 5% of price. If you want to purchase, anything more than $500000. Calculation is little different. The minimum down payment of first 500000 is 5% as previous.&nbsp;&nbsp; You have to give 10% of the remaining portion of the price as down payment. Let us give an example.</p>\n<p>Minimum down payment for $500,000 house is $25,000 (5% of home price)</p>\n<p>Minimum down payment for $600,000 house would be $35,000 (5% of the first $500000 + 10% of remaining $100,000)</p>\n<p><strong>Off course, you can get a mortgage with minimum down payment. But that will not be a&nbsp;<u>conventional mortgage</u>. You have to lend money from&nbsp;<u>high-ratio mortgage</u>, for which you have to pay a monthly insurance premium for your mortgage. &nbsp;However, you can avoid this extra premium if you give 20% or more as a down payment, which will qualify you for conventional mortgage.</strong></p>\n<p><strong>Pay off or Amortization period</strong></p>\n<p>Amortization refers to the number of year you want to repay your loan. This is usually 25 years. The period can be shorter. In that case , you have to pay less interest and monthly installment would be higher.</p>\n<p><strong>Interest Rate</strong></p>\n<p>There are three types of interest rate: Fixed rate, variable rate and protected variable rate.</p>\n<p>Fixed rate: Rate of the interest is fixed for a term. Whatever the market situation, your interest rate is fixed. Fixed Rate is little higher than others</p>\n<p>Variable rate: Your interest would be fluctuated as per the market rate. This is more suitable, when you presume interest rate may drop.</p>\n<p>Protected variable rate: This is similar to variable rate. However, maximum rate is determined beforehand, which means your interest rate can not be more than certain predetermined rate.</p>\n<p><strong>Choice of interest rate can be very critical. It needs a lot of speculation and knowledge to take the decision</strong></p>\n<p>&nbsp;</p>\n<p><strong>What is the maximum money you can have from lender?</strong></p>\n<p>Two simple rules guide the whole process-</p>\n<ol>\n<li>Your total monthly housing cost (monthly mortgage payment for house + property tax + heating cost) should not be more than 32% of your gross monthly family income before taxes.</li>\n<li>Your total monthly loan payments (monthly housing loan payments + other monthly loan or credit card payments) should not be more than 40% of gross monthly family income before taxes.</li>\n</ol>\n<p>Based on these two principles, bank determines two ration. Gross Debt Service (GDS) ratio and other one is Total Debt Service ratio.</p>\n<p><strong>GDS ratio</strong>&nbsp;is calculated simply dividing monthly total housing cost (monthly mortgage payment for house + property tax + heating cost) by monthly gross income of the family before taxes.</p>\n<p><strong>TDS ratio</strong>&nbsp;is calculated simply dividing total monthly entire debt load (monthly housing costs + other monthly loan or credit card payments) by gross monthly family income before taxes.</p>\n<p>Example: (you do not need to the calculation, use our&nbsp;<a href=\"http://www.banglatoronto.ca/calculator\" target=\"_blank\" rel=\"noopener noreferrer\">affordability calculator</a>, you will get the result automatically)</p>\n<p>Your monthly gross income = $5000</p>\n<p>Your spouse’s gross income = $3000</p>\n<p>Other sources of income (if any) = $2000</p>\n<p><strong>Your monthly gross family income= $10000</strong></p>\n<p>You are planning to buy a house of 500,000</p>\n<p>You are paying $ 25000 as down payment</p>\n<p>You need to borrow another $475000</p>\n<p>At an imaginary interest rate of 3.39 and for 25 years of repayment period, your monthly mortgage payments would be approximately $ 2350 (can be calculated from our<a href=\"http://www.banglatoronto.ca/calculator\" target=\"_blank\" rel=\"noopener noreferrer\">&nbsp;affordability calculator</a>)</p>\n<p>At present rate of City of Toronto, your yearly residential property tax would be 0.7056% of property price. Your monthly property tax would be $294.</p>\n<p>Your heating cost would be approximately $150.</p>\n<p><strong>Your monthly housing cost would be $ (2350+294+150) or $ 2794</strong></p>\n<p>Your monthly payment of your personal loan = $100</p>\n<p>Your monthly student loan payment =$100</p>\n<p>Your monthly credit card payment =$100</p>\n<p><strong>Your monthly entire debt load = $ 2794 + $100 + $100 + $100 = $3094</strong></p>\n<p><strong>So your GDS ratio would be 0.2794 and TDS ration would be 0.3094.</strong></p>\n<p>&nbsp;</p>\n<p><strong><u>To be eligible for loan, your GDS and TDS ratio should be lower than 0.32 and 0.40 respectively. In this particular case, you may be eligible for the required loan.</u></strong></p>\n', '<p>Now you are mentally prepared. You have a stable income source. You have an amount for down payment.&nbsp; But you are not sure about the maximum amount you can invest to buy your dream home. We have a very handy&nbsp;Affordability Calculator&nbsp;to let you know about financial strength. &nbsp;Excited to check on the tool. Please hold [&hellip;]</p>\n', 33, '2019-04-29 03:48:30', '2019-04-29 03:48:30', NULL),
(65, 64, '2019-05-01T22:08:21', 9, '2019-05-01T22:22:13', 'plants-brings-sleep', 'publish', 'http://blogs.bdmrat.com/plants-brings-sleep', 'ঘুম জাগানিয়া গাছেরা, থাকুক আপনার শোবার ঘরে', '\n<p class=\"text-center\"><img \"=\"\" src=\"http://blogs.bdmrat.com/wp-content/uploads/2019/05/aloe_vera.png\" alt=\"\"></p>\n<p>নিদ্রাবটিকা ঘুম তো আনেই, নেশাও জাগায়। রয়েছে ক্ষতিকর কিছু পার্শপ্রতিক্রিয়া । শোবার ঘরে যদি থাকে প্রকৃতির ছোঁয়া, তা আপনার ঘুমের সহায়ক হবে।</p>\n<p>বিশেষ করে কিছু গাছ, আপনাকে এনে দিতে পারে শান্তির ছোঁয়া। এটি কোন স্বপ্নে পাওয়া ওষুধ নয়, বৈজ্ঞানিক ভাবে প্রমাণিত।</p>\n<p><strong>ল্যাভেন্ডার গাছ</strong></p>\n<p>এটি REM sleep এর&nbsp;পরিমাণ কমিয়ে দিয়ে, আপনার গভীর ঘুমের পরিমাণ বাড়িয়ে দেয়। ফলে ঘুমের গুণগত মান বৃদ্ধি করে । মানুষ জেগে প্রশান্তি নিয়ে।</p>\n<p><strong>এলোভেরা</strong></p>\n<p>এলোভেরার রাত্রিকালীন অক্সিজেন নির্গমন ও কার্বনডাইঅক্সাইড শোষণের হার বেশী । ফলে বাতাস বিশুদ্ধ করতে এলোভেরা দারুণ কার্যকর।</p>\n<p><strong>স্পাইডার গাছ</strong><br>ফার্নিচার জোড়া লাগানোর আঠা, পুলটিস , ইত্যাদি থেকে ফরমলাডিহাইড নিঃসরিত হয়, যা শরীরে ক্যান্সারও সৃষ্টি করতে পারে। নাসার পরীক্ষায় প্রমাণিত, স্পাইডার গাছ ৯০ ভাগ পর্যন্ত ফরমালডিহাইড শোষণ করে নিতে পারে। স্পাইডার গাছ মানে, শয়নকক্ষে বিশুদ্ধতর বাতাস।</p>\n<p><strong>শান্তির পদ্ম বা পিস লিলি</strong><br>পিস লিলি ঘরের বাতাস থেকে দূর করে বেনজিন, ট্রাইক্লোরোইথিলিন ও ফরমালডিহাইড। বাতাসে যোগ করে আর্দ্রতা। ঘুমিয়ে থাকাকালীন অবস্থায় নাক ও গলাকে শুষ্ক হতে দেয় না।</p>\n<p><em>হ্যাপি স্লিপ!</em></p>\n', '<p>নিদ্রাবটিকা ঘুম তো আনেই, নেশাও জাগায়। রয়েছে ক্ষতিকর কিছু পার্শপ্রতিক্রিয়া । শোবার ঘরে যদি থাকে প্রকৃতির ছোঁয়া, তা আপনার ঘুমের সহায়ক হবে।</p>\n<p>বিশেষ করে কিছু গাছ, আপনাকে এনে দিতে পারে শান্তির ছোঁয়া। এটি কোন স্বপ্নে পাওয়া ওষুধ নয়, বৈজ্ঞানিক ভাবে প্রমাণিত।</p>\n', 65, '2019-05-02 02:11:28', '2019-05-02 02:22:36', NULL);
