(275, NULL, '1 bedroom basement apartment ', '1-bedroom-basement-apartment-', 'https://www.kijiji.ca/v-apartments-condos/city-of-toronto/1-bedroom-basement-apartment/1428855183', NULL, 'Scarborough, ON M1L 4E5, Canada', 'Available May 1st, 2019\n1 Bedroom basement apartment available for rent, in a newly built modern home. 11 Feet ceilings doesn’t feel like a basement. Features a separate entrance/ 1 bedroom, living/dining, 1 bathroom, small kitchen with brand new stainless steel appliances, separate washer dryer in basement.\nLocation: Warden and Danforth- 3 min walk to bus stop (frequent bus service going to Warden station, Kennedy, and Main street station) reach downtown in 30 mins. 10 minute drive to woodbine beach , reach Centennial College (Scarbrough location in 40 mins). Free street parking is also available if you own a vehicle.\nNo Pets ( no exception as I am highly allergic)\nNo Smoking of any kind (tobacco or marijuana my child is allergic)\nAsking for $1300 based on single occupancy and $1400 for couple per month plus utilities i.e Enbridge and Hydro. Percentage of utilities will be based on occupancy but at a minimum 30% and Maximum %40\nIf you are interested in viewing the space, please e-mail me at ankurvohra16@gmail.com with some basic information about yourself.\nYour Name, Contact number, place of employment.\nWe will be showing the unit on weekends in the afternoon\nAfter viewing the space to be considered further, I will require the following:\n-Credit Report (recent)\n-Copy of Driver’s License\n-Employment Confirmation\n-2 recent pay stubs\n-Reference from previous landlord\nCall or text 647 9897375', 'Etobicoke', NULL, 'Canada', 'basement', '', '', 'No', 'No', NULL, '800', '1300.0', 'https://i.ebayimg.com/00/s/ODAwWDYwMA==/z/yZMAAOSwt2FcvMTB/$_59.JPG', '-79.273125', '43.695366', NULL, 1, '2019-04-21 23:32:04', '2019-04-21 23:32:04', NULL),
