(470, NULL, '1 Bedroom Basement Apartment for Rent - East Toronto (East York)', '1-Bedroom-Basement-Apartment-for-Rent---East-Toronto-(East-York)', 'https://www.kijiji.ca/v-apartments-condos/city-of-toronto/1-bedroom-basement-apartment-for-rent-east-toronto-east-york/1429156456', NULL, '235 Westview Blvd, East York, ON M4B 3J7, Canada', 'Greetings!!\nI am renting out my recently renovated 1 bedroom basement apartment (separate entrance) east end Toronto (east york) close to St. Clair East and O\'Connor. Steps away from TTC (bus stop), close to amenities, grocery stores (No Frills, Wallmart, Costco), Eglinton Shopping Centre (The Bay, Winners, Canadian Tire, Home Depot, etc.), restaurants, bars and cafe\'s in the neighbourhood. Plenty of parking available on the street (for free), 15 minutes drive to downtown (without traffic) and 45-55 minutes with TTC.\nThe basement is spacious (540 sq.ft), with 1 bedroom, a bathroom with a stand alone shower (ceiling height for the shower is a bit low, If you are taller than 5\' 10\" (178cm), would be a bit uncomfortable to shower). The kitchen does not have an oven/stove so if you are Gordon Ramsey this is not the place for you! There is a decent microwave, a toaster oven and a double burner but obviously this place is not for someone who likes to cook often. The laundry room is in the basement, I live upstairs and will be sharing the laundry room with the tenant in the basement. You can use the washer and dryer and I will only be using it once a week on Sunday mornings. I am looking for one to two people short or long term. Looking for a quiet, respectful, clean and consensus person (or two) with proof of income and good credit history (and a couple of references). Students, young professionals are welcome. .. I will most likely be able to lend you a bed or a couple of furniture if you are planning to stay here for short term.\nIf you are interested, please tell me a little bit about yourself. Please don\'t be shy to ask any questions you may have.\nThanks, Dylan', 'Etobicoke', 'M4B', 'Canada', 'basement', '', '', 'No', 'Yes', NULL, '540', '1200.0', 'https://i.ebayimg.com/00/s/NjAwWDgwMA==/z/j~IAAOSwNXpcvlwB/$_59.JPG', NULL, NULL, NULL, 1, '2019-04-23 04:33:05', '2019-04-23 04:33:05', NULL),
