(886, NULL, 'Brand New Bachelor Apartment for Rent in Little Italy ', 'Brand-New-Bachelor-Apartment-for-Rent-in-Little-Italy-', 'https://www.kijiji.ca/v-apartments-condos/city-of-toronto/brand-new-bachelor-apartment-for-rent-in-little-italy/1430405621', NULL, 'M6G3J8, Canada', 'Spacious 420 ft2 basement bachelor apartment available for rent, based on annual rental term (starting anytime between May 1, 2019 and June 1, 2019). Brand new renovation (everything is new!). First time use (never rented before). En-suite (private) bathroom with exhaust fan, toilet, sink and tub/shower. Beautiful large, modern kitchen including stainless steel appliances (refrigerator, stove, microwave/exhaust hood), soft closing drawers and lots of cupboard and countertop space. New energy efficient, double pane operable windows (three in apartment!). New luxury vinyl flooring. One built in closet included. Recently structurally reinforced house (meets current code) with noise reducing drywall and insulation. 6.5 foot ceilings. Separate / private entrance. Vacuum provided.\nOptional: double bed mattress, box spring and frame available in addition to mirror, vacuum and bar stools for use if requested. Semi furnished apartment!\nLocation:\nThis is the heart of Little Italy, within walking distance of Metro Grocery Store, Ossington St, College St, Harbord St and amazing restaurants, bars and shops. Walking distance to College St streetcar, Harbord St buses, Bloor St subway (Christie Station or Ossington Station) and Ossington buses. Lots of excellent bike routes. 10 min bike, bus or steetcar to UofT. 20 min subway to downtown.\nWalk Score: 71. Transit Score: 93. Bike Score: 86.\nAmenities/Inclusions:\nTV Cable included (Basic cable, Sportsnet, TSN, HBO, Showtime, Rogers On Demand; no PVR).\nHigh Speed Wifi and Internet included.\nWeekly use of new hi-efficiency laundry (washer and dryer) included (two assigned days per week).\nWeekly use of backyard included (M-F, 9am to 5pm).\nNo on-site parking available, but street permits (not included) are available (subject to City approval).\nNew high efficiency heating and cooling included.\nElectricity, hot water, cold water and natural gas included.\nCost:\n$1,600.00 plus applicable taxes per month\nEarly payment discount available: $1,500.00 plus applicable taxes per month if paid in cash/etransfer on 1st of month, with no missed payments.\nOne month rent deposit required plus cleaning fee.\nTerms and conditions :\nCredit and background check required.\nNo pets. No smoking on property. Deposit will be forfeited if pets or smoking policy is violated.\n$250 cleaning fee due at end of term\nSingle occupancy only.\nPrevious landlord and employment references required.\nNo parties or more than two person occupancy at any time.\nNo loud music or noises.', 'Toronto', NULL, 'Canada', 'basement', '', '', 'No', 'No', NULL, '420', '1500.0', 'https://i.ebayimg.com/00/s/MTYwMFgxMjAx/z/lfMAAOSws7xcxeMy/$_59.JPG', '-79.4206291', '43.6582414', NULL, 1, '2019-04-28 21:33:06', '2019-04-28 21:33:06', NULL),
