(1666, NULL, 'Room for Rent from JUNE 01', 'Room-for-Rent-from-JUNE-01', 'https://www.kijiji.ca/v-room-rental-roommate/city-of-toronto/room-for-rent-from-june-01/1431807301', NULL, '4 Little Rock Dr, Scarborough, ON M1M 3N6, Canada', 'Unfurnished Single Basement Room for Rent at $715.00.\nThere are two rooms being rented, each at $715.00 Suitable for full-time worker, full-time college or university students (International Students are also welcome).\n-Takes 20 Minutes to Centennial Progress Campus and 25 Minutes to U of T Scarborough Campus. There\'s a 25 minute Bus ride to Scarborough Town Centre as well.\n-It comes with a shared kitchen, dinning space & shared washroom.\n-Separate entrance to the suite.\n-Utilities included (water, hydro, heat, laundry and high speed internet/Wifi).\n-Also with Central heat and Central AC.\n-Five minute walk to Eglinton GO station, five minute walk to nearest street level TTC Bus Stop (Bus# 9 from McCowan to Warden Station 10 minute Bus ride), 7 minutes by Bus to Kennedy Station.\n-Close to amenities such as NO Frills, Walmart, Metro, Goodlife Fitness, Home Depot, Tim Hortons, McDonalds, Restaurants, four parks around the neighborhood, R.H. King Academy School, Scarborough Village Public School, Ben Heppner Vocal Music Academy, Mason Road Junior Public School. Also 2.56 KM from Scarborough and Rouge Hospital General Campus.\n-Don’t forget, it’s 10 minutes to the BLUFFS!\nThere is NO PARKING available (unless you are ok to park on the street).\nYou will be sharing with another male tenant who’s very quiet. Looking for someone who is quiet, clean and respects others privacy.\nOccupancy’s from June 01, 2019.\nFirst & Last month along with security deposit required.', 'Etobicoke', 'M1M 3N6', 'Canada', 'basement', '', '', 'No', 'No', NULL, NULL, '715.0', 'https://i.ebayimg.com/00/s/NjQxWDgzNQ==/z/4J0AAOSw1OxczfRS/$_59.JPG', NULL, NULL, NULL, 1, '2019-05-05 00:23:05', '2019-05-05 00:23:05', NULL),
(1667, NULL, 'Furnished basement room for rent ', 'Furnished-basement-room-for-rent-', 'https://www.kijiji.ca/v-room-rental-roommate/city-of-toronto/furnished-basement-room-for-rent/1431812849', NULL, '304 Burrows Hall Blvd, Toronto, ON M1B 1H7, Canada', 'Close to Centennial college and UNIVERSITY of Toronto Scarborough CAMPUS. Minutes from Scarborough town Centre. Short walk to TTC bus stops. All amenities are included. Separate entrance. This is a must see!', 'Toronto', 'M1B', 'Canada', 'basement', '', '', 'Yes', 'No', NULL, NULL, '650.0', NULL, '-79.223206', '43.796482', NULL, 1, '2019-05-05 00:45:04', '2019-05-05 00:45:04', NULL),
(1668, NULL, 'One fully furnished room for rent working female/student requir', 'One-fully-furnished-room-for-rent-working-female/student-requir', 'https://www.kijiji.ca/v-room-rental-roommate/city-of-toronto/one-fully-furnished-room-for-rent-working-female-student-requir/1431819805', NULL, '22 Shangarry drive, M1R1A3, Toronto/Scarboriugh, ON', 'Fully furnished one room with double bed available for rent in a bright fully furnished 2 bedroom Basement apartment, full washroom, kitchen, laundry room, living room is part of the basement apartment) rent $800 at Victoria Park & Eglinton. Preferred working females or student girls. No smoking, No pets, No male visitors. Family atmosphere. All Utilities, WIFI internet & parking included in the rent. Separate entrance. 5 minutes’ walking distance to No-frills, metro store, Walmart, Centennial College, Tim Horton, Starbucks, all outlet stores and amenities. Newly renovated, neat and clean beautiful, quiet home. Steps to TTC. First and last months required Contact 416-451-7115 Available immediate.', NULL, NULL, NULL, 'basement', '', '', 'Yes', 'No', NULL, NULL, '800.0', 'https://i.ebayimg.com/00/s/NTYxWDYxNw==/z/ezIAAOSw18Bczf~Q/$_59.JPG', '-79.30392789999999', '43.7308355', NULL, 1, '2019-05-05 01:14:04', '2019-05-05 01:14:04', NULL),
