(1671, NULL, 'Large furnished room for rent (warden & danforth rd) ', 'Large-furnished-room-for-rent-(warden-&-danforth-rd)-', 'https://www.kijiji.ca/v-room-rental-roommate/city-of-toronto/large-furnished-room-for-rent-warden-danforth-rd/1431823855', NULL, 'Warden Ave & Danforth Rd, Toronto, ON M1L, Canada', 'Large specious furnished room available for rent in a newly renovated basement for Only $650/ month utilities are all included. Very clean and very quiet, HI-Speed internet, Large open Eat-in-kitchen (share), washroom (share), High ceiling, Central AC, Separated Entrance, Close to all amenities, Corner of Warden and Danforth Rd, easy Access to three TTC Sub ways Warden/Main Station and Kennedy, Easy way to go to Downtown, Centinnial college,plaza, Groceries, mall. No smoking, No Pets, And lot more etc. Available from may01, 2019\nOnly for one person.\nPls call (416)669-9303.', 'Toronto', 'M1K 3H9', 'Canada', 'basement', '', '', 'Yes', 'No', NULL, NULL, '650.0', 'https://i.ebayimg.com/00/s/Mzg5WDgwMA==/z/cDIAAOSwpeJczgQl/$_59.JPG', '-79.27483', '43.69722', NULL, 1, '2019-05-05 01:31:04', '2019-05-05 01:31:04', NULL);
